INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(59174, 'esMX', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59173, 'esMX', 'Short-Supply Reward', '', '', '', '', '', '', '', '', 33528),
(59019, 'esMX', 'Llamamiento a las armas: Uldum', 'Asesina a miembros de la Horda en Uldum.', 'La incursión de la Horda ha puesto en peligro nuestra misión en Uldum.\n\nVe a Uldum y elimina a cuantos puedas.', '', '', '', '', '', '', 33528),
(59018, 'esMX', 'Llamamiento a las armas: Valle de la Flor Eterna', 'Asesina a miembros de la Horda en el Valle de la Flor Eterna.', 'La incursión de la Horda ha puesto en peligro nuestra misión en el Valle de la Flor Eterna.\n\nVe al Valle de la Flor Eterna y elimina a cuantos puedas.', '', '', '', '', '', '', 33528),
(59017, 'esMX', 'Llamamiento a las armas: Valle de la Flor Eterna', 'Asesina a miembros de la Alianza en el Valle de la Flor Eterna.', 'La llegada de la escoria de la Alianza es un obstáculo para nuestros objetivos en el Valle de la Flor Eterna.\n\nElimina a todos los que encuentres en la zona y vuelve a informar.', '', '', '', '', '', '', 33528),
(59016, 'esMX', 'Llamamiento a las armas: Uldum', 'Mata a miembros de la Alianza en Uldum.', 'La llegada de la escoria de la Alianza es un obstáculo para nuestros objetivos en Uldum.\n\nElimina a todos los que encuentres en la zona y vuelve a informar.', '', '', '', '', '', '', 33528),
(59003, 'esMX', 'Capullos inflamables', '', '', '', '', '', '', '', '', 33528),
(59000, 'esMX', 'Elementos de corrupción', 'Habla con MADRE para aprender más acerca de los objetos corruptos.', 'La corrupción se comporta de formas extrañas. Se propaga más allá de Azeroth, se conecta con nuestros pensamientos más íntimos, a veces hasta corrompe algunas reliquias, como has visto de primera mano.\n\nAunque no puedo decir nada sobre este asunto con certeza, tengo la certeza de que MADRE debe tener información sobre estos supuestos objetos de corrupción.', '', '', '', '', '', '', 33528),
(58991, 'esMX', 'Corrupción curiosa', 'Busca respuestas en la Cámara del Corazón acerca del objeto corrupto.', '<Este objeto en particular tiene algo inusual. Quizás alguien en la cámara sepa algo sobre su origen.>', '', '', '', '', '', '', 33528),
(58990, 'esMX', 'Huevo de titanus', '', '', '', '', '', '', '', '', 33528),
(58989, 'esMX', 'El ABC de la forja de runas', 'Usa la habilidad de forja de runas de tu libro de hechizos para encastrar una runa en tu arma.\n\nPodrás reemplazar la runa en cualquier momento, siempre y cuando estés cerca de una forja de runas.', 'Como caballeros de la Espada de Ébano, siempre debemos estar preparados para distintas situaciones marciales. Con ese fin, puedes emplear el arte oscura de la forja de runas, que te permite encastrar runas de gran poder en tus armas.\n\nArriba de nosotros, en el Corazón de Acherus, hay forjas de runas. Visita una y usa tu poder para infundir el poder de una runa a tu arma.', 'Arma ornamentada', '', '', '', '', '', 33528),
(58974, 'esMX', 'Colonos emboscados', '', '', '', '', '', '', '', '', 33528),
(58961, 'esMX', 'Colonos emboscados', '', '', '', '', '', '', '', '', 33528),
(58952, 'esMX', 'Llamas purgantes', '', '', '', '', '', '', '', '', 33528),
(58904, 'esMX', 'Fragmentos de corrupción', 'Consigue $0oa fragmentos de corrupción.', '<Sientes que algo oscuro e inhumano ataca tu mente, sus zarcillos intentan invadirte y sacarte la cordura a la fuerza. Sientes el deseo de conseguir más fragmentos… sientes el deseo de conseguir todos.>', '', '', '', '', '', 'Encuentra el ídolo de la iniquidad.', 33528),
(58903, 'esMX', 'Defensa de Azeroth', 'Habla con el Alto señor Darion Mograine. Luego, usa el portón de la muerte del alto señor para viajar a Orgrimmar. Una vez allí, toma una decisión desde el tablón de mando del jefe de guerra', 'Una excelente elección.\n\nSe avecinan tiempos difíciles. Como $guno de los pocos elegidos:una de las pocas elegidas;, es tu deber y tu privilegio defender nuestro mundo. Es un gran honor.\n\nPero también debes saber que te encontrarás con el desprecio de los ignorantes. A menudo, los mortales son incapaces de ver más allá de nuestra temible apariencia. No hagas caso a esos necios y cumple con tu deber.\n\nHabla con tu comandante y luego usa su portón de la muerte para viajar a la tierra de los vivos y elegir tu destino.', '', '', '', '', '', '', 33528),
(58902, 'esMX', 'Defensa de Azeroth', 'Habla con el Alto señor Darion Mograine. Luego, usa el portón de la muerte del alto señor para viajar a Ventormenta. Una vez allí, haz una decisión desde el tablero de ¡Se busca héroe!', 'Una excelente elección.\n\nSe avecinan tiempos difíciles. Como $guno de los pocos elegidos:una de las pocas elegidas;, es tu deber y tu privilegio defender nuestro mundo. Es un gran honor.\n\nPero también debes saber que te encontrarás con el desprecio de los ignorantes. A menudo, los mortales son incapaces de ver más allá de nuestra temible apariencia. No hagas caso a esos necios y cumple con tu deber.\n\nHabla con tu comandante y luego usa su portón de la muerte para viajar a la tierra de los vivos y elegir tu destino.', '', '', '', '', '', '', 33528),
(58887, 'esMX', 'Las alpacas desempacan', '', '', '', '', '', '', '', '', 33528),
(58881, 'esMX', 'Misión de seguimiento', '', '', '', '', '', '', '', '', 33528),
(58879, 'esMX', 'Las alpacas empacan', '', '', '', '', '', '', '', '', 33528),
(58877, 'esMX', 'El poder de la muerte crece', 'Jura lealtad al Rey Exánime.', 'Escucha con atención, $n. Una época de destrucción masiva se asoma en el horizonte, una época que cambiará nuestra existencia. Ahora más que nunca, debemos defender Azeroth.\n\nEs por esa razón que he expandido las filas de mis campeones para incluir a los $r. Tu sacrificio te distingue de los demás. Mantén la cabeza en alto. Hasta el fin de los tiempos, serás un caballero de la muerte de la Espada de ébano.\n\nAhora jura tu lealtad.', '', '', '', '', '', '', 33528),
(58876, 'esMX', 'Vuelo perdido', 'Lleva el engendro de Vexiona a Wrathion en la Cámara del Corazón.', '<Un pequeño dragón surge de una de las cámaras laterales dentro del gran caparazón de N\'Zoth. Parece confundido.\n\nSupones que esas cámaras se habrán usado para corromper dragones exponiéndolos directamente a los susurros oscuros de N\'Zoth. A una edad temprana, se habrían vuelto locos, más que cualquier otro miembro del vuelo crepuscular que hayas conocido.\n\nDe semejante locura no habría forma de regresar.\n\nAunque quizás no sea demasiado tarde para este pequeñín…>', '', '', '', '', '', '', 33528),
(58866, 'esMX', 'Mi propio obrero', 'Llévale la silla de montar sobrenatural a H\'parkho Ardoros, en Ramkahen.', 'La silla de montar está terminada. No puedo decir que disfruté trabajar con ese metal corrompido, pero a fin de cuentas, puedo decir que es la mejor silla de montar que haya fabricado.\n\nSé que se ve bien... agresiva, pero te aseguro que será muy cómoda para tu aqir.\n\nEspero que te sea de utilidad.', '', '', '', '', '', '', 33528),
(58865, 'esMX', 'Armamentos sobrenaturales', 'Recoge $1oa armamentos del Imperio Negro de los cultistas del Imperio Negro en Uldum y el Valle de la Flor Eterna.', 'Para crear la silla de montar para tu bestia, necesitaré algunos materiales especiales. Principalmente, necesitaré metales mucho más livianos que los que tenemos disponibles.\n\nHe observado que los cultistas del Imperio Negro llevan armas hechas con materiales sobrenaturales, que son increíblemente livianos y fuertes.\n\nSi pudieras traerme algunas de sus armas, quizá pueda derretir ese metal y forjar una silla de montar para el aqir.', '', '', '', '', '', '', 33528),
(58863, 'esMX', 'Un pedido personalizado', 'Habla con el herrero Abasi en Ramkahen.', 'Creo que es seguro decir que nuestro pequeño amigo ya no es una cría, ¡sino un aqir adulto! Ha crecido tanto, de hecho, que podría cargarte hacia la batalla.\n\nEy, ¡esa es una idea brillante!\n\nDeberías hablar con el herrero Abasi para que fabrique una silla de montar.', '', '', '', '', '', '', 33528),
(58862, 'esMX', 'El defensor más pequeño', 'Derrota a Baruk Defensor Pétreo en un duelo de mascotas con tu cría puasombra en tu grupo.', 'Los mogu baruk son conocidos por animar estatuas antiguas para que funcionen como defensoras de su territorio. Son un enemigo resistente y se puede aprender mucho luchando contra un enemigo con defensas tan rígidas.\n\nPor fortuna, parece que uno de sus moldeapiedras animó por error a un ídolo pequeño. Los mogu que lo crearon lo han desechado porque no les es de utilidad, pero podría convertirse en una oportunidad de entrenamiento valiosa para nuestra cría.\n\nEncuentra a este defensor miniatura en el Valle de la Flor Eterna.', '', '', '', '', '', '', 33528),
(58861, 'esMX', 'El desafío de los mántides', 'Derrota a la cría vil\'thik en un duelo de mascotas con tu cría puasombra en tu grupo.', 'Observar las técnicas de combate de los mántides podría resultar útil para el entrenamiento de nuestra cría, pues le ofrecerá otra forma de usar las armas naturales de un insecto.\n\nHe encontrado un oponente mántide al que podría enfrentar nuestra cría en el Valle de la Flor Eterna. Llévalo y ve cómo resulta.', '', '', '', '', '', '', 33528),
(58860, 'esMX', 'Un alfazaque muy malo', 'Derrota al reptador de la arena aqir en un duelo de mascotas con tu cría puasombra en tu grupo.', 'A nuestra cría no le vendría nada mal enfrentarse a otro aqir para aprender de qué son capaces los de su especie.\n\nHe encontrado un oponente que podría darle una buena pelea.', '', '', '', '', '', '', 33528),
(58859, 'esMX', 'Alguien de su tamaño', 'Derrota a Retinus el Buscador en un duelo de mascotas con tu cría puasombra en tu grupo.', 'Pelear a tu lado es un excelente entrenamiento para nuestra cría, pero a veces es mejor que pelee por sí sola contra enemigos de su tamaño.\n\nSé dónde encontrar un adversario así, observando a los Amathet cerca del Obelisco de las Estrellas. Deberías buscarlo.', '', '', '', '', '', '', 33528),
(58858, 'esMX', 'Más filetes fétidos', 'Recoge $1oa piezas de carne corrupta de las criaturas que están en las áreas atacadas por los esbirros de N\'Zoth.', 'Este pequeño otra vez tiene hambre. \n\n¿Podrías conseguirle algo para comer?', '', '', '', '', '', '', 33528),
(58831, 'esMX', 'Perfeccionamiento de instintos', 'Usa el silbato de H\'parkho para invocar a tu cría aqir y pelear contra enemigos en Uldum o el Valle de la Flor Eterna. Si peleas contra enemigos más fuertes e inusuales tu cría crecerá más rápido.', 'Creo que nuestro pequeño amigo está ansioso y listo para practicar más movimientos de combate.\n\n¿Podrías enseñarle?', '', '', '', '', '', '', 33528),
(58830, 'esMX', 'Instintos aqir', 'Usa el silbato de H\'parkho para invocar a tu cría aqir y pelear contra enemigos en Uldum o el Valle de la Flor Eterna. Si peleas contra enemigos más fuertes e inusuales, tu cría crecerá más rápido.', 'Observé a los aqir en lucha contra los Vagayermos y noté que las crías se unen de inmediato al ataque. Parece que la necesidad de combate es una característica innata en estas criaturas.\n\nDeberíamos ejercitar esta cualidad en nuestro amiguito, bajo tu supervisión, por supuesto. Llévalo contigo y enséñale cómo pelear contra nuestros enemigos.\n\nTal vez no pueda pelear por mucho tiempo, así que no lo llames hasta que estés $glisto:lista; para el entrenamiento.\n^Con un poco de suerte, nos considerará parte de su colmena.', '', '', '', '', '', '', 33528),
(58829, 'esMX', 'Crecen tan rápido', 'Ayuda a la larva aqir a salir de su capullo en Ramkahen.', '¡Mira! Nuestra pequeña larva se ha transformado en una crisálida! \n\nUn momento... Parece que está a punto de salir. \n\nNo pierdas tiempo, ¡ayúdala!', '', '', '', '', '', '', 33528),
(58826, 'esMX', 'Un bocadillo sangriento', 'Recoge $1oa viales de ánima purificada de los mogu Dokani en el Valle de la Flor Eterna.', 'Oí que un clan mogu, los Dokani, dominan el arte de la fuerza vital gracias a una sustancia que llaman \"ánima\".\n\nSi esa sustancia es realmente vida condensada en forma líquida, podría tener propiedades fantásticas en nuestra larva aqir.\n\nVe a ver si puedes conseguir un poco de esa ánima en una forma que podamos usar. ¡Quizá a nuestro amiguito le guste!', '', '', '', '', '', '', 33528),
(58825, 'esMX', 'Superjalea', 'Recoge $1oa unidades de jalea real concentrada en el Valle de la Flor Eterna.', 'Mis amigos del Loto Dorado me han contado algunas cosas muy interesantes sobre el nuevo enjambre de mántides. Según parece, han fabricado una jalea real concentrada que acelera el crecimiento de los mántides recién nacidos. \n\nSi esta jalea es buena para los mántides, por lógica tiene que ser buena para los aqir.\n\nTrata de encontrar una muestra suficiente de esta jalea para ayudar a crecer a nuestra larva.', '', '', '', '', '', '', 33528),
(58818, 'esMX', 'Insectos colegas', 'Atrapa a $1oa crías de arenisca dóciles en Uldum.', '¿Me parece a mí o nuestro amiguito está demasiado solo? Supongo que los aqir son seres sociables, pues conviven en colmenas. Debe ser difícil para él no estar cerca de otros de su misma especie.\n\nQuizás puedas encontrarle algunos amigos. Nadie que sea muy grande y temible, claro. Tal vez algunos de los escarabajos más pequeños le brinden una compañía segura.\n\n¿Qué piensas?', '', '', '', '', '', '', 33528),
(58817, 'esMX', 'Figuras de acción', 'Recoge $1oa figurillas amathet de las criaturas amathet en Uldum.', 'Creo que nuestra pequeña larva se debe estar muriendo del aburrimiento. Deberíamos buscar algo para entretenerla.\n\nNo lo olvides, ¡una larva feliz es una larva saludable!\n\nLos Amathet conservan unas figuras que usan para alabar a sus dioses. Estoy seguro de que servirán como juguetes para nuestro amiguito. ¡Busca algunas, por favor!', '', '', '', '', '', '', 33528),
(58813, 'esMX', 'Filetes fétidos', 'Recoge $1oa piezas de carne corrupta de las criaturas que están en las áreas atacadas por los esbirros de N\'Zoth.', 'Se me ocurre que, como esta criatura ha sido infundida con energía del Vacío, quizá prefiera una fuente de alimentación más... corrupta.\n\nPor supuesto, me refiero a los esbirros de N\'Zoth.\n\nNo hay muchas probabilidades a favor, pero vale la pena intentarlo.', '', '', '', '', '', '', 33528),
(58812, 'esMX', 'Alternativas a la carne', 'Recoge $1oa muestras de carne de insectoide de aqir, mántides u otros insectos en Uldum o el Valle de la Flor Eterna.', 'En la naturaleza es bastante común que los insectos coman a otros de su misma especie. ¿Sucederá lo mismo con los aqir?\n\n¿Podrías conseguir un poco de carne de los aqir o los mántides? Quizás a nuestro amiguito le parezca más sabrosa.', '', '', '', '', '', '', 33528),
(58811, 'esMX', 'Una dieta equilibrada', 'Recoge $1oa trozos de carne de las bestias de Uldum y el Valle de la Flor Eterna.', 'Ahora que la larva ha nacido, debemos darle algo de comer para mantenerla saludable. \n\nParece que los aqir son carnívoros, pero lo único que los hemos visto comer es... bueno, seres como nosotros.\n\nEstá claro que no podemos servir de alimento para nuestro amiguito, así que debemos encontrar una alternativa. Quizás podamos usar carne de animales como reemplazo.', '', '', '', '', '', '', 33528),
(58810, 'esMX', 'Abandona tu cascarón', 'Observa cómo eclosiona el huevo aqir en Ramkahen.', '¡Parece que el huevo está listo para eclosionar! ¿No es emocionante?\n\nVen, le daremos la bienvenida al mundo a nuestro nuevo amigo.', '', '', '', '', '', '', 33528),
(58809, 'esMX', 'Una técnica electrizante', 'Recoge $1oa piezas de pararrayos en el Valle de la Flor Eterna.', 'Oí que los mogu aprovechan los relámpagos para acelerar el crecimiento de sus dragones nimbos. Me pregunto si podemos usar el mismo principio para nuestro amiguito aqir.\n\n¡Hay solo una forma de averiguarlo! Dirígete al Valle de la Flor Eterna e intenta obtener las piezas necesarias para fabricar nuestros propios pararrayos. \n\nSi funcionan para los dragones nimbos, quizás aceleren el proceso de incubación.', '', '', '', '', '', '', 33528),
(58808, 'esMX', 'Encerrado en ámbar', 'Marca una cámara de incubación de ámbar para H\'parkho para llevarla por transporte aéreo al Valle de la Flor Eterna.', '¡Ya sé quiénes deben tener muchos conocimientos para incubar correctamente este huevo! ¡Los mántides!\n\nDesde luego, ahora están un poco ocupados tratando de matarnos y no creo que quieran compartir su información… ¡Pero quizás haya otra forma de aprovechar todo lo que saben!\n\nTal vez podríamos reutilizar una de sus cámaras de incubación. ¡Eso podría ayudarnos a acelerar el proceso, lo sé!\n\nSi pudieras encontrar una y marcarla, podría llevármela de aquí por transporte aéreo.', '', '', '', '', '', '', 33528),
(58807, 'esMX', 'Crisálida protectora', 'Recoge $1oa piezas de tejido aqir de los taumaturgos aqir en Uldum.', 'Observé algo extraño en este huevo: no tiene la red protectora que suele haber en las colmenas aqir. \n\nCreo que ese tejido tiene algunas cualidades que podrían ayudar a proteger el huevo.\n\nMientras luchas contra los insectos, intenta obtener un poco de su tejido para crear un capullo adecuado en el que pueda crecer el huevo.', '', '', '', '', '', '', 33528),
(58806, 'esMX', 'Calor del sol', 'Recoge un recolector solar amathet en Uldum.', 'Las noches en el desierto de Uldum pueden ser terriblemente frías. Temo que ese pequeño huevo no sea capaz de soportar estas temperaturas.\n\nLos Amathet que habitan al este parecen haber dominado el arte de aprovechar la energía solar. Si pudiéramos obtener algunos de sus conocimientos, podríamos usarlos para mantener el huevo en un entorno cálido y acogedor.\n\nMantente alerta, puede haber algo que nos sirva.', '', '', '', '', '', '', 33528),
(58805, 'esMX', 'Incubación continuada', 'Recoge $1oa unidades de Vacío cristalizado en las áreas asaltadas por las fuerzas de N\'Zoth.', 'El huevo evoluciona bien, pero necesitaremos más de esos cristales del Vacío para mantenerlo en buen estado.\n\n¿Podrías ir a recolectar algunos más?', '', '', '', '', '', '', 33528),
(58804, 'esMX', 'Incubación del Vacío', 'Recoge $1oa unidades de Vacío cristalizado en las áreas asaltadas por las fuerzas de N\'Zoth.', 'Bueno, hay algo indudable: este huevo requiere grandes cantidades de energía del Vacío. \n\nEs una suerte para nosotros que un dios antiguo ataque Azeroth en este preciso momento, ¿verdad?\n\n¿No? Ah…\n\nComo sea, los ataques de los esbirros de N\'Zoth deben concentrar mucha energía del Vacío. Ve y busca un poco.', '', '', '', '', '', '', 33528),
(58803, 'esMX', 'Eclosión espontánea', 'Investiga $1oa huevos tocados por el Vacío en Uldum.', 'No hay motivo para inquietarse, estoy seguro de que nada malo sucederá cuando esta criatura salga del huevo. Después de todo, los aqir nacen sin maldad, ¿verdad?\n\nClaro que no tengo la más absoluta idea sobre cómo cuidar este clase de huevo. Necesitaré que investigues un poco.\n\nVuelve a las colmenas aqir para ver si puedes encontrar otros huevos similares. Observa cómo los cuidan y aplicaremos esos conocimientos.', '', '', '', '', '', '', 33528),
(58802, 'esMX', 'El huevo increíble', 'Llévale el huevo tocado por el Vacío a H\'Parkho Ardoros, en Ramkahen.', '<Según parece, los aqir han iniciado un proceso para infundir magia del Vacío en este huevo.\n\nAún falta para que eclosione, así que no hay peligro en estudiarlo para descubrir lo que planeaban hacer con él. \n\nQuizás alguien de la Liga de Expedicionarios tenga interés en echarle una mirada.>', '', '', '', '', '', '', 33528),
(58801, 'esMX', 'Ingreso al vacío', 'Sacrifica a 10 jugadores para N\'Zoth sin morir ni abandonar la forma de Ánima del Vacío.', '<A medida que te acercas al ídolo, los fragmentos oscuros que sostienes parecen derretirse en tus manos. Inmediatamente después, te invade una angustia atroz que rápidamente se transforma en sentimientos de felicidad, serenidad y un impulso abrumador de… matar. \n\nUna voz aguda se cuela en tu mente.>\n\nMi fiel sirviente. Te concederé una pequeña prueba de mi inconcebible poder. Lo único que te pido a cambio es que completes una sencilla tarea. Mata a todos los que se me opongan, no le perdones la vida a nadie. No me falles…', '', '', '', '', '', '', 33528),
(58782, 'esMX', 'Lo que dejamos atrás', 'Recoge $1oa suministros vagayermos de los alijos infestados de Uldum.', 'Los invasores aqir forzaron a los Vagayermos a huir de muchos de nuestros asentamientos de Uldum. En nuestra prisa por escapar, dejamos atrás muchas de nuestras pertenencias.\n\nHe oído que pretendes luchar contra estas bestias. Mientras estás ahí, ¿podrías fijarte si encuentras algunos de los suministros que tuvimos que abandonar? \n\nPuedes quedarte con todo lo que te parezca útil, por supuesto.', '', '', '', '', '', '', 33528),
(58781, 'esMX', 'Terrores de lo profundo', 'Derrota 3 enemigos aqir raros en Uldum.', 'Los aqir amenazan la vida de los Vagayermos cada día que pasa, pero he oído que también se han desenterrado cosas horribles con su llegada.\n\nNuestros luchadores son fuertes, pero temo lo que pueda ocurrirles si nos ataca uno de esos terrores antiguos. \n\nSé que tienes experiencia derribando a enemigos enormes. Te pediría que hagas eso mismo por nosotros. \n\nDespués de todo, si nos diezma un monstruo enterrado hace miles de años, no podríamos proteger la forja.', '', '', '', '', '', '', 33528),
(58780, 'esMX', 'Heraldos de la colmena', 'Mata $1oa dominadores aqir en Uldum.', 'Los aqir que asaltaron nuestro campamento parecen ser básicamente tropas de choque. Sin embargo, los exploradores de nuestras filas que se animaron a aventurarse tras sus líneas han visto unas criaturas muy diferentes: seres altos y delgados, que parecen blandir una peligrosa magia del Vacío.\n\nMis instintos me dicen que estas criaturas son los líderes de esta invasión. Debemos considerarlas objetivos oportunos y eliminarlas cada vez que las veamos.\n\n¿Estás a la altura de la tarea?', '', '', '', '', '', '', 33528),
(58779, 'esMX', 'Es hora de volar', 'Mata a $1oa aqir voladores en Uldum.', 'Me gustaría ver si podemos hacer que más de estos voladores despeguen para espantar a los aqir, pero es casi imposible regresar al Obelisco del Sol con tantos insectos volando por doquier.\n\nCreo que tendremos que reducir sus números en tierra antes de ganar la superioridad aérea.\n\n¿Puedo contar contigo?', '', '', '', '', '', '', 33528),
(58778, 'esMX', 'Rodarán cabezas', 'Consigue $1oa trofeo de goliat de los goliat aqir en Uldum.', 'La moral está por el piso en el campamento últimamente. Es gracioso cómo un simple grupo de insectos puede desmotivar a todo un ejército.\n\nPero tengo una idea para devolver el ánimo a las tropas. ¡Necesitamos un trofeo!\n\nFíjate si puedes conseguir la cabeza de uno de esos grandotes que parecen tanques. ¡Lo colgaremos para mostrarles a esos insectos que no somos poca cosa! Eso sí, la necesito entera, no la despedaces, ¿entendido?', '', '', '', '', '', '', 33528),
(58777, 'esMX', '¡Aplástalos!', 'Aplasta a $1oa larvas aqir en Uldum.', '<Zahra pisa a una criatura limosa similar a una babosa cuando te acercas.>\n\n¿Lo ves? No parece mucho, pero aunque cueste creerlo, esos insectos crecen de estas cosas.\n\nEstán por todos los lugares de los que se han apoderado los aqir, alimentándose de nuestros caídos para convertirse en estas monstruosidades.\n\nSi ves alguna, hazle un favor al mundo y aplástala con tus botas.', '', '', '', '', '', '', 33528),
(58776, 'esMX', 'Problemas de eclosión', 'Destruye $1oa grupos de huevos aqir en Uldum.', 'Los aqir se multiplican más rápido de lo que podemos eliminarlos. Si este ritmo no para, nos superarán en número tarde o temprano.\n\nLa única forma de refrenar su asalto es atacar las colmenas directamente y destruir sus huevos, pero no lo hemos logrado hasta ahora.\n\nPor eso deseo reclutarte.\n\n¿Nos ayudarás?', '', '', '', '', '', '', 33528),
(58765, 'esMX', 'Rompeasedios', 'Sabotea $1oa carros de guerra vil\'thik en el Valle de la Flor Eterna.', 'El Loto Dorado puede defenderse solo contra los guerreros mántides, de eso no hay duda. Sus carros de guerra, por otro lado, tienen la capacidad para destruir a un escuadrón entero de nuestros soldados de un solo ataque.\n\nSi queremos conservar la ventaja en esta batalla, necesitaremos que alguien se infiltre en sus filas y sabotee sus máquinas de asedio.\n\nMe gustaría que te ofrecieras como $gvoluntario:voluntaria;.', '', '', '', '', '', '', 33528),
(58764, 'esMX', 'Estandartes del enjambre', 'Quema $1oa estandartes zara\'thik en el Valle de la Flor Eterna.', 'Esos mántides descarados creen que ya han ganado. Incluso ahora, flamean estandartes por todo Espinazo del Dragón, anunciando su dominio.\n\nDeben aprender que Pandaria pertenece a los pandaren.\n\nIncendia sus estandartes.', '', '', '', '', '', '', 33528),
(58763, 'esMX', 'Detén la producción', 'Destruye $1oa recipientes de ámbar en el Valle de la Flor Eterna.', 'Los mántides utilizan ámbar en casi todos los aspectos de su vida, desde las estructuras en las que viven hasta las armas que blanden. Y claro, a mí me interesa más eso último.\n\nSi podemos privar a los mántides de sus materiales, los privaremos de los médicos para crear instrumentos de guerra.\n\nBusca la forma de apoderarte de su ámbar e impedir que lo usen.', '', '', '', '', '', '', 33528),
(58762, 'esMX', 'Raptados por el enjambre', 'Libera a $1oa prisioneros del Loto Dorado de las jaulas de ámbar endurecido en el Valle de la Flor Eterna.', 'Este enjambre de mántides tiene algo distinto. No matan a todo lo que ven, como hacen los mántides, sino que se dedican a capturar a nuestros defensores y mantenerlos con vida.\n\nNo puedo ni imaginar qué pretenden hacer con los cautivos. \n\nEn lugar de descubrirlo, ¿por qué no vas a rescatarlos?', '', '', '', '', '', '', 33528),
(58761, 'esMX', 'Larvas bajo el zapato', 'Aplasta $1oa larvas vil\'thik en el Valle de la Flor Eterna.', 'En el pasado, los mántides protegían a sus crías en cámaras de incubación hasta que las criaturas estaban listas para probarse en el enjambre \n\nEstos vil\'thik en cambio son desprolijos, pues dejan a sus larvas retorciéndose al aire libre. \n\n¿No sería una pena que alguien las aplaste?\n\nNo, desde luego que no.', '', '', '', '', '', '', 33528),
(58760, 'esMX', 'Espadas de ámbar', 'Recolecta $1oa espadas de ámbar de mántides vil\'thik en el Valle de la Flor Eterna.', 'Los mántides son frágiles y fáciles de destruir, pero blanden formidables espadas de ámbar.\n\nCon un poco de trabajo, se pueden transformar en armas adecuadas para los mogu.\n\nTráemelas y veré cómo puedo ponerlas al servicio de los Rajani.', '', '', '', '', '', '', 33528),
(58759, 'esMX', 'La guardia de la emperatriz', 'Mata $1oa mántides zara\'thik en el Valle de la Flor Eterna.', 'Los zara\'thik son la guardia de élite de la emperatriz. Están potenciados por la azerita saqueada, y no se detendrán ante nada hasta lograr la conquista absoluta de todo Pandaria.\n\nSi les permitimos que avancen más allá de Espinazo del Dragón, el Loto Dorado no podrá hacer nada contra ellos.\n\nDebes detenerlos en el muro, $c.', '', '', '', '', '', '', 33528),
(58758, 'esMX', 'Destruyendo destructores', 'Mata a $1oa destructores kunchong en el Valle de la Flor Eterna.', 'El último enjambre de mántides sigue fresco en la memoria del Loto Dorado. Antes del avance del enjambre, los mántides enviaban a sus enormes kunchong para debilitar las líneas de la defensa.\n\nParece que sus tácticas no han cambiado.\n\nTenemos que detener a los kunchong si queremos que el Loto Dorado monte una defensa contra el enjambre. Cuento contigo para acabar con ellos.', '', '', '', '', '', '', 33528),
(58757, 'esMX', 'El eslabón más débil', 'Mata a $1oa enjambrenato vil\'thik en el Valle de la Flor Eterna.', 'Durante un ataque como enjambre, los mántides envían a una gran cantidad de sus más pequeños hacia el enemigo para probar su fuerza. Los que sobreviven regresan al enjambre como verdaderos guerreros de los mántides.\n\nTenemos que hacer todo lo posible para que no superen esta prueba.', '', '', '', '', '', '', 33528),
(58756, 'esMX', 'Masacre mántide maravillosa', 'Mata $1oa taumaturgos de ámbar mántides en el Valle de la Flor Eterna.', 'Los taumaturgos de ámbar pertenecen a las más altas castas de la sociedad mántide. Con su magia pueden sanar y dar forma al ámbar a su voluntad, lo que les permite sanar rápidamente a las fuerzas de las mántides tras una batalla.\n\nSon blancos estratégicos, hay que darles prioridad. \n\n¿Nos acompañarías?', '', '', '', '', '', '', 33528),
(58755, 'esMX', 'Reserva de suministros', 'Consigue $1oa Suministros del Loto Dorado de los Alijos ámbar en e Valle de la Flor Eterna.', 'Últimamente, los mántides invasores se roban los suministros del Loto Dorado. Seguramente pretenden matarnos de hambre.\n\nY quizá lo logren si no los recuperamos. \n\nMientras luchas contra el enjambre, presta atención y fíjate si encuentras algún suministro escondido. Le harías un favor enorme al Loto Dorado si pudieras recuperar algunos.', '', '', '', '', '', '', 33528),
(58754, 'esMX', 'Adalides del enjambre', 'Derrota 3 enemigos mántides raros en el Valle de la Flor Eterna.', 'Es evidente que Shek\'zara está totalmente comprometida con esta invasión. Nuestros exploradores han visto a algunos de sus adalides más importantes en el campo de batalla.\n\nCualquiera de estos mántides sería un contrincante demasiado fuerte para los soldados del Loto Dorado. Debemos perseguirlos y eliminarlos por nuestra cuenta.\n\n¿Vienes?', '', '', '', '', '', '', 33528),
(58749, 'esMX', 'El vuelo de los vil\'thik', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58748, 'esMX', 'Las estatuas vivientes son muy duras', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58747, 'esMX', 'Hormigueo en el cerebro', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58746, 'esMX', 'Locura pequeñita', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58745, 'esMX', 'Fíjate dónde pisas', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58744, 'esMX', 'Yo soy quien susurra', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58743, 'esMX', 'Insecto de las dunas', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58742, 'esMX', 'Retinus el Buscador', 'Derrota a Grixis Pequeñín en un duelo de mascotas.', '', '', '', '', '', '', '', 33528),
(58741, 'esMX', 'Enemigos de piedra', 'Recoge $1oa armamentos mogu en el Valle de la Flor Eterna.', 'El problema de librar una guerra contra otros mogu es que las armas son débiles y se rompen muy fácilmente contra enemigos de piedra y metal. \n\nComo soy el único herrero de los Rajani, a veces es difícil estar a la altura de las necesidades de nuestros guerreros.\n\nSi encuentras armas en tus batallas contra los mogu, sin duda podremos darles un buen uso.', '', '', '', '', '', '', 33528),
(58740, 'esMX', 'Dragones domados', 'Mata $1oa dragones bélicos de ónice en el Valle de la Flor Eterna.', 'Donde marchen los Zan-Tien, prestos seguirán los dragones bélicos.\n\nNinguna advertencia es suficiente para dar cuenta de la peligrosidad de estas criaturas. Es una pena verlos bajo el yugo de los mogu, pero no podemos dejarlos sueltos.\n\nNecesito que acabes con ellos antes de que causen estragos en nuestras filas.', '', '', '', '', '', '', 33528),
(58737, 'esMX', 'Los descubrimientos de Magni', 'Conoce los descubrimientos de Magni.', 'Como si haber vuelto a poner en marcha la Forja fuera poco, parece que hemos encontrado la clave para expulsar a N\'Zoth de una vez y para siempre en los archivos de las Cámaras Mogu\'shan.\n\nTal vez quieras sentarte para escuchar esto, adalid.', '', '', '', '', '', '', 33528),
(58708, 'esMX', 'Hazte la fama y échate a gnormir', 'Reúnete con el Maestro manitas Sobrechispa en Boralus.', 'El Maestro manitas Sobrechispa solicita tu asistencia en una importante misión de investigación. \n\nTrabajar con el famoso Maestro manitas será de gran ayuda para tu carrera. ¡Ha hecho maravillas con la mía!', '', '', '', '', '', '', 33528),
(58705, 'esMX', 'Gran emperatriz Shek\'zara', '', '', '', '', '', '', '', '', 33528),
(58679, 'esMX', 'Destructor durmiente', '', '', '', '', '', '', '', '', 33528),
(58675, 'esMX', 'El precio de la paz', 'Presencia el discurso del rey Wrynn.', 'Pronto el rey nos comunicará las noticias sobre su misión diplomática con la Horda.\n\nLos demás líderes de la Alianza ya han llegado. Estoy seguro de que están ansiosos por saber lo que el rey Wrynn tiene para decir.\n\nHabla conmigo cuando estés $glisto:lista; y recibiremos al rey juntos.', '', '', '', '', '', '', 33528),
(58674, 'esMX', 'Una congregación de campeones', 'Habla con el maestro Mathias Shaw en Ventormenta.', 'El rey Wrynn ha convocado una audiencia con los líderes de la Alianza en Ventormenta.\n\nSe solicitó específicamente tu presencia en la reunión. Se llevará a cabo en la embajada.\n\nVen a hablarme cuando hayas llegado a Ventormenta, estaré esperando con los demás.\n\nApresúrate, $n. Sería un error hacer esperar al rey…', '', '', '', '', '', '', 33528),
(58673, 'esMX', 'Jefe de Guerra de la Horda', 'Presencia la reunión de campeones.', 'Está por comenzar la reunión en la que se decidirá quién será el próximo jefe de guerra de la Horda.\n\nLos demás líderes de la Horda ya han llegado. Te están esperando dentro de la embajada.\n\nHabla conmigo cuando estés $glisto:lista; y los saludaremos juntos.', '', '', '', '', '', '', 33528),
(58672, 'esMX', 'Una congregación de campeones', 'Habla con Valeera Sanguinar en Orgrimmar.', 'Los líderes de la Horda se reunirán en Orgrimmar para nombrar un nuevo jefe de guerra.\n\nComo $gcampeón:campeona; de la Horda, se solicita tu presencia en la reunión. Se llevará a cabo en la embajada, en Orgrimmar.\n\nMe adelantaré. Ven a hablarme cuando llegues a Orgrimmar, estaré esperando con los demás.\n\nDeprisa, $gcampeón:campeona;. El futuro de la Horda se está por definir...', '', '', '', '', '', '', 33528),
(58667, 'esMX', 'Extracción de obsidiana', '', '', '', '', '', '', '', '', 33528),
(58661, 'esMX', 'Terrores bajo tierra', '', '', '', '', '', '', '', '', 33528),
(58660, 'esMX', 'Terrores bajo tierra', '', '', '', '', '', '', '', '', 33528),
(58646, 'esMX', '¡Coman esto!', 'Mata a $1oa trotadunas carroñeros en Uldum.', 'Estas hienas sarnosas masticarán cualquier cosa que excaven, ¡aunque sean artefactos invaluables!\n\nNo podemos permitir que la historia de Uldum se convierta en comida para perros, por decirlo así.\n\nMe temo que debemos reducir su manada.', '', '', '', '', '', '', 33528),
(58645, 'esMX', 'Un mundo por salvar', 'Evita que los Amathet se apoderen de las Cámaras de los Orígenes.', 'No pudimos hacerles frente. Sus guerreros... estaban envueltos en las llamas del sol...\n\nQuieren la forja... para acabar con todo...\n\nVe... Yo... resistiré...', '', '', '', '', '', '', 33528),
(58643, 'esMX', 'Destrucción mutuamente asegurada', 'Advierte a los defensores de las Cámaras de los Orígenes sobre el plan de los Amathet.', 'Los Amathet quieren reconquistar la Forja de los Orígenes y usarla para acabar con la vida en Azeroth, ¡sin distinguir entre los dioses antiguos y el resto! \n\nPuede que ataquen en cualquier momento. ¡Debemos advertir a los defensores de la Forja!', '', '', '', '', '', '', 33528),
(58642, 'esMX', 'Objetivos en común', 'Defiende a la alta expedicionaria Dellorah mientras descifra las tablillas amathet dentro de la Cámara de las Estrellas.', 'En el decreto que encontraste se habla de un plan para derrotar a los dioses antiguos. \n\nSé que es improbable que los Amathet colaboren con nosotros para alcanzar ese objetivo, pero si tienen un plan para vencer a N\'Zoth, nos conviene conocerlo.\n\nEn el decreto se menciona el motor de ascensión. Creo que ese debe ser el nombre de aquel dispositivo de energía solar que vimos antes. ¡Deberíamos echar un vistazo abajo para ver si podemos descubrir lo que traman!', '', '', '', '', '', '', 33528),
(58641, 'esMX', 'Inquiridores de la corrupción', 'Consigue el decreto del Rey del Sol de los Amathet Toquesol en Uldum.', 'Solo los Toquesol podían saber más sobre la \"corrupción\" que menciona la tablilla, pues eran los encargados de erradicarla.\n\nPor supuesto, no creo que estén dispuestos a darnos la información voluntariamente.\n\nEs mi día de suerte, porque tú te especializas en investigar con métodos de fuerza bruta, ¿no es cierto?', '', '', '', '', '', '', 33528),
(58640, 'esMX', 'Una rajadura en la armadura', 'Defiende a la alta expedicionaria Dellorah mientras descifra el monumento amathet en las afueras de las Cámaras de los Orígenes.', 'Los artefactos que ayudaste a excavar demuestran que los Amathet son una tribu que protegía las obras de los titanes con orgullo. \n\nEsto confirma nuestras suposiciones y sugiere que debe haberles sucedido algo drástico para que dañaran las mismas obras que habían jurado proteger.\n\nDebemos seguir buscando sus escritos. Creo haber visto un monumento más reciente afuera de las Cámaras de los Orígenes.', '', '', '', '', '', '', 33528),
(58639, 'esMX', 'Historia enterrada', 'Descubre y recoge $1oa artefactos amathet en Uldum.', 'Como los Amathet provienen de esta región, sería lógico que aquí hayan quedado artefactos de su civilización escondidos bajo la arena.\n\n¡Parece que es hora de ponerse a excavar!\n\nLas dunas cercanas deben haber cubierto una gran parte de lo que solía ser el territorio de los Amathet. ¡Veamos qué podemos desenterrar!', '', '', '', '', '', '', 33528),
(58638, 'esMX', 'Una mirada más a fondo', 'Defiende a la alta expedicionaria Dellorah mientras descifra el monumento amathet en el Bancal Piedrasol.', 'Hay algo que no termina de cerrar con respecto a estos Amathet. ¿Por qué los protectores de las obras de los titanes atacarían y dañarían la Forja de los Orígenes?\n\nCreo que deberíamos hacer una investigación más minuciosa. Creo haber visto un monumento en el bancal. Tal vez las escrituras que encuentres nos den más información sobre los tol\'vir.', '', '', '', '', '', '', 33528),
(58636, 'esMX', 'Ojos puestos en los Amathet', 'Explora los territorios amathet con la alta expedicionaria Dellorah en Uldum.', 'En nombre de la Liga de los Expedicionarios, quiero agradecerte por ayudarnos a concretar el Acuerdo de Uldum y conseguir la cooperación de Ramkahen.\n\nA fin de conocer mejor a nuestros enemigos, Ramkahen nos permitió explorar las tumbas amathet. Lamentablemente, no cuentan con los recursos suficientes para ofrecernos protección.\n\nMe preguntaba si podrías darnos una mano. \n\n¿Crees que nos podrás ayudar con nuestra investigación? Podemos empezar con un vistazo aéreo.', '', '', '', '', '', '', 33528),
(58634, 'esMX', 'Apertura del portal', 'Habla con MADRE para establecer el Portal tenebroso en la Cámara del Corazón.', 'El tejido de la realidad está rasgado. Pero no es necesario que te lo diga, $n. Lo viviste en carne propia. \n\nSolo es cuestión de tiempo hasta que estas realidades se vuelvan una, sumergida en una oscuridad eterna. En lugar de esconderse, quizá sea tiempo de aceptar la oscuridad.\n\nCon la ayuda de nuestro amigo titán, tal vez podamos enhebrar la aguja de esta realidad y guiarla a través de otra para tejer una especie de puente.\n\nDespués de todo, la clave para entender la debilidad de un enemigo es entender sus intenciones.', '', '', '', '', '', '', 33528),
(58632, 'esMX', 'Ny\'alotha, la Ciudad Despierta: El fin del Corruptor', 'Derrota a N\'Zoth en Ny\'alotha, la Ciudad Despierta.', 'Con la investigación de los mogu, MADRE y Ra-den encontraron una forma de concentrar el Protocolo de los Orígenes de la forja a través de la Cámara del Corazón. El único problema era buscar un objetivo clave.\n\nHasta ahora.\n\nToma estos anclajes y atraviesa el portal. Tendrás que encontrar sitios prominentes donde colocarlos para apuntar el arma. Cuando estén listos, podremos disparar.\n\nSolo tendrás un intento. ¡No lo desperdicies!', '', '', '', '', '', '', 33528),
(58631, 'esMX', 'Hacia los sueños', 'Habla con MADRE en la Cámara del Corazón para averiguar el paradero de Ra-den.', 'No puedo creer que Ra-den se sacrificara para salvarnos. ¡No podemos abandonarlo a su suerte!\n\nTiene que haber una forma de averiguar a dónde se fue. \n\n¡Veamos si MADRE puede rastrearlo!', '', '', '', '', '', '', 33528),
(58615, 'esMX', 'Susurros en la oscuridad', 'Encuentra el origen de los susurros de N\'Zoth en la Cámara del Corazón.', '¿Tú también oíste eso? No puede ser nada bueno.\n\nSi N\'Zoth obtiene acceso a la cámara, ¡será nuestro fin!\n\nTenemos que averiguar desde dónde accede a la cámara e impedirlo, antes de que cambie los susurros por algo peor.', '', '', '', '', '', '', 33528),
(58606, 'esMX', 'Un poco de investigación', 'Consigue $1oa restos de aqir.', '¡$p, este podría ser el descubrimiento del siglo!\n\nNo puedo confirmarlo con toda certeza, pero tengo la sospecha de que estos insectos son conocidos como \"aqir\".\n\nLa liga tiene pocos registros intactos, pero la última mención de estas criaturas habla de una gran guerra entre los aqir, los C\'Thraxxi y una de las primeras civilizaciones trol.\n\nHabíamos pensado que estaban extintos, pero quizás no estaban haciendo más que… reconstruirse.\n\n¿Podrías conseguir algunas muestras para que las examine?', '', '', '', '', '', '', 33528),
(58595, 'esMX', 'Pilares del olvido', 'Destruye $1oa obeliscos del Imperio Negro en el Valle de la Flor Eterna.', 'En otros tiempos, los obeliscos negros de los dioses antiguos anunciaban la llegada de sus fuerzas. Los conjuradores oscuros entre los k\'thir y los n\'raqi usaban estos monumentos para establecer bases en nuestro mundo e invocar más esbirros de los dioses antiguos.\n\nAhora estos obeliscos inundan nuestros campos de batalla. Mientras estén en pie, las fuerzas de N\'Zoth serán infinitas.\n\nAsegúrate de que eso no ocurra.', '', '', '', '', '', '', 33528),
(58583, 'esMX', 'Directo al corazón', 'Reúnete con Magni Barbabronce en la Cámara del Corazón.', 'El Portavoz ha solicitado que te envíe para ayudarlos a él y a Wrathion en sus esfuerzos.\n\nHas demostrado ser un gran aliado para Azeroth, y sospecho que jugarás un papel muy importante en las siguientes batallas.\n\nEsperemos que el resto de la Horda y la Alianza puedan dejar de lado sus diferencias para enfrentarse a un enemigo común.', '', '', '', '', '', '', 33528),
(58582, 'esMX', 'Regreso del Príncipe Negro', 'Habla con Valeera Sanguinar en el Gran Sello de Dazar\'alor.', 'Acabo de regresar de una reunión con el rey Wrynn en Ventormenta.\n\nTenemos mucho que hablar.\n\nReunámonos en el Gran Sello cuanto antes.', '', '', '', '', '', '', 33528),
(58506, 'esMX', 'Diagnósticos de red', 'Activa las consolas titánicas de la Cámara del Corazón para comprobar el estado de las forjas titánicas a través de Azeroth.', 'Lamentablemente, no tenemos idea de dónde se escondió N\'Zoth después de escapar. Sabemos, sin embargo, donde podría atacar.\n\nHace tiempo, cuando los guardianes encerraron a los dioses antiguos, construyeron mecanismos de defensa contra la corrupción dentro de las forjas titánicas. Si N\'Zoth quiere corromper Azeroth, primero tendrá que sortear esos obstáculos.\n\nAfortunadamente, ahora tenemos una conexión directa, así que podemos observarlos desde aquí. Ve y echa un vistazo.', '', '', '', '', '', '', 33528),
(58502, 'esMX', 'Directo al corazón', 'Regresa a la Cámara del Corazón.', 'Es hora de ejecutar el plan de Wrathion. \n\nRegresará a la Cámara del Corazón, así que deberíamos reunirnos con él allí.', '', '', '', '', '', '', 33528),
(58498, 'esMX', 'El regreso de rey guerrero', 'Camina con Anduin y recupera a Rompemiedos en el Castillo de Ventormenta.', 'Has hecho muchísimo por Azeroth, adalid, pero por desgracia, tengo que pedirte aún más. N\'Zoth anda suelto y no hay forma de saber cuándo ni dónde volverá a atacar.\n\nEsta batalla no podemos ganarla solos. Cuando llegue la hora, ¡mi martillo luchará a tu lado!\n\nPero primero, tenemos que recuperarlo.', '', '', '', '', '', '', 33528),
(58496, 'esMX', 'Un consejero inoportuno', 'Habla con el rey Anduin Wrynn en el Castillo de Ventormenta.', 'Incluso con la ayuda de la Horda y la Alianza juntas, aún no hemos encontrado rastros de las fuerzas de N\'Zoth. Desde que se liberó, el dios antiguo no ha dejado de eludirnos.\n\nSolo la Luz conoce las desgracias que tiene planeadas para Azeroth.\n\nTe veré en Ventormenta. ¡Debemos idear un plan para descubrir los planes de N\'Zoth antes de que sea demasiado tarde!', '', '', '', '', '', '', 33528),
(58487, 'esMX', 'El que saquea a un saqueador…', 'Roba $1oa saqueos mogu del Valle de la Flor Eterna.', 'Nuestros asaltos a los tesoros de Lei Shen fueron clave en la caída del Rey del Trueno. Creo que debemos volver a utilizar la misma estrategia aquí.\n\nBusca los saqueos de los clanes mogu y quítaselos.\n\nTenemos que hacer todo lo posible para detener su avance.', '', '', '', '', '', '', 33528),
(58485, 'esMX', 'Hechas para caer', 'Destruye $1oa estatuas mogu en el Valle de la Flor Eterna.', 'Los Baruk usan las artes prohibidas de la nigromancia para atrapar las almas de los mogu caídos dentro de estatuas que pelean por ellos. \n\nEsta táctica es una tragedia para nuestro pueblo, no podemos permitir que continúe.\n\nDestruye sus preciadas estatuas para que no tengan con qué contaminar las almas robadas.', '', '', '', '', '', '', 33528),
(58481, 'esMX', 'Rituales de sangre', 'Destruye $1oa fuentes de sangre en el Valle de la Flor Eterna.', 'Anji y yo hemos luchado en muchas batallas, así que sabemos cómo ocuparnos de unos pocos mogu, ¡pero la magia de sangre que usan estos dokani es ciertamente perturbadora!\n\nComo si matar a todos en su camino no fuera suficiente, usan los cadáveres para sus rituales profanos. ¡Me resulta inconcebible!\n\nHazme un favor. Si alguna vez te cruzas con alguno de esos rituales, debes detenerlo. Ni siquiera nuestros enemigos merecen el ultraje de esta magia oscura.', '', '', '', '', '', '', 33528),
(58479, 'esMX', 'Dominio de relámpagos', 'Destruye $1oa pararrayos en el Valle de la Flor Eterna.', 'Los Zan-Tien hacen gala de su dominio sobre las tormentas, pero deben usar máquinas para aprovechar los relámpagos en el cielo.\n\nMuéstrales a esos farsantes que el verdadero poder del trueno y la tormenta viene de adentro. Rómpeles esos juguetes, a ver cómo se las arreglan sin ellos.', '', '', '', '', '', '', 33528),
(58478, 'esMX', 'Que no quede piedra sin romper', 'Mata a $1oa mogu baruk en el Valle de la Flor Eterna.', 'Cuando los clanes en guerra llegaron al Valle, los Baruk se consideraron dignos de apoderarse de las tierras antiguas de Guo-Lai.\n\nNo son dignos de nada.\n\nDales una lección a estos usurpadores, y quizás te ganes un ápice del favor de los Rajani.', '', '', '', '', '', '', 33528),
(58477, 'esMX', 'A través de sangre, tierra y huesos', 'Consigue $1oa glóbulos de ánimas de los mogu Dokani y sus aliados en el Valle de la Flor Eterna.', 'Los Dokani se creen dignos de blandir la magia antigua de ánima, pero sus gólems y manifestaciones tienen solo un ápice del verdadero poder de ánima.\n\nLibéralos de su preciada sustancia para que los Rajani les den un uso más apropiado.', '', '', '', '', '', '', 33528),
(58476, 'esMX', 'Trae el trueno', 'Mata a $1oa mogu Zan-Tien en el Valle de la Flor Eterna.', 'Todos los clanes mogu son fuertes, de eso no hay duda, pero los Zan-Tien suponen la mayor amenaza directa para el Loto Dorado. \n\nEn este momento, se reúnen en masa ante La Pagoda Dorada. Muchos de nuestros guerreros son novatos sin experiencia. Los mogu los harían pedazos en cuestión de segundos.\n\nUn $c con experiencia como tú podría frenarlos considerablemente. \n\n¿Podrías ayudar?', '', '', '', '', '', '', 33528),
(58471, 'esMX', 'Notas violentas', 'Usa el cuaderno de eremita para tomar notas sobre los ignotos, los k\'thir y las bestias de carne en el Valle de la Flor Eterna.', 'A pesar de que el origen del Sha está relacionado con los dioses antiguos, en Pandaria sabemos muy poco de ellos.\n\nMe gustaría aprovechar esta oportunidad para agregar la información que pueda sobre ellos a los archivos de los Eremitas. Lo cierto es que es un poco difícil, pues quieren matarnos.\n\nPero eso no parece un problema para ti. ¿Me podrías hacer un favor y tomar algunas notas sobre lo que encuentres ahí? Sería de gran ayuda para comprender la fuerza contra la que estamos luchando.', '', '', '', '', '', '', 33528),
(58470, 'esMX', 'Artefactos corrompidos', 'Recoge $1oa artefactos del Imperio Negro de los alijos del Imperio Negro en el Valle de la Flor Eterna.', 'Sé que el Imperio Negro constituye una grave amenaza para Pandaria, pero también podemos ver esto como una oportunidad.\n\nAunque los hemos enfrentado varias veces, se sabe muy poco sobre los dioses antiguos y el misterioso reino de N\'Zoth, Ny\'alotha. \n\nCuando estudiamos las civilizaciones antiguas, a menudo recurrimos a artefactos para descubrir los misterios que el tiempo ha ocultado. Me pregunto si habrá artefactos semejantes entre las fuerzas de los dioses antiguos.\n\nNo estaría mal averiguar, ¿no?', '', '', '', '', '', '', 33528),
(58469, 'esMX', 'Lágrimas en el Valle', 'Cierra $1oa grietas del Vacío en el Valle de la Flor Eterna.', 'A medida que la influencia de N\'Zoth en el Valle aumenta, nuestra realidad comienza a desmoronarse. \n\nEl poder de los dioses antiguos ha creado grietas en el tejido de nuestro mundo. Estas grietas funcionan como portales para que sus esbirros vengan a invadirnos desde el oscuro reino.\n\nMientras haya grietas, no podremos liberar a Azeroth de las garras de N\'Zoth. ¡Ciérralas para detener el avance de la corrupción!', '', '', '', '', '', '', 33528),
(58468, 'esMX', 'Se oscurecen los cielos', 'Destruye $1oa incubadores corruptos en la Mina de la Gran Flor en el Valle de la Flor Eterna.', 'Los exploradores del Shado-Pan han encontrado evidencia de un nuevo criadero mántide dentro de la Mina de la Gran Flor. Parece que estos mántides hondocolmena quieren crear más engendros corruptos que sirvan a N\'Zoth.\n\nSi estos huevos prosperan, un nuevo enjambre potenciado por los dioses antiguos cubrirá los cielos del Valle y Pandaria se sumirá en la oscuridad.\n\nNo dejaremos que eso pase, ¿no?', '', '', '', '', '', '', 33528),
(58467, 'esMX', 'Prisioneros de mente y cuerpo', 'Rescata a $1oa pandaren cautivos en el Valle de la Flor Eterna.', 'Las fuerzas de N\'Zoth atacaron el Valle repentinamente. Cuando por fin llegué con el Shadopan, las fuerzas de los dioses antiguos ya habían capturado a muchos miembros del Loto Dorado.\n\nIncluso con nuestra fuerza combinada, solo hemos podido impedir que los invasores secuestren más personas. Los que secuestraron, sin embargo, aún están entre las garras del dios antiguo.\n\nSé que hemos tenido diferencias, $n, pero si pudieras ayudarnos a rescatarlos, el Shadopan estaría en deuda contigo.', '', '', '', '', '', '', 33528),
(58466, 'esMX', 'Tormento del más allá', 'Libera $1oa espíritus pandaren antiguos en el Valle de la Flor Eterna.', 'Como si no fuera suficiente que N\'Zoth pretenda dominar a los habitantes del Valle, ¡ahora mis exploradores me informan que también pretenden dominar a los muertos!\n\nEl Shadopan no da abasto defendiendo a los vivos. ¿Podrías poner fin a esta desgracia?', '', '', '', '', '', '', 33528),
(58465, 'esMX', 'Manifestaciones de corrupción', 'Mata a $1oa icores pútridos en el Valle de la Flor Eterna.', 'La corrupción de los dioses antiguos a menudo es tan fétida que se manifiesta en forma física. \n\nLa hemos visto con los Sha. Esta vez es igual.\n\nAcaba con la corrupción donde sea que la veas propagándose. No podemos permitir que se fortalezca.', '', '', '', '', '', '', 33528),
(58464, 'esMX', 'Exterminación de los hondocolmena', 'Mata $1oa mántides hondocolmena dentro de la Mina de la Gran Flor en el Valle de la Flor Eterna.', 'Una secta del enjambre de mántides que se hace llamar \"hondocolmena\" ha capturado la Mina de la Gran Flor. Estos mántides se han entregado totalmente a la corrupción de los dioses antiguos, de modo que son especialmente peligrosos.\n\nNo podemos permitir que estos hondocolmena hagan estragos en el Valle. Haz lo que haga falta hacer.', '', '', '', '', '', '', 33528),
(58463, 'esMX', 'Engendros de la locura', 'Mata a $1oa bestias de carne en el Valle de la Flor Eterna.', 'Ver al Valle de la Flor Eterna recuperarse de los Sha y regresar a su belleza original, solo para que vuelvan a contaminarlo los dioses antiguos… ¡me hierve la sangre!\n\nDebemos quitar de raíz la corrupción de los dioses antiguos, antes de que se arraigue en esta tierra. He visto a bestias de carne que acompañan a las fuerzas de N\'Zoth propagando la corrupción a su paso.\n\nAsegúrate de que jamás vuelvan a pisar estas tierras.', '', '', '', '', '', '', 33528),
(58462, 'esMX', 'Ventanas del alma', 'Mata a $1oa ojos del imperio en el Valle de la Flor Eterna.', 'Como si a nuestro enemigo no le alcanzara con atacarnos con una fuerza letal, sus esbirros también atacan el corazón de nuestros defensores.\n\nEstoy hablando de los ojos, desde luego. Penetran el alma de nuestros guerreros y hacen realidad sus miedos más oscuros para usarlos en su contra.\n\nSi tenemos alguna esperanza de derrotar a este enemigo, debemos destruirlos.', '', '', '', '', '', '', 33528),
(58461, 'esMX', 'Tomos de locura ancestral', 'Consigue $1oa tomos de locura ancestral de los enemigos k\'thir en el Valle de la Flor Eterna.', 'En tiempos como estos, es necesario que todos los habitantes del Valle colaboren y hagan su parte. Por desgracia nunca fui un buen luchador, por lo que mi utilidad en tiempos de guerra es muy limitada.\n\nSin embargo, quizá pueda ayudar con algo. Sabemos muy poco sobre los invasores que enfrentamos, y el conocimiento puede ser un arma muy poderosa.\n\nCreo haber visto que los k\'thir llevaban varios tomos. Si logras traerme algunos, tal vez pueda sacar alguna conclusión útil de sus escritos.', '', '', '', '', '', '', 33528),
(58460, 'esMX', 'Mariscales de la locura', 'Mata a $1oa esbirros ignotos de N\'Zoth en el Valle de la Flor Eterna.', 'Hace mucho que los n\'raqi sirven a las fuerzas de los dioses antiguos como comandantes y capataces. Su presencia en el campo de batalla demuestra que esta invasión es un esfuerzo coordinado y no un brote casual de corrupción.\n\nBajo el liderazgo de estos amos ignotos, las fuerzas caóticas de los dioses antiguos se vuelven milicias entrenadas.\n\nNuestra prioridad debe ser la destrucción de estas criaturas. Es la única posibilidad de sacarle ventaja a N\'Zoth.', '', '', '', '', '', '', 33528),
(58458, 'esMX', 'Desafío de duelo de mascotas: Profundidades de Roca Negra', 'Detén a las figuras enigmáticas.', 'Esas figuras enigmáticas están tramando algo de nuevo. ¿Realmente quieres enfrentarlas? Si quieres volver, no te detendré.', '', '', '', '', '', '', 33528),
(58457, 'esMX', 'Enigmas de Roca Negra', 'Detén a las figuras enigmáticas.', 'Al fin encontramos a esas malditas figuras enigmáticas. Deberían estar todas allí. Parece que son muy fuertes, así que deberás llevar a tus mejores equipos si quieres ganar.\n\nAvísame cuando estés $Glisto:lista;.', '', '', '', '', '', '', 33528),
(58456, 'esMX', 'Enfrentamiento enigmático', 'Encuentra a Burt Macklyn afuera de la entrada de Profundidades de Roca Negra en Montaña Roca Negra.', '¡Es nuestra oportunidad! Encontramos el lugar donde se esconden estas figuras enigmáticas, y es hora de enfrentarlas y detener cualquier plan que puedan estar tramando. Su base de operaciones está en Profundidades de Roca Negra. Queda en tus manos.', '', '', '', '', '', '', 33528),
(58455, 'esMX', 'Enfrentamiento enigmático', 'Encuentra a Burt Macklyn afuera de la entrada de Profundidades de Roca Negra en Montaña Roca Negra.', '¡Es nuestra oportunidad! Encontramos el lugar donde se esconden estas figuras enigmáticas. Es hora de enfrentarlas y detener cualquier plan que puedan estar tramando. Su base de operaciones está en Profundidades de Roca Negra. Queda en tus manos.', '', '', '', '', '', '', 33528),
(58442, 'esMX', 'Fauces consumidoras', '', '', '', '', '', '', '', '', 33528),
(58439, 'esMX', 'Fauces consumidoras', '', '', '', '', '', '', '', '', 33528),
(58438, 'esMX', 'Fauces consumidoras', '', '', '', '', '', '', '', '', 33528),
(58436, 'esMX', 'Legado de los mecagnomos', 'Reúnete con el príncipe Erazmin en la Ciudad de Mecalópolis.', '$n, no podríamos estar más complacidos con tu progreso. Nos representas bien con la Alianza.\n\nVuelve a la Ciudad de Mecalópolis cuando puedas. Waren ha creado un regalo para ti.', '', '', '', '', '', '', 33528),
(58435, 'esMX', 'Legado de los vulperas', 'Reúnete con Hagashi en el Escondite Vulpera de Vol\'dun.', 'Gracias a tus esfuerzos, la Horda ha aprendido a valorar a los vulperas. \n\n¡Eres $gel:la;... vulpera más $gvulperano:vulperana; que conozco!\n\nVisítame en el Escondite Vulpera de Vol\'dun. Kiro me pidió que te preparara un pequeño recuerdo para agradecer todo lo que has hecho.', '', '', '', '', '', '', 33528),
(58423, 'esMX', 'Los más fuertes de sus filas', 'Derrota a 3 esbirros raros de N\'Zoth en el Valle de la Flor Eterna.', 'Has demostrado una enorme fuerza en tus conquistas, pero hay enemigos nuevos que atacan el Valle todos los días.\n\nBusca a los más fuertes que nuestros enemigos hayan enviado y derrótalos ante los ojos de sus aliados.', '', '', '', '', '', '', 33528),
(58422, 'esMX', 'Marca de los conquistadores', 'Quema $1oa estandartes del Imperio Negro en el Valle de la Flor Eterna.', 'Los esbirros invasores de N\'Zoth se están apropiando de tierras que no les pertenecen. \n\nNo conquistarán el Valle mientras haya al menos un Rajani con vida.\n\nQuema sus estandartes para que no lo olviden.', '', '', '', '', '', '', 33528),
(58420, 'esMX', 'Un problema fastidioso', 'Mata a $1oa hozen colamares en el Valle de la Flor Eterna.', 'Los hozen son débiles y oportunistas. No me sorprende que algunos se hayan aliado a los dioses antiguos.\n\nDeberíamos ocuparnos de ellos antes de que se vuelvan más que una molestia.', '', '', '', '', '', '', 33528),
(58375, 'esMX', 'Ny\'alotha: La guía de MADRE', 'Consigue 4 núcleos titánicos de Ra-Den, 4 corazones de dragón de Vexiona y 4 ojos proféticos de Il\'gynoth dentro de Ny\'alotha, la Ciudad Despierta en dificultad mítica.', 'Ny\'alotha no obedece las leyes del tiempo y el espacio, y quizá podamos aprovecharnos de eso.\n\nMADRE tiene la teoría de que, si obtenemos ciertos objetos de los elegidos de N\'Zoth, podemos utilizarlos para curvar el espacio y acelerar nuestro paso aquí en el futuro. Aunque dudo que renuncien a estos objetos por voluntad propia.', '', '', '', '', '', '', 33528),
(58374, 'esMX', 'Ny\'alotha: La guía de MADRE', 'Consigue 4 núcleos titánicos de Ra-Den, 4 corazones de dragón de Vexiona y 4 ojos proféticos de Il\'gynoth dentro de Ny\'alotha, la Ciudad Despierta en dificultad heroica.', 'Ny\'alotha no obedece las leyes del tiempo y el espacio, y quizá podamos aprovecharnos de eso.\n\nMADRE tiene la teoría de que, si obtenemos ciertos objetos de los elegidos de N\'Zoth, podemos utilizarlos para curvar el espacio y acelerar nuestro paso aquí en el futuro. Aunque dudo que renuncien a estos objetos por voluntad propia.', '', '', '', '', '', '', 33528),
(58373, 'esMX', 'Ny\'alotha: La guía de MADRE', 'Consigue 4 núcleos titánicos de Ra-Den, 4 corazones de dragón de Vexiona y 4 ojos proféticos de Il\'gynoth dentro de Ny\'alotha, la Ciudad Despierta en dificultad normal.', 'Ny\'alotha no obedece las leyes del tiempo y el espacio, y quizá podamos aprovecharnos de eso.\n\nMADRE tiene la teoría de que, si obtenemos ciertos objetos de los elegidos de N\'Zoth, podemos utilizarlos para curvar el espacio y acelerar nuestro paso aquí en el futuro. Aunque dudo que renuncien a estos objetos por voluntad propia.', '', '', '', '', '', '', 33528),
