(58334, 'esMX', 'Bruma Otoñal en llamas', '', '', '', '', '', '', '', '', 33528),
(58321, 'esMX', 'Un núcleo inusual', 'Recoge un núcleo titánico de un vigía de marfil en Uldum.', 'Nuestros exploradores han informado que los Amathet están construyendo nuevos vigías titánicos. \n\nSiempre creímos que este arte se había perdido en las arenas del tiempo. Parece que estábamos equivocados.\n\nNo necesito decirte lo útil que sería contar con la ayuda de ensamblajes vigías en nuestras batallas por Uldum. ¡Debemos revelar los secretos de su construcción!\n\nEl poder de un vigía titánico está en su núcleo. ¿Podrías traerme uno? Así nuestros artificieros podrían comprender sus procesos.', '', '', '', '', '', '', 33528),
(58318, 'esMX', 'Máscara ignota de la noche larga', 'Regresa la Máscara ignota de la noche larga al altar dentro de una visión horrible.', 'La resistencia necesaria para llegar tan lejos es extraordinaria, y es la hazaña de $Gun aventurero:una aventurera; muy $Gexperimentado:experimentada;. Pero la noche larga está cerca, junto con nuestra última conquista. Los que pelean contra la llegada del crepúsculo eterno solo conocen la frustración, porque en la noche larga su cordura siempre estará al límite.', '', '', '', '', '', '', 33528),
(58317, 'esMX', 'Máscara ignota del agonizante', 'Regresa la Máscara ignota del agonizante al altar dentro de una visión horrible.', 'Secretos, mentiras y trabajar al borde de la legalidad es todo lo que conoce el maestro espía. Sus pasiones y amores perdidos han desaparecido, aplastados por su propia devoción y lealtad a la corona. No queda nada, nada más que dolor. El dolor es una herramienta y un buen tutor, uno que el Vacío conoce muy bien. Devuelve mi máscara si te atreves a sentir las muchas formas que el dolor puede asumir.', '', '', '', '', '', '', 33528),
(58316, 'esMX', 'Máscara ignota de la imaginación oscura', 'Regresa la Máscara ignota de la imaginación oscura al altar dentro de una visión horrible.', 'Los magos blanden su magia para manipular y conquistar el mundo. Imaginando poderes más grandes, transitan las líneas del dominio del Vacío. En medio de estas investigaciones, este mago advirtió que en lo profundo de la imaginación yacen cosas realmente oscuras y terribles.', '', '', '', '', '', '', 33528),
(58314, 'esMX', 'Máscara ignota sin retorno', 'Regresa la Máscara ignota sin retorno al altar dentro de una visión horrible.', 'La guerrera exiliada nunca se siente en suelo firme, es una desterrada de su propio hogar. El vacío convierte esta inestabilidad en una realidad donde un paso puede llevarte al abismo o drenar todas tus fuerzas.', '', '', '', '', '', '', 33528),
(58297, 'esMX', 'Máscara ignota del temerario', 'Regresa la Máscara ignota del temerario al altar dentro de una visión horrible.', 'El cazador nuca quiso ser un líder, pero siempre buscaba un nuevo desafío. Dirigía a sus aliados con mano firme y nunca se ocultó de una pelea. La destreza que demostró lo hizo mucho más letal, tanto a él como a mis otros esbirros. Regresa esta máscara al altar del temerario para poner a prueba tu habilidad en la batalla frente a enemigos que atacan con mucha más fiereza.', '', '', '', '', '', '', 33528),
(58291, 'esMX', 'Furtivos al acecho', 'Recoge $1oa pieles de hiena resistentes de los cazadores amathet o desuella hienas en Uldum.', 'Los Vagayermos usábamos las pieles de las hienas locales para fabricar nuestras armaduras. Lamentablemente, desde la llegada de los Amathet, sus números han desbordado nuestros terrenos de caza.\n\nNecesitamos esas pieles, y pagaremos muy bien por ellas. Puedes quitárselas a los cazadores o desollar a las hienas con tus manos, si cuentas con esa habilidad.', '', '', '', '', '', '', 33528),
(58290, 'esMX', 'Campeones de los Amathet', 'Mata a $1oa enemigos amathet de élite en Uldum.', 'Los soldados de Ramkahen son numerosos y confiables. \n\nLos pondría a pelear contra cualquier tropa de los Amathet, pero es posible que algunos de sus guerreros de castas superiores sean demasiado para ellos.\n\nAunque no creo que sean un problema para ti. Sería muy útil para nuestras defensas si tú pudieras encargarte de ellos mientras mis soldados lidian con los de menor rango.', '', '', '', '', '', '', 33528),
(58289, 'esMX', 'Secretos guardados', 'Despoja $1oa alijos amathet en Uldum.', 'Por lo que sabemos de los Amathet, deben haber pasado miles de años encerrados en sus tumbas. ¡Piensa en lo que podríamos aprender de ellos!\n\nClaro que eso sería mucho más fácil si no quisieran matarnos. \n\nSi encuentras algún alijo de reliquias amathet en tus viajes, avísame. ¡Me encantaría ver la clase de misterios que contienen!', '', '', '', '', '', '', 33528),
(58288, 'esMX', 'Los elegidos del Rey del Sol', 'Derrota 3 enemigos amathet raros en Uldum.', 'Por fuera los Amathet parecen inquebrantables, pero todos los soldados caen tarde o temprano. Necesitamos dejarles en claro a sus fuerzas que no deben meterse con nosotros.\n\nBusca a sus tropas más fuertes y acaba con ellos, que lo observen con sus propios ojos. \n\n¡Les demostraremos la fuerza de Uldum!', '', '', '', '', '', '', 33528),
(58287, 'esMX', 'Un plan aplastante', 'Destruye $1oa ídolos amathet y $2oa obeliscos Toquesol en Uldum.', 'Los informes de mis exploradores mencionan varios ídolos y monumentos que los Amathet utilizan para canalizar su magia solar. \n\nNo sé qué traman exactamente, pero tenemos que quitarles cualquier ventaja que posean. Por esa razón, quiero que vayas hasta allí y rompas todo lo que parezca remotamente mágico.\n\nPero no le digas a la Liga de Expedicionarios. Me molestarían hasta el fin de los tiempos.', '', '', '', '', '', '', 33528),
(58286, 'esMX', 'Lejos de casa', 'Libera $1oa tol\'vir esclavizados en Uldum.', 'La conquista de los Amathet del este de Uldum fue repentina, y no pudimos alcanzar nuestros asentamientos más lejanos a tiempo. \n\nAfortunadamente, muchos de los tol\'vir que vivían en los territorios conquistados no fueron asesinados, solo obligados a trabajar para los Amathet. \n\nDebemos aprovechar cada oportunidad que tengamos para liberarlos y regresarlos a su hogar.', '', '', '', '', '', '', 33528),
(58285, 'esMX', 'Artefactos desenterrados', 'Consigue $1oa artefactos titánicos en Uldum.', 'Desde que los Amathet se levantaron de sus tumbas, han estado ocupados desenterrando reliquias titánicas en los alrededores. \n\nNo sé con certeza qué pretenden hacer con ellas, o si solo las acumulan para que no caigan en nuestras manos, ¡pero está más que claro que a la Liga de Expedicionarios le encantaría estudiarlas!\n\nPor supuesto, no podemos ni acercarnos con esos Amathet violentos en el camino, pero eso no es problema para ti, ¿cierto? \n\n¿Nos darías una mano?', '', '', '', '', '', '', 33528),
(58284, 'esMX', 'Escritos del Rey del Sol', 'Consigue $1oa escritos del Rey del Sol de los Amathet Toquesol de Uldum.', 'Se sabe muy poco acerca del Rey del Sol que gobierna a los Amathet. Nuestras observaciones indican que sus íntimos son los \"Toquesol\", una casta única de practicantes de la magia solar.\n\nMe encantaría aprender más acerca del Rey del Sol, pero a diferencia de otros miembros de la Liga de Expedicionarios, no pienso poner en riesgo la vida de mis investigadores para lograrlo. \n\nAhora que te veo, parece que sabes defenderte. Si encuentras algún escrito del Rey del Sol, te lo quitaría de las manos con gusto.', '', '', '', '', '', '', 33528),
(58283, 'esMX', 'Ciego lazarillo de ciegos', 'Mata a $1oa sacerdotes Amathet en Uldum.', 'Los sacerdotes del sol son una orden antigua de tol\'vir que ha caminado junto a todas las tribus. \n\nLos que siguen a los Amathet, sin embargo, han retorcido sus creencias y las han convertido en armas para justificar su cruzada contra los Ramkahen. Sus soldados los siguen ciegamente, sin cuestionarse nada.\n\nHay que detenerlos.', '', '', '', '', '', '', 33528),
(58282, 'esMX', 'Fuera de nuestro cielo', 'Mata a $1oa arqueros amathet en Uldum.', 'Los arqueros de Ramkahen tiene una gran puntería, pero los arcos de los Amathet tienen más alcance. Por esta razón, nuestras incursiones en su territorio son extremadamente peligrosas.\n\nA ti se te da muy bien luchar en tierras enemigas. Si redujeras sus filas, tendríamos más probabilidades de hacerlos retroceder de una buena vez.\n\n¿Podrías ayudarnos?', '', '', '', '', '', '', 33528),
(58281, 'esMX', 'Armamentos antiguos', 'Consigue $1oa piezas de armadura amathet de los amathet con armadura en Uldum.', 'Luchar una guerra en distintos frentes nos ha costado muchos suministros. Nuestros herreros no dan abasto para reparar y reemplazar las armaduras de nuestros soldados, lo que nos deja muy mal preparados para enfrentar a tantos enemigos.\n\nAunque la armadura de los Amathet es antigua, fue forjada por titanes y es formidable. Si pudiéramos conseguir alguna, sería de gran ayudan para nuestros esfuerzos defensivos.\n\n¿Podrías ayudarnos?', '', '', '', '', '', '', 33528),
(58279, 'esMX', 'Botín del intendente', '', '', '', '', '', '', '', '', 33528),
(58277, 'esMX', 'Impostores oscuros', 'Mata a $1oa esbirros k\'thir en Uldum.', 'Los dioses antiguos tienen muchos esbirros ignotos a su disposición, pero ninguno tan engañoso como los que llaman k\'thir.\n\nAunque no son tan imponentes como sus hermanos, los k\'thir manipulan las sombras, tuercen la voluntad de los hombres y hasta la realidad misma.\n\nNo podemos permitir que ejecuten sus planes.', '', '', '', '', '', '', 33528),
(58276, 'esMX', 'Mar\'at en llamas', '', '', '', '', '', '', '', '', 33528),
(58275, 'esMX', 'Invocación monstruosa', '', '', '', '', '', '', '', '', 33528),
(58274, 'esMX', 'Sirviente de N\'Zoth', 'Utiliza N\'lyeth, Esquirla de N\'Zoth para cambiar tu facción de Alianza a $gdevoto:devota; de N\'Zoth. Luego mata a 10 jugadores de la Alianza sin morir.', '$C…\n\nTe he observado… He sentido tu sed de sangre. \n\nPero sirves a profetas falsos… La Alianza es una ilusión… ¡Yo soy un dios!\n\nDemuéstrame que eres $gdigno:digna; de mi don… Mata a todos los que pretenden traicionarte…\n\nMata… ¡a la Alianza!', '', '', '', '', '', '', 33528),
(58273, 'esMX', 'Sirviente de N\'Zoth', 'Utiliza N\'lyeth, Esquirla de N\'Zoth para cambiar tu facción de Horda a $gdevoto:devota; de N\'Zoth. Luego mata a 10 jugadores de la Horda sin morir.', '$C…\n\nTe he observado… He sentido tu sed de sangre. \n\nPero sirves a profetas falsos… La Horda es una ilusión… ¡Yo soy un dios!\n\nDemuéstrame que eres $gdigno:digna; de mi don… Mata a todos los que pretenden traicionarte…\n\nMata… ¡a la Horda!', '', '', '', '', '', '', 33528),
(58271, 'esMX', 'Ritual de llamas del Vacío', '', '', '', '', '', '', '', '', 33528),
(58257, 'esMX', 'Fauces consumidoras', '', '', '', '', '', '', '', '', 33528),
(58256, 'esMX', 'Fauces consumidoras', '', '', '', '', '', '', '', '', 33528),
(58239, 'esMX', 'Lecciones de bandidismo', 'Despoja $1oa alijos del Imperio Negro en Uldum.', 'Los vagayermos hemos vivido generaciones enteras como bandidos, en tierra firme y en alta mar. Aunque decidimos dejar atrás las andanzas por una vida pacífica, no hemos olvidado las lecciones que aprendimos.\n\nUna de esas lecciones, que creo sumamente relevante ahora, es la que enseña que a veces pueden usarse las armas del enemigo en su contra.\n\nEncuentra sus alijos escondidos y llévate todo lo que puedas cargar. Quizás hasta encuentres algo que pueda dar vuelta esta batalla.', '', '', '', '', '', '', 33528),
(58238, 'esMX', 'Perdidos y atormentados', 'Libera a $1oa ciudadanos de Ramkahen de las celdas de tormento dentro de la Ciudad Perdida de los Tol\'vir, Uldum.', 'Nuestros ciudadanos de Ramkahen han logrado escapar de la peor parte del asalto de N\'Zoth. \n\nNuestros hermanos de la Ciudad Perdida no tuvieron tanta suerte. Los que no fueron asesinados al instante, ahora son víctimas cautivas de las torturas de los esbirros de N\'Zoth.\n\nSé que lucharás contra las fuerzas de N\'Zoth. Si puedes liberar a nuestros aliados también, Ramkahen estará en deuda contigo.', '', '', '', '', '', '', 33528),
(58237, 'esMX', 'Purificación de Uldum', 'Destruye $1oa tumores de corrupción en Uldum.', 'Cuanto más tiempo permanecen en Uldum las fuerzas de N\'Zoth, más se arraiga su corrupción a la tierra.\n\nAunque expulsáramos a sus esbirros, el daño que ha provocado a Uldum es irreversible. \n\nDebemos encontrar el lugar desde el que supura la corrupción y eliminarla.', '', '', '', '', '', '', 33528),
(58236, 'esMX', 'Destrucción simbólica', 'Destruye $1oa estandartes del Imperio Negro en Uldum.', 'Los cultistas que siguen a esa legión oscura profanan nuestras tierras con símbolos de los tiranos que idolatran. \n\nSus seguidores descerebrados acuden en manada a estos estandartes para venerarlos como ídolos impíos.\n\nIncéndialos y purifica nuestras tierras.', '', '', '', '', '', '', 33528),
(58235, 'esMX', 'Anclajes del Imperio Negro', 'Destruye $1oa obeliscos del Imperio Negro en Uldum.', 'Esta invasión nos tomó por sorpresa. Unas estructuras que evocan al Imperio Negro se materializaron de la nada, y de ellas emergieron las fuerzas de los dioses antiguos. No tenemos idea de dónde salieron ni cómo.\n\nSin embargo, cada vez que aparece una nueva estructura, primero aparecen unos obeliscos maléficos. Creemos que los obeliscos hacen las veces de anclas para dar paso a más fuerzas de los dioses antiguos.\n\nSi queremos cortar esta invasión de raíz, debemos destruir los obeliscos.', '', '', '', '', '', '', 33528),
(58234, 'esMX', 'Recursos de origen dudoso', 'Consigue $1oa esencias fusionadas de los limos de Uldum.', 'Mi clarividencia ofrece una herramienta estratégica invaluable para los Ramkahen. Sin embargo, últimamente, la potencia de mis visiones está deteriorando mi salud.\n\nHe concebido un tónico que podría aliviar el dolor que me provocan las visiones, pero precisaré la esencia fusionada de la corrupción de los dioses antiguos.\n\nSi pudieras conseguirme algunas muestras, sería una ayuda enorme para nuestros esfuerzos.', '', '', '', '', '', '', 33528),
(58233, 'esMX', 'Corruptores retorcidos', 'Mata a $1oa bestias de carne en Uldum.', 'Si bien las bestias de carne que acompañan a las fuerzas invasoras no parecen más que una pequeña molestia, en su interior albergan una conexión profunda con los poderes de corrupción de los dioses antiguos. \n\nComo una peste, propagan la corrupción de N\'Zoth a donde sea que vayan, retorciendo la tierra lentamente.\n\nHay que erradicarlas.', '', '', '', '', '', '', 33528),
(58232, 'esMX', 'Orden en medio del caos', 'Mata $1oa esbirros ignotos de N\'Zoth en Uldum.', 'Ha pasado un largo tiempo desde que los tol\'vir se enfrentaron contra las fuerzas de un dios antiguo, así que nuestro conocimiento táctico de sus fuerzas es limitado.\n\nSin embargo, hay un principio de combate que siempre funciona: derribar al que da las órdenes es el primer paso para derrotar al enemigo. \n\nHe notado que los ignotos más grandes se desempeñan como comandantes de las fuerzas de los dioses antiguos. Siléncialos, y quizás así podamos sembrar un caos distinto entre sus filas.', '', '', '', '', '', '', 33528),
(58231, 'esMX', 'Susurros de la oscuridad', 'Consigue $1oa escritos demenciales de los cultistas del Imperio Negro en Uldum.', 'En mis visiones oigo… voces…\n\nSus palabras no tienen sentido, pero con el tiempo, descubro patrones. Creo que detrás de las voces se oculta algo importante, pero aún no he logrado descifrar ni una palabra.\n\nTendremos que aprender más de la fuente. Busca cualquier escrito que puedas entre los cultistas que viajan con estas criaturas oscuras. Sus líneas farragosas pueden ser la clave para comprender el mensaje debajo de la locura.', '', '', '', '', '', '', 33528),
(58230, 'esMX', 'Ojos cegados', 'Mata a $1oa observadores nefastos en los Campos de Akhenet de Uldum.', 'Últimamente, unas fuerzas extrañas han interferido con mis visiones. Los ojos siempre vigilantes atraviesan el velo y destrozan mi clarividencia.\n\nLos ojos de nuestro enemigo observan nuestra alma y perforan nuestra mente. Si deseamos librarnos de la maldición de esta tierra, debemos arrancarlos.', '', '', '', '', '', '', 33528),
(58229, 'esMX', 'Un grito de convocación', 'Mata 3 esbirros raros de N\'Zoth en Uldum.', 'Los esbirros de los dioses antiguos han infestado nuestras tierras. Nos atacan desde todas las direcciones, incluso asaltan la mente de nuestros soldados.\n\nNuestras fuerzas no podrán resistir durante mucho tiempo. Debemos darle un golpe contundente al enemigo para recuperar la moral de nuestras tropas.\n\nEncuentra las monstruosidades más grandes, limosas y con cara de tentáculo que puedas y aplástalas. Tu ejemplo alentará a mis hombres.', '', '', '', '', '', '', 33528),
(58216, 'esMX', 'Fauces consumidoras', '', '', '', '', '', '', '', '', 33528),
(58214, 'esMX', 'Atención urgente', 'Encuentra a Kelsey Chispacero en Puerto Boralus.', 'Justo a tiempo, $n.\n\nKelsey Chispacero ha estado enviando comunicados a las ciudades capitales en busca de ayuda.\n\nLa condición de Mekkatorque es bastante preocupante y el tiempo apremia.\n\nDirígete a Puerto Boralus, ella te estará esperando.', '', '', '', '', '', 'Encuentra a Kelsey Chispacero en Puerto Boralus.', 33528),
(58168, 'esMX', 'Una realidad oscura y deslumbrante', 'Derrota a $1oa vigías mirada oscura dentro de la Visión.', 'Sus ojos se posan sobre nosotros, $n, y observan cada movimiento desde las sombras. No me sorprende que nuestros esfuerzos hasta ahora hayan parecido... insuficientes.\n\nLa culpa no es tuya, desde luego. Deberíamos haber sospechado que esta era la situación hace mucho tiempo.\n\nSi queremos continuar trabajando con alguna expectativa, debemos pasar desapercibidos.\n\nNuestro viejo amigo ha ofrecido un elixir que ayudará a exponer a nuestro enemigo. Puede que tenga algunos... efectos secundarios desconocidos... pero le permite ver claramente en la oscuridad a la persona que lo bebe.', '', '', '', '', '', '', 33528),
(58167, 'esMX', 'Medidas preventivas', 'Destruye $1oa portales del Vacío dentro de la Visión.', 'Las olas de oscuridad siguen atacando las costas de nuestro mundo. Me temo que las aguas que están a nuestros pies pronto nos inundarán. Quizás sea momento de probar otra estrategia.\n\nDirígete al reino retorcido y busca sus portales oscuros. Si logramos detener su avance, quizás consigamos el tiempo necesario para exponer una debilidad fatal.', '', '', '', '', '', '', 33528),
(58156, 'esMX', 'Expulsión de la oscuridad', 'Repele la corrupción de N\'Zoth en la Visión.', 'La oscuridad crece. El ciclo continúa.\n\nHaz lo que puedas para aplacar los esfuerzos de N\'Zoth. Si no nos enfrentamos a la corrupción, puede que algún día la oscuridad nos ahogue.', '', '', '', '', '', '', 33528),
(58155, 'esMX', 'Una mano en la oscuridad', 'Rescata $1oa almas de la Visión.', 'Imagina quedar $Gatrapado:atrapada; en un mundo que no sabías que existía, una realidad desconocida incluso para ti $Gmismo:misma;.\n\nLos pensamientos, los miedos y los deseos oscuros nublan la mente, y sobreviene una tentación irresistible.\n\nMuchos caen ante la oscuridad, incapaces de resistirse a esa tentación, aunque no todos.\n\nHaz lo que puedas para ayudar a los que luchan contra la oscuridad. No podemos dejar que caigan.', '', '', '', '', '', '', 33528),
(58151, 'esMX', 'Esbirros de N\'Zoth', 'Derrota $1oa esbirros de N\'Zoth en la Visión.', 'Quizás algún día estos susurros cada vez más oscuros, aunque familiares, ahoguen los vientos aulladores que nos rodean y los silencien.\n\nDebemos hacer algo.\n\nPenetra en la oscuridad, $n, y destruye al enemigo.', '', '', '', '', '', '', 33528),
(58147, 'esMX', 'Forastero en tierra extraña', 'Busca el tablero de ¡Se busca héroe! en la Ciudad de Ventormenta.', '$GBienvenido:Bienvenida; a Ventormenta, $r. El rey Anduin Wrynn te invita a explorar nuestra bella ciudad. Tu aspecto me dice que te gusta la vida nocturna. ¡Tenemos varias tabernas famosas y lugares para escuchar música llenos de vida! \n\nAh, pero eso puede esperar. Busca el tablero de ¡Se busca héroe! en la ciudad para averiguar el próximo destino de tu aventura y luego habla con tu emisario.\n\nQue disfrutes tu estancia en Ventormenta, $n. Ah, y un consejo de amigo… no mejores a nadie sin su consentimiento. ¡Algunos no se lo toman muy bien!', '', '', '', '', '', 'Habla con Lulana en el Distrito de los Enanos.', 33528),
(58146, 'esMX', 'Por la Alianza', 'Reúnete con el embajador Moorgard en la Embajada de Ventormenta.', 'Como Manitas Mayor y líder de los gnomos y los mecagnomos, ¡me enorgullece darte la bienvenida a la Alianza!\n\nTe espera un mundo repleto de aventuras al otro lado de los muros de Ciudad de Mecalópolis.\n\nCuando estés $glisto:lista; entra al teletransportador. El embajador Moorgard estará aguardando tu llegada en la Embajada de Ventormenta.\n\nTendrás muchas formas posibles de seguir tu aventura.\n\nElige con sabiduría, esfuérzate para mejorar, y no olvides compartir tus descubrimientos.', '', '', '', '', '', 'Reúnete con el embajador Moorgard en la Embajada de Ventormenta.', 33528),
(58124, 'esMX', 'Forastero en tierra extraña', 'Busca el tablón de mando del jefe de guerra en Orgrimmar.', 'Hola. Soy el embajador Mortharón.\n\n<Mortharón mira un papel que tiene en la mano.>\n\nEn nombre de la jefa de guerra, es un honor darte la bienvenida a Orgrimmar, $r.\n\n<Te lanza una sonrisa poco convincente y vuelve a mirar el papel.>\n\nTe esperan un sinfín de aventuras y peligros que... ¡agh!\n\n¿Sabes qué? Estuve repitiendo la misma bienvenida todo el día. Ya basta.\n\nExamina el tablón de mando del jefe de guerra y averigua dónde puedes seguir tus aventuras. Y ahora, vete.', '', '', '', '', '', 'Habla con Nilsa en el Valle del Honor.', 33528),
(58122, 'esMX', 'Por la Horda', 'Reúnete con el embajador Mortharón en la Embajada de Orgrimmar.', '¡Qué aventura, $c!\n\nHay tanto por explorar… tanto por descubrir. ¡Estamos en una verdadera era del descubrimiento!\n\nLes demostraremos a nuestros aliados de la Horda cuán valioso es tener vulperas ingeniosos cerca.\n\nReúnete con el embajador en la embajada de Orgrimmar y luego explora las posibilidades en todos los rincones de Azeroth y más allá.\n\n¡Hasta que nuestros caminos se vuelvan a cruzar, $n!', '', '', '', '', '', 'Reúnete con el embajador Mortharón en la Embajada de Orgrimmar.', 33528),
(58097, 'esMX', 'Suministros del Acuerdo de Uldum', 'Habla con la Proveedora Qorra en Uldum para recibir tu recompensa.', 'La resistencia valora mucho la ayuda que nos has dado.\n\nPor favor, acepta estos suministros como una muestra de nuestra gratitud. Te otorgaremos muchos más si nos sigues ayudando.', '', '', '', '', '', '', 33528),
(58096, 'esMX', 'Suministros de los Rajani', 'Habla con Zhang Ku en el Valle de la Flor Eterna para recibir tu recompensa.', 'La resistencia valora mucho la ayuda que nos has dado.\n\nPor favor, acepta estos suministros como una muestra de nuestra gratitud. Te otorgaremos muchos más si nos sigues ayudando.', '', '', '', '', '', '', 33528),
(58087, 'esMX', 'Destruir la fuente', 'Destruye $1oa baterías nazeshi dentro de Bajíos Perlaterror.', 'La clamamareas Nezara está detrás de todo esto. Si acabamos con ella, el resto de los nagas romperán sus filas, pero alcanzarla no será fácil. Nezara está detrás de una barrera mágica potenciada por las baterías cercanas. \n\nSi destruimos la fuente, podremos destruirla.', '', '', '', '', '', '', 33528),
(58010, 'esMX', '¡Más restos, más!', 'Consigue $1oa restos de aqir.', 'Necesitamos más muestras de los aqir, $p. ¡Todas las que puedas conseguir!\n\nYa he realizado descubrimientos fascinantes, pero aún queda mucho por aprender.\n\nCon un poco más de estudio y una pizca de suerte, quizá podamos comprender poco a poco sus debilidades.', '', '', '', '', '', '', 33528),
(58009, 'esMX', 'A la luna', 'Elimina la amenaza aqir del Obelisco de la Luna.', '¡Bien! Hola de salir volando de aquí.\n\nTenemos que regresar al campamento y contarle a Arik lo que pasó aquí, cuanto antes mejor.\n\nDirígete al bombardero para llenarlo de combustible. \n\nTe dejaré el asiento de la torreta, pero yo seré la piloto, ¡así que intenta hacer explotar algunos insectos en el camino!', '', '', '', '', '', '', 33528),
(58008, 'esMX', 'Tanque lleno', 'Consigue $1oa latas de combustible.', 'Estaba revisando los aviones y… no vas a creerlo, ¡pero ninguno tiene combustible en el tanque!\n\nVi un par de latas tiradas por aquí, apuesto a que alguna debe tener algo de combustible todavía.\n\nIba a recogerlas yo misma, pero estos estúpidos insectos salieron de la nada y me atacaron.\n\nSon demasiados para mí sola, ¿podrías darme una mano?', '', '', '', '', '', '', 33528),
(57990, 'esMX', 'Obelisco del Sol', 'Encuentra a la Exterminadora Zahra en el Obelisco del Sol.', 'Tengo otro favor que pedirte, $Gamigo:amiga;. Completar esta tarea es esencial para garantizar nuestra supervivencia aquí.\n\nNuestra camarada, Zahra, ha asumido la tarea de escalar la meseta del este para recuperar uno de los viejos bombarderos abandonados allí.\n\nHasta ahora, todos los intentos de comunicarnos con Arik han fracasado. \n\nSin embargo, si puedes ayudarla a reparar uno de esos aviones, quizás tengamos una oportunidad.\n\nCon algo de suerte, enviarán ayuda antes de que sea demasiado tarde…', '', '', '', '', '', '', 33528),
(57974, 'esMX', 'Heroico: Batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57973, 'esMX', 'Heroico: Batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57971, 'esMX', 'Ruinas de Ammon', 'Viaja a las Ruinas de Ammon.', '¡Parece que estas cosas están en todos lados al mismo tiempo!\n\nO se trata de un ataque organizado, o son muchos más de los que podríamos imaginar.\n\nComo sea, esto es malo para nosotros… muy, muy malo.\n\n$p, necesito que viajes a las Ruinas de Ammon y averigües cómo está la situación allí.\n\nSi necesitan ayuda, ¡dales una mano!', '', '', '', '', '', '', 33528),
(57970, 'esMX', 'Arruinador Xok\'nixx', 'Mata al Arruinador Xok\'nixx.', 'Ar\'kali y un grupo de nuestros guerreros se están enfrentando a una criatura gigantesca en el corazón de las ruinas.\n\nElla es capaz de defenderse de casi cualquier adversario, pero me temo que es solo cuestión de tiempo hasta que ese monstruo logre agotarlos.\n\nAunque la criatura está ocupada por el momento, si nuestros guerreros caen, perderemos el control de las ruinas.\n\nPor favor, date prisa. Con tu ayuda, sin duda podrán liquidar a este enemigo titánico.', '', '', '', '', '', '', 33528),
(57969, 'esMX', 'Atender a los heridos', 'Sana $1oa obreros vagayermos.', '$GAmigo mío:Amiga mía;, como puedes ver, estas criaturas terribles nos asedian.\n\nMuchos de nuestros camaradas han sido víctimas de los monstruos, pero por suerte tenemos suficientes guerreros aquí para mantener esta amenaza a raya... por ahora.\n\nSi puedes ayudarnos, te pido que por favor atiendas a los heridos y despejes un camino para que puedan escapar de las ruinas.', '', '', '', '', '', '', 33528),
(57962, 'esMX', 'Heroico: Batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57961, 'esMX', 'Heroico: Batalla por Costa Oscura', '', '', '', '', '', '', '', '', 33528),
(57960, 'esMX', 'Frente de batalla heroico: La Batalla por Costa Oscura', 'Derrota a la Horda en la Batalla por Costa Oscura.', 'No toleraremos más agresiones de la Horda en nuestro territorio.\n\nLos elfos de la noche no estarán solos hoy. Costa Oscura volverá a ser suya.\n\n¡Por la Alianza!', '', '', '', '', '', '', 33528),
(57959, 'esMX', 'Frente de batalla heroico: La Batalla por Costa Oscura', 'Derrota a la Alianza en la Batalla por Costa Oscura.', '¡Costa Oscura le pertenece a la Horda! Debemos mantener esa posición para conservar nuestro dominio en Kalimdor.\n\nPrepárense. ¡La batalla espera!', '', '', '', '', '', '', 33528),
(57956, 'esMX', 'Anfitriones vagayermos', 'Mata a $2oa anfitriones vagayermos.', 'Los insectos han estado poniendo huevos en los cadáveres de nuestros soldados, ¡es completamente aterrador!\n\nAlgunos se levantan del suelo como monstruosidades asquerosas, pútridas e hinchadas.\n\nTenemos que detenerlos antes de que sigan fortaleciendo sus filas con nuestros caídos.\n\nNo es una tarea agradable... pero debo pedirte que me ayudes a destruirlos. Por completo.\n\nToma algunas de las bombas que están a mis espaldas, si así lo deseas.', '', '', '', '', '', '', 33528),
(57955, 'esMX', 'Hacia el Puerto Anjesenamón', 'Encuentra a la rastreadora Samara en Puerto Anjesenamón.', 'Me temo que aún no tengo la fuerza necesaria para salir a las arenas y volver a enfrentarme a esos monstruos.\n\nDirígete al sur y encuentra a la Rastreadora Samara en el campamento de excavación antes conocido como Embarcadero de Schnottz.\n\nDile que detenga a todas las caravanas que planean pasar por este camino para evitar que otros sean emboscados y sufran el mismo destino terrible.\n\n¡Debemos llevar esa información a todo Uldum antes de que dividan más a nuestras fuerzas!', '', '', '', '', '', '', 33528),
(57954, 'esMX', 'Quema los cuerpos', 'Quema $1oa cadáveres infestados con huevos.', 'Parece que los insectos están poniendo sus huevos indiscriminadamente en todos los cadáveres cercanos.\n\nLos usan como alimento para engendrar más de esas cosas asquerosas. ¡Qué asco!\n\nPodemos lamentarnos por los muertos más tarde, pero si dejamos que eclosionen más insectos, quizá no vivamos lo suficiente para hacerlo.\n\n¡Quema los cadáveres y destruye los huevos!', '', '', '', '', '', '', 33528),
(57915, 'esMX', 'Búsqueda de sobrevivientes', 'Busca $1oa vagayermos en Orsis.', 'Los insectos brotaron de todas partes... No hubo mucho tiempo para reaccionar.\n\nMuchos de mis amigos murieron donde estaban, y otros intentaron luchar con nuestras pocas herramientas.\n\nSoy un cobarde. Hui en medio de la conmoción en lugar de intentar ayudar.\n\nAhora, aquí estoy, sin comida ni agua y demasiado aterrado para buscar sobrevivientes.\n\nPor favor, te ruego que ayudes a todo el que encuentres con vida en Orsis...', '', '', '', '', '', 'Busca al escolta Lashan en Orsis.', 33528),
(57873, 'esMX', 'Novedades de Orsis', 'Investiga la situación en Orsis.', 'Como puedes ver, $n, estamos ocupados encargándonos de estos insectos asquerosos.\n\nNuestras caravanas del sur han dejado de llegar y hemos recibido noticias preocupantes de los pocos que lograron regresar.\n\nEnvié una patrulla a investigar a Orsis; ya deberían haber regresado.\n\n¿Puedo pedirte que vayas a ver cómo están?', '', '', '', '', '', '', 33528),
(57774, 'esMX', 'Nueve vidas', 'Destruye $1oa moradores de Neferset.', 'Los exploradores regresaron hace poco, al borde de la muerte, con informes que me parecen... desconcertantes.\n\nHan visto neferset deambulando por las calles de su ciudad al sur.\n\nNormalmente, esto no sería motivo para alarmarnos, con la excepción de que los Neferset fueron eliminados por completo.\n\nDebo pedirte que investigues en profundidad... y si por alguna magia repugnante estos informes resultan ser ciertos, ¡debes hacer todo lo que puedas para contener esta amenaza!', '', '', '', '', '', '', 33528),
(57773, 'esMX', 'Una grieta poco discreta', 'Encuentra y cierra $1oa grietas del Vacío en Uldum.', 'Nuestros guerreros han observado cómo emergen manifestaciones oscuras de las numerosas grietas del Vacío que están en la jungla circundante. \n\nHan sido enemigos insignificantes que claramente están probando nuestras defensas antes de que lleguen las fuerzas reales.\n\nSin embargo, si no nos encargamos de esta amenaza ahora, solo será cuestión de tiempo hasta que sus señuelos nos arrasen.\n\n¡Encuentra una forma de cerrar esos portales!', '', '', '', '', '', '', 33528),
