(57737, 'esMX', 'Rescata a los Ramkahen', 'Rescata $1oa habitantes de Mar\'at.', 'Mar\'at fue arrasada por esos asquerosos k\'thir antes de que pudiéramos evacuar a nuestros ciudadanos. \n\nTemo que haya sucedido lo peor.\n\nPor favor, si queda alguien con vida en la ciudad, diles que vengan a Ramkahen.', '', '', '', '', '', '', 33528),
(57728, 'esMX', 'Asalto: El enjambre infinito', 'Expulsa el asalto mántide en el Valle de la Flor Eterna.', '¡El enjambre mántide está avanzando! No hay manera de que el Loto Dorado pueda con tantos.\n\n¡Debemos hacer algo para repelerlos!', 'Regresa con Taoshi en el Santuario Silente.', '', '', '', '', 'Regresa con Taoshi en el Santuario Silente.', 33528),
(57721, 'esMX', 'Botín de guerra', 'Recoge $1oa piezas de armadura mogu recuperada de los enemigos mogu en el Valle de la Flor Eterna.', 'Los clanes en guerra son implacables y nuestros guerreros están destrozando sus armaduras más rápido de lo que yo puedo repararlas.\n\nSi te cruzas en batalla con los otros clanes, intenta recuperar algunas piezas de armadura intactas de sus soldados. No deberíamos desperdiciar los recursos útiles.', '', '', '', '', '', '', 33528),
(57720, 'esMX', 'Campeones de los mogu', 'Derrota a 3 enemigos raros mientras los Mogu invaden el Valle de la Flor Eterna.', 'Estos clanes menores que luchan entre sí en el Valle tienen que aprender a comportarse.\n\nBusca a sus campeones y elimínalos. ¡Muéstrales que solo los Rajani tienen el derecho legítimo a ocupar este lugar!', '', '', '', '', '', '', 33528),
(57718, 'esMX', 'Unidos a la piedra', 'Recoge varas moldeapiedras de los moldeapiedras baruk y úsalas para liberar $1oa guerreros petrificados en las Ruinas de Guo-Lai.', 'Algunos de nuestros guerreros estaban acampando en un pequeño asentamiento cerca de Guo-Lai cuando los Baruk invadieron el área. Algunos lograron escapar, pero regresaron con historias de cómo los moldeapiedras mogu petrificaron a sus hermanos y hermanas en armas y los convirtieron en estatuas vivas.\n\n¡No podemos abandonar a nuestros guerreros! \n\nLos moldeapiedras deben tener alguna forma de revertir el hechizo y liberarlos de sus prisiones de piedra. ¡Trae a nuestros soldados de regreso!', '', '', '', '', '', '', 33528),
