(57524, 'esMX', 'Acceso a los archivos', 'Habla con MADRE para activar el archivo de investigación titánica y examina los archivos.', 'La información que has reunido nos ha permitido comprender mejor estas manifestaciones.\n\nCreo que MADRE te está esperando para compartir algunos de sus hallazgos contigo.', '', '', '', '', '', '', 33528),
(57522, 'esMX', 'Llamada del Vacío', '', '', '', '', '', '', '', '', 33528),
(57521, 'esMX', 'Carro de guerra potenciado', '', '', '', '', '', '', '', '', 33528),
