(57508, 'esMX', 'Estandarte de guerra zara\'thik', '', '', '', '', '', '', '', '', 33528),
(57497, 'esMX', 'Propagación de noticias', 'Informa a Aysa Canción Etérea en Ventormenta de los últimos acontecimientos.', '¡Queríamos salvar una vida y logramos mucho más!\n\nRealmente no podríamos haberlo hecho sin tu ayuda, $n. Estoy muy emocionada por el futuro de toda la gnomanidad.\n\n¡Ve de regreso a Ventormenta y comparte las buenas noticias!', '', '', '', '', '', 'Informa a Aysa Canción Etérea en Ventormenta de los últimos acontecimientos.', 33528),
(57496, 'esMX', 'Ascensión', 'Elimina a los defensores de Mecalópolis restantes.', 'Después de todo lo que han hecho por nosotros los mecagnomos el día de hoy, es nuestro deber devolverles el favor.\n\nEliminemos las creaciones rebeldes que permanecen en Mecalópolis. \n\nSi les devolvemos su pueblo, el príncipe Erazmin y su pueblo tendrán un futuro brillante.\n\nCon este equipo, podremos encargarnos en un abrir y cerrar de ojos de los que siguen siendo leales al rey Mecalo.\n\n¡Avísame cuando estés $Glisto:lista; para empezar!', '', '', '', '', '', 'Habla con Gelbin Mekkatorque.', 33528),
(57495, 'esMX', 'El futuro de Mecalópolis', 'Ve al Chatarratorio Mayor, en Ciudad de Mecalópolis.', 'Ahora que la Ciudad de Mecalópolis fue liberada de los peligros que quedaban, volverá a ser un sitio de paz y prosperidad para los gnomos y los mecagnomos por igual.\n\nEs hora de que le hable al príncipe Erazmin sobre el futuro de nuestros pueblos. ¡Espero de corazón que podamos formar una alianza que dure muchas generaciones!\n\nCuando estés $glisto:lista;, acompáñanos al Chatarratorio Mayor para escuchar un discurso especial.', '', '', '', '', '', '', 33528),
(57494, 'esMX', 'Un corazón fuerte', 'Recupera el reactor de chispa y completa el procedimiento de Mekkatorque.', 'Vimos una bengala cerca de Depósito Chatarrawatt. \n\nEl equipo de recuperación ha logrado salir con la fuente de energía. Ahora estamos a salvo del Aniquilotrón del rey Mecalo y su corazón servirá un nuevo propósito.\n\n¡Son grandes noticias!\n\nSin embargo, la bengala indica que tienen compañía. Necesitaremos tu ayuda para rescatar al equipo y recuperar el reactor de chispa.\n\nDate prisa, por favor, estamos muy cerca de lograrlo.', '', '', '', '', '', 'Reúnete con el príncipe Erazmin en Pernoxidado.', 33528),
(57493, 'esMX', 'Armonización mental', 'Activa el sincroscopio cuando Christy te lo indique.', 'Ahora que tenemos una referencia sobre la personalidad de Mekkatorque, parece que hay lugar para algunas mejoras. \n\nHace falta tu ayuda para estabilizarlo y sincronizarlo antes de extraerlo de su cápsula.\n\nColócate junto al sincroscopio. Yo realizaré los ajustes y tú tendrás que encender la máquina cuando lo diga.', '', '', '', '', '', '', 33528),
(57492, 'esMX', '¿Él?', 'Recoge datos de los gnomos y los mecagnomos en Mecalópolis.', 'Habla con algunos de los gnomos de Mecalópolis, estén mejorados o no. Habla con mi pueblo y pregunta qué esperan de un nuevo líder. Y a nuestros nuevos amigos, pregúntales qué es lo que más valoran sobre su líder actual.\n\nPor lo que he aprendido hasta ahora, el Manitas Mayor siempre ha guiado a su pueblo por necesidad, jamás deseó la corona. Creo que los gnomos deberían volver a unirse. \n\nBusco una solución que sea amena para todos. ¿Podrías conseguir la información que necesito?', '', '', '', '', '', '', 33528),
(57491, 'esMX', 'Mejor, más fuerte y menos muerto', 'Recoge el acelerador neural, el omniamplificador electromagnético y los servos energizados con flujo de las unidades erráticas.', 'Puede que el rey Mecalo haya estado loco, pero sus esbirros tenían una capacidad de creación robótica ejemplar. \n\nAún merodean algunas creaciones residuales por Mecalópolis que se rehúsan a aceptar el derrocamiento del rey Mecalo.\n\nLa conclusión lógica de una derrota es el retiro, si la unidad permanece operativa, pero algunos no comprenden la lógica.\n\nComo cuentan con los últimos avances tecnológicos, creo que recuperar algunas piezas específicas de esas unidades podría ser de gran ayuda para nuestra tarea.', '', '', '', '', '', 'Reúnete con Christy junto a la cápsula de escape de Mekkatorque', 33528),
(57490, 'esMX', 'Viaje a la seguridad', 'Derrota a los troggs carroñeros y recupera la cápsula de escape de Mekkatorque.', 'Uno de nuestros defensores vio a los troggs derribar el telecóptero que llevaba la cápsula de Mekkatorque. \n\nSe han vuelto una verdadera molestia desde que empezamos a traer pertrechos de Tiragarde. \n\nPistón, un inventor joven muy prometedor, tiene un vehículo capaz de ocuparse de esta tarea. Ve a ver a su tripulación en el Vertedero de Bondo.\n\n¡Date prisa y recupera la cápsula! No sé qué será de Gelbin si logran abrirla.\n\nEh, por cierto, no estaría nada mal que despejaras un poco la playa mientras estás ahí...', '', '', 'Ojo oxidado el Astuto', '', '', 'Regresa con Waren Remache en Pernoxidado.', 33528),
(57488, 'esMX', 'El esquema actual', 'Recoge $1oa de lodo resistente al calor y $2oa piezas de maquinaria obtenidas.', 'Creo que puedo modificar uno de nuestros dispositivos para que nos dé acceso a Gelbin Mekkatorque sin perturbar sus funciones vitales.\n\nHay algunos objetos que necesito que consigas. \n\nEn el vector cercano del Basural, encontrarás robots chatarra y chataperros. Serán una buena fuente de piezas de repuesto para mi proyecto de construcción.\n\nEl Derrame alberga algunas criaturas especialmente babosas. Te brindarán ingredientes excelentes para el lubricante resistente al calor que necesitamos.', '', '', '', '', '', '', 33528),
(57487, 'esMX', 'Alguien que nos ayude', 'Ayuda a Kelsey a llevar la cápsula de escape de Mekkatorque a Mecalópolis.', 'Creo que hay una manera de ayudar a Mekkatorque, pero puede que algunos no estén totalmente de acuerdo con eso... \n\nLos mecagnomos tienen técnicas avanzadas de reparación y mejoras biomecánicas.\n\n¡Si existe la más mínima posibilidad de que lo ayuden, tenemos que intentarlo! Algunos mecagnomos envían suministros a la isla desde un muelle en Punta Garfio. Nadie notará una pieza más de cargamento. Necesitamos redirigir uno de sus telecópteros.\n\n¿Me ayudarías a llevar la cápsula de Mekkatorque a Mecalópolis?', '', '', '', '', '', 'Habla con el príncipe Erazmin en la Isla de Mecalópolis.', 33528),
(57486, 'esMX', 'Energía menguante', 'Reúnete con Kelsey Chispacero en Fortaleza Valiente.', 'La cápsula de Mekkatorque se está quedando sin energía. \n\nYa no podemos oírlo hablar. \n\nSu pulso es más lento, a pesar de los esfuerzos de los sanadores kultiranos.\n\nTengo una idea, pero necesitaré tu ayuda.\n\nReúnete conmigo en la Fortaleza Valiente. Debemos actuar rápido.', '', '', '', '', '', '', 33528),
(57484, 'esMX', 'Ritual del despertar', '', '', '', '', '', '', '', '', 33528),
(57476, 'esMX', 'Campos de alimentación vil\'thik', '', '', '', '', '', '', '', '', 33528),
(57464, 'esMX', 'Mantén el enfoque', 'Obtén $1oa retazos de demencia. Puedes conseguirlos de los jefes del mundo y de Ny\'alotha, ganando campos de batallas y arenas, o por muertes con honor.', 'De momento, el enfoque solo contiene una fracción del verdadero poder de N\'Zoth. Si lo potenciamos, podríamos fabricar armas más efectivas en su contra.\n\nLa influencia de N\'Zoth está por todas partes, $n, y es más intensa en los enemigos más poderosos. Derrótalos y captura los vestigios que queden del poder del dios antiguo.', '', '', '', '', '', '', 33528),
(57462, 'esMX', 'Atrapasueños', 'Obtén $1oa retazos de demencia. Puedes obtenerlos de los jefes del mundo y de Ny\'alotha, si ganas campos de batallas o arenas, o de muertes con honor.', 'Parece que el enfoque sigue estable, y su campo de contención permanece intacto. Me atrevería a decir que podemos potenciarlo aún más.\n\nBusca y derrota enemigos formidables para obtener más restos de la influencia de N\'Zoth. Esta vez, infundiremos el enfoque con cantidades aún mayores del poder del dios antiguo. Estoy seguro de que el campo de contención resistirá.', '', '', '', '', '', '', 33528),
(57453, 'esMX', 'Clamador del enjambre', '', '', '', '', '', '', '', '', 33528),
(57449, 'esMX', 'Ejecutor de N\'Zoth', '', '', '', '', '', '', '', '', 33528),
(57448, 'esMX', 'Nuevos aliados entre nosotros', 'Mira cómo Baine le da la bienvenida a la Horda a los vulperas.', 'Los problemas de la Horda no cesan, ni siquiera en tiempos de paz. \n\nAunque pueden resultar abrumadoras, nuestras luchas no deben impedir que recordemos lo que significa ser parte de la Horda. \n\nNosotros no rechazamos a las personas cuando corren tiempos difíciles, sino que nos unimos y resistimos. \n\nLo olvidé por un momento. El peso de los problemas que sofocan a nuestros nuevos aliados me llevó a rechazar a los vulperas sin pensarlo. \n\nMi única esperanza es que aún consideren que unirse a la Horda tiene tanto valor como el que yo considero que ellos pueden aportarle.', '', '', '', '', '', '', 33528),
(57445, 'esMX', 'Carrito de fideos de Chin', '', '', '', '', '', '', '', '', 33528),
(57429, 'esMX', 'Pira del amalgamado', '', '', '', '', '', '', '', '', 33528),
(57404, 'esMX', 'Colmena devastadora', '', '', '', '', '', '', '', '', 33528),
(57403, 'esMX', 'Reconstrucción: \"Miedo y carne\"', 'Consigue páginas arrancadas de \"Miedo y carne\" en un área corrupta o perdida de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'Quizás lo más perverso de los susurros de los dioses antiguos es que ocultan un pequeño dejo de verdad. Es cierto que sentir el calor del sol en la piel, y cómo el viento te mueve el pelo, es un verdadero placer.\n\nPero has sobrevivido a las visiones de N\'Zoth. Has visto el destino final al que te conducen estos designios. La maldición de la carne no tiene nada que ver con provocarnos felicidad.\n\nContinúa recogiendo las páginas de este libro. Ya casi hemos terminado de reconstruirlo.', '', '', '', '', '', '', 33528),
(57402, 'esMX', 'Reconstrucción: \"Maldición de piedra\"', 'Consigue páginas arrancadas de \"Maldición de piedra\" en las visiones horribles de Wrathion dentro de la Cámara del Corazón.', 'N\'Zoth es, por sobre todo, sutil e insidioso. Ya entiendo cómo cualquier mente impresionable podría volverse contra los titanes leyendo estas palabras. Afortunadamente, no somos tan susceptibles a esas manipulaciones, ¿verdad?\n\nEl libro está casi completo. Sigue recuperando sus páginas en las visiones.', '', '', '', '', '', '', 33528),
(57399, 'esMX', 'Reconstrucción: \"La última verdad\"', 'Recupera páginas arrancadas de \"La última verdad\" en las áreas perdidas de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'He oído de este libro. Es un tomo sagrado para quienes adoran a los dioses antiguos, y contiene los secretos más oscuros y los misterios más incomprensibles del Vacío. Solo los cultistas más devotos tienen derecho a leer sus páginas.\n\nIncluso incompleto, sostenerlo me da escalofríos. Debo tener cuidado de no leer demasiado de una sola sentada.\n\nDicho esto, tenemos que encontrar las páginas que faltan para continuar nuestra investigación. Recupéralas de los rincones más oscuros de las visiones de N\'Zoth.', '', '', '', '', '', '', 33528),
(57398, 'esMX', 'Pasos en la oscuridad', 'Recupera una copia de \"La última verdad\" en las áreas perdidas de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'El final se acerca. Los recovecos más oscuros de estas visiones están esperando.\n\nGracias a nuestros esfuerzos, cuentas con todo lo necesario para salir a buscar las más horrendas manifestaciones que estas visiones pueden ofrecer. Las respuestas definitivas aguardan un poco más allá. Nuestros preparativos para la incursión en Ny\'alotha están casi completos.', '', '', '', '', '', '', 33528),
(57397, 'esMX', 'Reconstrucción: \"Miedo y carne\"', 'Consigue páginas arrancadas de \"Miedo y carne\" en un área corrupta o perdida de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'Quizás lo más perverso de los susurros de los dioses antiguos es que ocultan un pequeño dejo de verdad. Es cierto que sentir el calor del sol en la piel, y cómo el viento te mueve el pelo, es un verdadero placer.\n\nPero has sobrevivido a las visiones de N\'Zoth. Has visto el destino final al que te conducen estos designios. La maldición de la carne no tiene nada que ver con provocarnos felicidad.\n\nContinúa recogiendo las páginas de este libro. Ya casi hemos terminado de reconstruirlo.', '', '', '', '', '', '', 33528),
(57396, 'esMX', 'Reconstrucción: \"Miedo y carne\"', 'Consigue páginas arrancadas de \"Miedo y carne\" en un área corrupta o perdida de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'Los seguidores de los dioses antiguos sostienen que la carne es un don, no una maldición. Este tomo habla sobre la supuesta benevolencia de los dioses antiguos de otorgarnos esta generosa bendición.\n\nNaturalmente, omite cualquier mención de lo que ocurre cuando su corrupción se propaga descontroladamente.\n\nReúne más páginas para mí. Por más disparatadas que parezcan estas palabras, estudiarlas nos permitirá aumentar la eficacia de la capa.', '', '', '', '', '', '', 33528),
(57395, 'esMX', 'Reconstrucción: \"Miedo y carne\"', 'Consigue páginas arrancadas de \"Miedo y carne\" en un área corrupta o perdida de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'Los seguidores de los dioses antiguos sostienen que la carne es un don, no una maldición. Este tomo habla sobre la supuesta benevolencia de los dioses antiguos de otorgarnos esta generosa bendición.\n\nNaturalmente, omite cualquier mención de lo que ocurre cuando su corrupción se propaga descontroladamente.\n\nReúne más páginas para mí. Por más disparatadas que parezcan estas palabras, estudiarlas nos permitirá aumentar la eficacia de la capa.', '', '', '', '', '', '', 33528),
(57394, 'esMX', 'Reconstrucción: \"Miedo y carne\"', 'Consigue páginas arrancadas de \"Miedo y carne\" en un área corrupta o perdida de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'Otro tomo escrito por alguien atrapado en la locura de N\'Zoth. Me da escalofríos pensar en las viles palabras que tendré que leer.\n\nPero para fortalecer la capa, será necesario aprender más sobre aquello que queremos que resista. Fíjate si puedes encontrar las páginas que faltan para completar este tomo y utilizar el conocimiento que alberga.', '', '', '', '', '', '', 33528),
(57393, 'esMX', 'A través de la oscuridad', 'Recupera una copia de \"Miedo y carne\" en las profundidades de una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'A esta altura ya te habrás dado cuenta de que la protección de tu capa se reduce cuanto más profundo te encuentras en una visión. \n\nPara aumentar tu resistencia a la influencia de N\'Zoth, tenemos que comprender más a fondo este nefasto poder.\n\nBusca conocimiento en las manifestaciones más profundas y encontraremos respuestas tarde o temprano.', '', '', '', '', '', '', 33528),
(57392, 'esMX', 'Reconstrucción: \"Maldición de piedra\"', 'Consigue páginas arrancadas de \"Maldición de piedra\" en las visiones horribles de Wrathion dentro de la Cámara del Corazón.', 'Hasta ahora, el contenido de este libro es perturbador, por así decirlo. Y sin embargo, he logrado obtener información invaluable sobre la naturaleza del poder de N\'Zoth, y he modificado la capa de acuerdo con estos nuevos datos.\n\nIgualmente, aún queda mucho por aprender. Continúa tu búsqueda de más páginas en tus incursiones en las visiones.', '', '', '', '', '', '', 33528),
(57391, 'esMX', 'Reconstrucción: \"Maldición de piedra\"', 'Consigue páginas arrancadas de \"Maldición de piedra\" en las visiones horribles de Wrathion dentro de la Cámara del Corazón.', 'En mi investigación de Ny\'alotha, me encontré con muchas referencias a este libro escrito por un cultista neófito que documenta las \"mentiras de los titanes\" y las \"injusticias\" a las que sometieron a los habitantes de Azeroth.\n\nPuros delirios diseñados para corromper la visión de la realidad del lector.\n\nAun así, analizando esta obra, podemos comprender más a fondo el poder del dios antiguo, y de esta forma, modificar la capa para que ofrezca una mayor protección contra este poder.\n\nTrae todas las páginas del tomo que encuentres.', '', '', '', '', '', '', 33528),
(57384, 'esMX', 'Monstruosidad sanadora', '', '', '', '', '', '', '', '', 33528),
(57379, 'esMX', 'Estatua de jade infestada', '', '', '', '', '', '', '', '', 33528),
(57378, 'esMX', 'Restos de un mundo destrozado', 'Recupera una copia de \"Maldición de piedra\" en una visión horrible de Wrathion dentro de la Cámara del Corazón.', 'El conocimiento adquirido en estas visiones nos da una oportunidad única para resguardar nuestra mente de la corrupción. Para seguir investigando, tenemos que indagar en los misterios más profundos de estas experiencias.\n\nBusca a los más poderosos dentro de las visiones. Si te cruzas con algo de interés, no dudes en compartir tus hallazgos.\n\nMientras tanto, MADRE y yo seguiremos nuestra investigación en la cámara. \n\nAguardamos tu regreso, $n.', '', '', '', '', '', '', 33528),
(57376, 'esMX', 'La necesidad oculta', 'Reúnete con Lilian Voss en Claros de Tirisfal.', 'Por culpa de Sylvanas, algunos miembros de la Horda desconfían de los Renegados. Debemos recuperar su confianza. \n\nY no podemos hacerlo sin aceptar quiénes somos. Muchos se sienten perdidos, solos... abandonados.\n\nHe organizado una reunión. Podría ser un gran paso... o podría resultar en un desastre. De cualquier forma, deberías estar presente.\n\nReúnete conmigo en los Claros de Tirisfal, en los Dominios de Calston.', '', '', '', '', '', '', 33528),
(57375, 'esMX', 'Túmulo pulsante', '', '', '', '', '', '', '', '', 33528),
(57374, 'esMX', 'Hacia Las Profundidades Más Oscuras', 'Entra a una Visión horrible para descubrir qué manifestaciones oscuras acechan en un mundo gobernado por N\'Zoth.', 'Ahora que hemos asegurado la conexión, es hora de que rompamos el velo y descubramos lo que nos espera del otro lado.\n\nPuede que lo que descubras nos proporcione la clave de nuestro éxito.', '', '', '', '', '', '', 33528),
(57373, 'esMX', 'Descenso hacia la locura', 'Busca una Visión de N\'Zoth en medio de la corrupción en Valle de la Flor Eterna o Uldum para descubrir el futuro que le espera a Azeroth.', 'Por más desafortunada que parezca la propagación de la corrupción, creo que nos da una oportunidad para prepararnos para lo que nos espera.\n\nUbica una de estas incursiones y averigua lo que sucede cuando observas más allá del velo oscuro.', '', '', '', '', '', '', 33528),
(57372, 'esMX', 'La Calle Mayor', '', '', '', '', '', '', '', '', 33528),
(57371, 'esMX', 'Asalto: Aqir desenterrado', '', '', '', '', '', '', '', '', 33528),
(57370, 'esMX', 'Asalto: El Imperio Negro', '', '', '', '', '', '', '', '', 33528),
(57362, 'esMX', 'En lo profundo de la oscuridad', 'Habla con MADRE para regresar a las Cámaras de los Orígenes en Uldum y descubrir el origen que se esconde detrás de la anomalía.', 'Este giro reciente en los acontecimientos nos permite continuar nuestro viaje para descubrir la oscuridad que aguarda detrás de las arenas.\n\nNo será fácil, $n. Estamos al filo de lo desconocido, pero ahora la situación ha cambiado.\n\n<Wrathion observa tu nuevo atuendo.>\n\nVeo que estás $Gvestido:vestida; para la ocasión. \n\nVeamos qué conocimientos obtienes con tu regreso a las Cámaras de los Orígenes.', '', '', '', '', '', '', 33528),
(57359, 'esMX', 'Ritual de invocación', '', '', '', '', '', '', '', '', 33528),
(57339, 'esMX', 'Ritual de construcción', '', '', '', '', '', '', '', '', 33528),
(57324, 'esMX', 'Sigue a la marea', 'Reúnete con Calia Menethil y Derek Valiente.', 'Hola, $p.\n\nHe recibido un mensaje de Calia que me pide que vuelva a reunirme con ella. \n\nTiene mucho para ofrecer a todos los que se sienten perdidos y buscan un camino mejor. Una vez que se libere de todas sus dudas, sabrá lo que hay que hacer.\n\n¿Me acompañarás?', '', '', '', '', '', '', 33528),
(57323, 'esMX', 'Vinculación del dragón', '', '', '', '', '', '', '', '', 33528),
(57299, 'esMX', 'Sarcófago misterioso', '', '', '', '', '', '', '', '', 33528),
(57290, 'esMX', 'Comienzo del descenso', 'Recupera la escama de dragón negro corrupta de Descenso de Alanegra en la cima de Montaña Roca Negra en Las Estepas Ardientes.', 'Proteger la mente contra los dioses antiguos requiere un objeto de corrupción pura. Muchos lo desconocen, pero existe un objeto... aletargado debajo de los pozos de lava de Descenso de Alanegra.\n\nHasta hace poco tiempo, uno de mis agentes vigiló el área de cerca y conservó un registro detallado de toda actividad sospechosa. Por desgracia, las comunicaciones de ese agente han cesado. Está claro que no somos los únicos con este conocimiento.\n\nSi queremos encontrar respuestas, hay un lugar en el que debemos buscar.\n\nNuestro viaje continúa, $n. Roca Negra nos espera.', '', '', '', '', '', 'Regresa con Wrathion en la Cámara del Corazón.', 33528),
(57282, 'esMX', 'Barrio de los Magos', '', '', '', '', '', '', '', '', 33528),
(57276, 'esMX', 'Mantén el enfoque', 'Obtén $1oa retazos de demencia. Puedes obtenerlos de los jefes del mundo y de Ny\'alotha, si ganas campos de batallas o arenas, o de muertes con honor.', 'De momento, el enfoque solo contiene una fracción del verdadero poder de N\'Zoth. Si lo potenciamos, podríamos fabricar armas más efectivas en su contra.\n\nLa influencia de N\'Zoth está por todas partes, $n, y es más intensa en los enemigos más poderosos. Derrótalos y captura los vestigios que queden del poder del dios antiguo.', '', '', '', '', '', '', 33528),
(57275, 'esMX', 'Algo en tu mente', 'Llévale el Enfoque del Vacío a Wrathion en la Cámara del Corazón.', '<Al mirar el cristal, la luz que te rodea se torna lentamente en un humo oscuro. Te abruma una presencia imponente que te susurra unas palabras incomprensibles al oído. Buscas la fuente, pero no ves nada, y la sensación se vuelve más fuerte. Tu cabeza empieza a nadar a medida que la oscuridad se vuelve más profunda y el ruido, ensordecedor.\n\nInvocas toda tu voluntad para afianzar tu determinación...\n\nLa luz ha regresado, al ruido lo reemplazó el silencio, y te encuentras $gparado:parada; con un simple cristal en la mano.\n\nTal vez Wrathion tenga más información...>', '', '', '', '', '', '', 33528),
(57272, 'esMX', 'Efigie lazosangriento', '', '', '', '', '', '', '', '', 33528),
(57271, 'esMX', 'Distrito de Mercaderes', '', '', '', '', '', '', '', '', 33528),
(57256, 'esMX', 'Arena de la tormenta', '', '', '', '', '', '', '', '', 33528),
(57243, 'esMX', 'Campamento de esclavos amathet', '', '', '', '', '', '', '', '', 33528),
(57235, 'esMX', 'Recolector solar', '', '', '', '', '', '', '', '', 33528),
(57234, 'esMX', 'Recolector solar', '', '', '', '', '', '', '', '', 33528),
(57223, 'esMX', 'Protector desenterrado', '', '', '', '', '', '', '', '', 33528),
(57222, 'esMX', 'Investigación de Cámaras', 'Investiga la anomalía en las Cámaras de los Orígenes.', 'Lo que sea que esté pasando debe provenir de las profundidades de la cámara interna. Si logramos llegar a la forja, quizás encontremos algunas respuestas.\n\nDeberías revisar tu equipo antes de partir, $n. Quién sabe lo que nos espera allí.', '', '', '', '', '', '', 33528),
(57221, 'esMX', 'Reoriginación', 'Encuéntrate con Magni Barbabronce afuera de las Cámaras de los Orígenes en Uldum.', 'Si los Ramkahen no acudieron a pedir ayuda, entonces la anomalía debe estar contenida en las Cámaras de los Orígenes.\n\nMejor ponernos a investigar otra vez, $n.', '', '', '', '', '', '', 33528),
(57220, 'esMX', 'Inicio del protocolo de potencia', 'Transmite energía de la Cámara del Corazón, el Motor de Nalak\'sha y la Forja de los Orígenes a los sistemas auxiliares, y luego habla con MADRE para encender la Forja de los Orígenes.', 'Ha sido un arduo camino, $n.\n\nUna vez que los sistemas auxiliares vuelvan a estar encendidos y en línea, MADRE podrá ejecutar diagnósticos.\n\nTodo lo que queda es terminar de poner las últimas piezas en su lugar.', '', '', '', '', '', '', 33528),
(57219, 'esMX', 'Protector desenterrado', '', '', '', '', '', '', '', '', 33528),
(57218, 'esMX', 'Protector desenterrado', '', '', '', '', '', '', '', '', 33528),
(57216, 'esMX', 'Casco Antiguo', '', '', '', '', '', '', '', '', 33528),
