(57171, 'esMX', 'Guardián ramadorada', '', '', '', '', '', '', '', '', 33528),
(57158, 'esMX', 'Poderío eléctrico', '', '', '', '', '', '', '', '', 33528),
(57157, 'esMX', 'Asalto: El Imperio Negro', 'Repele el asalto de N\'Zoth en Uldum.', 'Es tal como lo anunciaron las visiones. Las fuerzas oscuras han venido a conquistar la Forja de los Orígenes.\n\nDebemos detenerlos, ¡o todo Azeroth conocerá su fin!', 'Regresa con el sumo sacerdote Amet en Ramkahen.', '', '', '', '', 'Regresa con el sumo sacerdote Amet en Ramkahen.', 33528),
(57153, 'esMX', 'Distrito de los Enanos', '', '', '', '', '', '', '', '', 33528),
(57146, 'esMX', 'Desgarro de corrupción', '', '', '', '', '', '', '', '', 33528),
(57129, 'esMX', 'Valle de la Sabiduría', '', '', '', '', '', '', '', '', 33528),
(57101, 'esMX', 'Jaula de dragón volador zan-tien', '', '', '', '', '', '', '', '', 33528),
(57089, 'esMX', 'Criadero vil\'thik', '', '', '', '', '', '', '', '', 33528),
(57087, 'esMX', 'Desintegrador baruk', '', '', '', '', '', '', '', '', 33528),
(57085, 'esMX', 'Carro de guerra potenciado', '', '', '', '', '', '', '', '', 33528),
(57080, 'esMX', 'Una recompensa apropiada', '', 'Aunque el núcleo de poder de la armadura de personal X-52 se haya destruido durante la batalla contra Gallywix, ¡el invento fue todo un éxito!\n\nDudo que alguien quiera comprar la X-52 sin un núcleo de poder funcional, así que, ¿por qué no te quedas tú con la armadura? ¡Se ve bastante elegante, al fin y al cabo!\n\nAhora que Chatarrópolis está a salvo y que Gallywix quedó convenientemente atrapado en su propia aporreadora mecánica, creo que voy a renegociar ese \"contrato\" suyo.\n\nAl fin y al cabo, ¡no tiene tanto espacio de maniobra!', '', '', '', '', '', '', 33528),
(57079, 'esMX', '¡Gánale y que coma Chatarrópolis!', 'Completa la gesta de Chatarrópolis.', '¡Me alegra tanto verte! Tenemos un problema...\n\nMientras estabas entregando las invitaciones, ¡Gallywix y sus matones se apoderaron de Chatarrópolis! ¡Secuestraron a Hobart Martillazos y no lo dejarán ir hasta que les entregue la armadura de personal X-52!\n\n¡Debes detener a Gallywix antes de que sea demasiado tarde!', '', '', '', '', '', 'Habla con Hobart Martillazos.', 33528),
(57078, 'esMX', 'La lista VIP', 'Entrega las invitaciones para la subasta privada de Martillazos.', 'Mientras ayudabas a Martillazos con su último invento, ¡yo estuve trabajando arduamente para encontrar posibles compradores!\n\nSerá una subasta privada, así que solo invitaremos a los más talentosos y a los más brillantes, a lo mejor de lo mejor, a la creme de la creme... ¿entiendes?\n\nHe acotado la lista de posibles compradores de manera que solo quedaron los goblins más ricos, de más clase y con los mejores contactos... salvo Gallywix, ¡por supuesto!\n\n¡Ve y entrega estas invitaciones mientras termino de preparar todo para la subasta!', '', '', '', '', '', '', 33528),
(57077, 'esMX', '¡Se buscan compradores!', 'Habla con Sassy Malallave en Vega de Tuercespina.', 'Por fin, la armadura de personal X-52 está lista, ¡y Gallywix se tuvo que ir con la cola entre las patas!\n\n¡Eres tú a quien debo agradecerle, $n!\n\nPero aún no hemos terminado... falta la mejor parte. Haremos una subasta ¡y le venderemos la armadura de personal X-52 al mejor postor!\n\nSassy Malallave ya debe haber terminado la lista de compradores interesados. ¡Dirígete a Escondrijo Malallave y dile que ya estamos listos para la subasta!', '', '', '', '', '', '', 33528),
(57076, 'esMX', 'Regreso a Bruma Otoñal', 'Vuelve a hablar con el Hablatormentas Qian en El Santuario Silente, en el Valle de la Flor Eterna.', 'Hemos hecho todo lo que podíamos hacer aquí. Sabemos el tipo de amenaza que representan los mogu.\n\nSi perdemos el control del Valle, peligramos perder también el control de la forja y que caiga en sus manos.\n\nRegresemos a Bruma Otoñal y reportémonos ante los Rajani. Querrán saber a qué nos enfrentamos.', '', '', '', '', '', 'Vuelve a hablar con el Hablatormentas Qian en El Santuario Silente, en el Valle de la Flor Eterna.', 33528),
(57075, 'esMX', 'Valentía líquida', 'Monta a Mobi y derrota a los ejércitos mogu con el poder de la cerveza.', 'Debemos hacer algo para ocuparnos de todos estos mogu. ¡Por lo menos para reducir sus números antes de que invadan el Valle!\n\nA pesar de que el tío Chen sea tan fanático de su cerveza, creo que podemos darle un mejor uso. ¡Volvamos a subirnos a ese yak y démosles a los mogu un motivo para temernos!', '', '', '', '', '', '', 33528),
(57074, 'esMX', 'Entre la espada y la puerta', 'Monta a Mobi con Chen y Li Li para dirigirse a la Puerta de los Augustos Celestiales.', 'Es una fortuna que hayas encontrado este brebaje ¡y un yak que lo lleve!\n\nPero no nos podemos quedar aquí. Li Li me sanó lo suficiente para viajar. Podemos montar el yak hacia la puerta y esperar que los mogu no nos vean.\n\nAvísame cuando estés $glisto:lista; para partir.', '', '', '', '', '', '', 33528),
(57072, 'esMX', 'Yak multifunción', 'Encuentra algo que te ayude a llevarle la cerveza a Chen en Mogujia.', '<Los barriles de cerveza son demasiado pesados y numerosos para que los cargues sin ayuda.\n\nQuizá puedas encontrar algo o a alguien que te ayude.>', '', '', '', '', '', '', 33528),
(57071, 'esMX', 'Ninguna cerveza queda atrás', 'Encuentra los barriles de cerveza abandonados en Cima Kun-Lai.', 'Mi cabeza... me duele. Solo hay una solución.\n\nMientras volábamos, pasamos sobre una caravana de brebaje abandonado. ¡Debes encontrarla y salvar ese brebaje! Eso me ayudará a recuperar mis fuerzas.\n\nAdemás, ayudará a levantar la moral de quienes luchen en el Valle, si lo recuperamos.', '', '', '', '', '', 'Encuentra los barriles de brebaje abandonado en Cima Kun-Lai.', 33528),
(57070, 'esMX', 'Masacre mogu', 'Mata mogu en Cima Kun-Lai.', 'Creo que esto es lo que mis amigos llamarían \"un campo lleno de blancos\". Es un eufemismo de \"estamos rodeados y probablemente condenados\".\n\nSabes lo que significa. ¡Debemos matar a la mayor cantidad de mogu posible! No importa cómo lo hagas, ¡derríbalos!', '', '', '', '', '', '', 33528),
(57069, 'esMX', 'Córtales la cabeza', 'Mata a comandantes mogu.', 'Bueno. Estamos varados en medio de tres ejércitos mogu, y el tío Chen aún está demasiado herido para moverse.\n\nIgual, la esperanza no está perdida. Tenemos la oportunidad de derribar a los líderes de estos ejércitos. ¡Quizá eso los detenga o los distraiga el tiempo suficiente para que alcancemos la puerta!\n\nFíjate si puedes vencer al mogu más malo y grande que encuentres. Esos son los comandantes.', '', '', '', '', '', '', 33528),
(57068, 'esMX', 'Espionaje en cometa', 'Monta la cometa de Chen para analizar los ejércitos mogu.', 'Sabíamos que los mogu estaban al ataque, ¡pero no tenía ni idea de que serían tantos!\n\nDebe haber alguna manera de detenerlos antes de que se apoderen por completo del valle. Rápido, vamos a sobrevolar la zona para determinar cuántos son.\n\nJusto tenemos una cometa que puede transportar tres personas. Por lo general, transporta a más personas, pero tuve un almuerzo abundante.', '', '', '', '', '', '', 33528),
(57067, 'esMX', 'Mogu en las puertas', 'Reúnete con Chen y Li Li Cerveza de trueno en la Puerta de los Augustos Celestiales.', 'Ha llegado la hora. Los otros clanes de los mogu tienen la mirada puesta en el Valle de la Flor Eterna.\n\nNo lo conquistarán.\n\nAlgunos de los de tu especie ya han ido a la puerta para determinar el tamaño de su ejército. Si te crees $gdigno:digna; de una misión semejante, encuéntralos allí.', '', '', '', '', '', 'Reúnete con Chen y Li Li Cerveza de trueno en la Puerta de los Augustos Celestiales.', 33528),
(57059, 'esMX', '¡A pelear!', 'Derrota a $1oa ladronzuelos contratados.', '¡Esto es malo, $n! ¡Muy malo!\n\nGallywix y sus matones están destruyendo mi taller, ¡pero no sabe lo que le espera si cree que entregaré la armadura de personal X-52!\n\nDebes dirigirte allí y eliminar a su escuadrón de matones antes de que las llamas consuman el lugar Y TODOS MIS INVENTOS.', '', '', '', '', '', '', 33528),
(57058, 'esMX', 'Diversión explosiva', 'Recupera el brebaje de coco refrescante del campo minado.', '¡El prototipo de la armadura de personal X-52 está listo para la prueba final! \n\n¿Cómo te llevas con los ruidos fuertes y las explosiones repentinas de energía arrolladora, $n?\n\nPara la última prueba, ¡te pondrás la armadura de personal X-52 y atravesarás un campo minado!\n\nHe colocado un brebaje de coco refrescante en el medio del campo minado. ¡Considera la bebida una recompensa adecuada por llegar al oasis y sobrevivir las explosiones inevitables en el camino!', '', '', '', '', '', '', 33528),
(57053, 'esMX', 'Prueba de fuerza bruta', 'Completa el experimento de Hobart Martillazos.', 'Ahora que tenemos los enchufes térmicos, ¡estamos listos para la próxima prueba del prototipo de la armadura de personal X-52!\n\nLamentablemente, todos mis asistentes de laboratorio han renunciado o han expirado. ¡Una pena! Pero su pérdida es tu triunfo, $n... ¡ahora TÚ tendrás la oportunidad de usar la armadura de personal X-52!\n\n¡Qué emocionante!\n\nLa próxima prueba la hará mi $gnuevo:nueva; asistente de laboratorio $gmecanizado:mecanizada;. Dirígete al taller principal y presiona el botón rojo y grande para comenzar.\n\nNo te preocupes, ¡te daré instrucciones a través del intercomunicador integrado de la X-52!', '', '', '', '', '', '', 33528),
(57052, 'esMX', 'Tengo lo que necesitas', 'Entrégale el paquete a Hobart Martillazos.', 'Un trato es un trato, $n. ¡Aquí están los enchufes térmicos que pediste!\n\nNo te olvides de avisarle al gruñón de Martillazos que ya no haré más caridad. Si necesita más enchufes térmicos, mejor que esté dispuesto a pagar.\n\nEn fin, ha sido un placer hacer negocios contigo...\n\nAhora, ¡lárgate!', '', '', '', '', '', '', 33528),
(57051, 'esMX', '¡Cobro de deudas!', 'Consigue $1oa deudas impagas.', '¿Necesitas enchufes térmicos? Bien, viniste al lugar indicado, joven.\n\nPero no te los daré a crédito. Tengo una lista interminable de orates que nunca me pagaron lo que me deben. Estoy hasta la coronilla. Si no me pagan pronto, mi negocio quebrará sin más.\n\n<Crank Grasamecha piensa un momento.>\n\nOye, te diré lo que haremos... Si logras obligar a esos matones inútiles a que me paguen lo que me deben, te daré los enchufes térmicos.\n\n¡No encontrarás mejor oferta que esa!', '', '', '', '', '', '', 33528),
(57049, 'esMX', 'Cámara de almas', '', '', '', '', '', '', '', '', 33528),
(57048, 'esMX', 'A comprar partes', 'Habla con Crank Grasamecha.', 'Necesitaré algunos componentes adicionales para completar la próxima etapa de pruebas.\n\nEn este momento, necesitamos enchufes térmicos y sus adaptadores. Explicaré para qué son luego...\n\nCrank Grasamecha tiene una tienda cerca de la entrada del pueblo. Ve a hablar con Crank y convéncelo de darnos las partes que nos faltan.\n\nNo me importa cuánto cuesten, ¡dile que le pagaré más tarde! No puedo perder el tiempo negociando ahora mismo. ¡Debo preparar las modificaciones para la armadura de personal X-52!', '', '', '', '', '', '', 33528),
(57047, 'esMX', 'Un experimento simple', 'Ayuda a Hobart Martillazos.', 'Ahora que has entregado las partes que me faltaban, puedo empezar las pruebas de mi más reciente prototipo.\n\n¡La llamo armadura de personal X-52! ¡Será casi indestructible!\n\nGallywix siempre codició mis inventos y ahora que sabe de la X-52 estoy seguro de que tramará algo. ¡Debo completar el prototipo antes de que a Gallywix se le ocurra una forma de robármelo!\n\nMe vendría bien otro par de manos que me ayude con los experimentos.\n\n¿Puedo contar contigo, $n?', '', '', '', '', '', '', 33528),
(57045, 'esMX', 'Una entrega especial', 'Entrégale el paquete a Hobart Martillazos.', 'Me alegra que por fin hayas llegado, $n. Debo hacer una entrega muy importante y tú eres $gel:la; goblin en quien que más confío.\n\nSí, sí. Sé que eso no significa mucho, ¡pero es difícil encontrar ayuda confiable últimamente!\n\nEste paquete es para Hobart Martillazos. Tiene un taller en Chatarrópolis y necesito que se lo entregues. ¡Ha estado trabajando en algo importante últimamente!\n\nEntrégale el paquete y, por el amor del dinero, ¡QUE NO SE TE CAIGA!\n\n¡No te das idea de cuánto tiempo me llevó encontrar esta cosa!', '', '', '', '', '', '', 33528),
(57043, 'esMX', 'Viejos amigos, nuevas oportunidades', 'Habla con Sassy Malallave en Vega de Tuercespina.', 'Mira nada más, ¡si es $n! ¡Eres exactamente $gel goblin:la goblin; que estábamos buscando!\n\nHa pasado mucho tiempo desde Kezan, ¿no es cierto? ¡La hemos pasado muy bien navegando $gjuntos:juntas; en aquel entonces!\n\nNo quiero ponerme sentimental contigo, ¡pero Sassy Malallave me pidió que te encontrara! ¡Está reuniendo a la pandilla para un trabajo importante! ¡MUY IMPORTANTE!\n\nMe encantaría tener más tiempo para ponernos al día, pero debemos partir. El tiempo vale oro, ¿sabes?\n\nSi te interesa el trabajo, busca a Sassy. ¡Ella te dará los detalles!', '', '', '', '', '', '', 33528),
(57039, 'esMX', 'Valle de los Espíritus', '', '', '', '', '', '', '', '', 33528),
(57023, 'esMX', 'Artefacto mogu pesado', '', '', '', '', '', '', '', '', 33528),
(57022, 'esMX', 'Asalto: el avance de los Amathet', '', '', '', '', '', '', '', '', 33528),
(57008, 'esMX', 'Asalto: Los clanes en guerra', 'Expulsa el asalto mogu en el Valle de la Flor Eterna.', 'Los clanes mogu oportunistas buscan conquistar el Valle mientras sus defensores se recuperan del ataque de N\'Zoth. \n\nSon unos cobardes y unos necios.\n\nMuéstrales lo equivocados que están.', 'Regresa con el Hablatormentas Qian en el Santuario Silente.', '', '', '', '', 'Regresa con el Hablatormentas Qian en el Santuario Silente.', 33528),
(57001, 'esMX', 'Valle del Honor', '', '', '', '', '', '', '', '', 33528),
(56906, 'esMX', 'Corona de buena fortuna', 'Recoge flores en Cuna del Invierno, Dun Morogh o Laderas de Trabalomas.', '¡Esas flores me recuerdan a la mismísima Elune! Visto unas flores similares durante todo el año, me recuerdan a su gracia, que vela por mí.\n\n¿Te gustaría tener unas flores iguales?\n\nTu corona está hecha de flores comunes que algún día se marchitarán y morirán. Es un destino muy cruel para esas bellezas tan delicadas, ¡pero mi corona está hecha de flores que encanté para que me duren todo el año! Si me traes ciertas flores específicas que solo florecen durante el Festival Lunar, podré bendecirlas para que tú también puedas disfrutar tu corona durante todo el año.', '', '', '', '', '', 'Regresa con Myrael Lunaflor en Claro de la Luna.', 33528),
(56905, 'esMX', 'Corona de flores oscuras', 'Recoge flores en Bosque del Ocaso, Bosque de Argénteos y Desolace.', 'Qué flores tan lúgubres… pero poseen una belleza única, ¿no crees? Si tan solo nunca se marchitaran.\n\nDéjame brindarte mi ayuda.\n\nCada Festival Lunar, crecen flores similares por todo el mundo. Tienen una conexión especial con Elune… una conexión que puedo potenciar. Si me las traes, puedo conservarlas para que las disfrutes por mucho más tiempo que una flor normal.', '', '', '', '', '', 'Regresa con Myrael Lunaflor en Claro de la Luna.', 33528),
(56904, 'esMX', 'Corona de prosperidad', 'Recoge flores del Cráter de Un\'Goro, Vega de Tuercespina y Los Baldíos del Norte.', '¡Qué corona tan colorida! Qué tonos más hermosos de rosa, amarillo y azul… ojalá nunca se marchitaran.\n\nAunque esas flores en particular no durarán para siempre, ¡conozco algunas que sí!\n\nExisten unas flores similares que florecen durante el Festival Lunar. Tienen una conexión especial con Elune que puedo potenciar, gracias a ti. ¡Consígueme un par y armemos una corona que podrás disfrutar en todo momento!', '', '', '', '', '', 'Regresa con Myrael Lunaflor en Claro de la Luna.', 33528),
(56903, 'esMX', 'Corona de coraje', 'Recoge flores del Bosque Canción Eterna, las Tierras del Interior y Mulgore.', 'Veo que tienes debilidad por las flores de color rosa. Es una lástima que las que forman tu corona deban perecer algún día.\n\nTal vez pueda ayudarte con eso.\n\nAunque son flores comunes, conozco otras similares que solo florecen durante el Festival Lunar. Si me las traes, podré infundirles el poder de Elune para que las disfrutes todo el año.', '', '', '', '', '', 'Regresa con Myrael Lunaflor en Claro de la Luna.', 33528),
(56889, 'esMX', 'Vagayermos heridos', 'Sana a $1oa obreros vagayermos.', 'Ahh, $gmi amigo:mi amiga;, ¿has regresado para brindarnos más ayuda?\n\nComo puedes ver, seguimos en plena batalla contra estas criaturas, y no parece que vaya a terminar pronto.\n\nEs una guerra de desgaste y estamos en desventaja, cada vez con más heridos.\n\nPor favor, asiste a todos los que puedas dentro de las ruinas.', '', '', '', '', '', '', 33528),
(56771, 'esMX', 'Guerreros perdidos en el tiempo', 'Encuéntrate con los Rajani en El Santuario Silente.', 'Según el informe de exploración que encontraste, los Rajani están refugiados en El Santuario Silente, con vista a la Aldea Bruma Otoñal.\n\nEn el informe los describen como solitarios y peligrosos, así que debemos tener cuidado cuando nos acerquemos.\n\nNos vemos allí.', '', '', '', '', '', '', 33528),
(56760, 'esMX', 'Requisas de Pernoxidado: Cuero de la tempestad', 'Lleva $1oa mena de plata de tormenta a Gina Cableado.', '', '', '', '', '', '', '', 33528),
(56759, 'esMX', 'Requisas de Pernoxidado: Cuero de la tempestad', 'Llévale $1oa mena de plata de tormenta a Skaggit.', '', '', '', '', '', '', '', 33528),
(56751, 'esMX', 'Requisas de Pernoxidado: Hueso calcificado', 'Lleva $1oa mena de plata de tormenta a Gina Cableado.', '', '', '', '', '', '', '', 33528),
(56750, 'esMX', 'Requisas de Pernoxidado: Hueso calcificado', 'Llévale $1oa mena de plata de tormenta a Skaggit.', '', '', '', '', '', '', '', 33528),
(56647, 'esMX', 'La amenaza mántide', 'Vuelve a reunirte con Hablatormentas Qian en El Santuario Silente.', 'Los mántides han estado corrompiendo sus árboles kypari para imbuir su ámbar con el poder de N\'Zoth. El enjambre ya representa una amenaza por sí solo. N\'Zoth podría hacerlo incluso más temible.\n\nLos Shadopan deben estar informados al respecto. Sugiero que compartas esta información con tus otros aliados también.', '', '', '', '', '', 'Vuelve a reunirte con Hablatormentas Qian en El Santuario Silente.', 33528),
(56645, 'esMX', 'Corazón del enjambre', 'Vuela con Taoshi sobre el cometa del Shadopan.', 'Debemos saber a qué nos enfrentamos. Antes de regresar a Espinazo del Dragón, debemos aprovechar la oportunidad de investigar sobre el enjambre.\n\nHaré que sobrevolemos el Corazón del miedo. Podremos examinar las fuerzas de la emperatriz Shek\'zara desde las alturas, y así determinar cuánto fortaleció N\'Zoth a sus filas con las suyas propias.', '', '', '', '', '', '', 33528),
(56617, 'esMX', 'Un enjambre unificado', 'Infíltrate en Klaxxi\'vess.', 'Parece que los mántides estuvieron produciendo el ámbar corrupto durante un tiempo antes de que... interviniéramos. Sería lógico que se hubieran guardado una cantidad determinada en algún lado.\n\nLos exploradores de los Shadopan han reportado un aumento de guerreros del enjambre en Klaxxi\'vess. Apuesto a que están protegiendo el ámbar corrupto.\n\nEncuéntrame allí. Si tenemos la oportunidad de destruir ese ámbar, debemos aprovecharla.', '', '', '', '', '', '', 33528),
(56616, 'esMX', 'Caras viejas, problemas nuevos', 'Mata a Vigía Vl\'thax.', 'Parece que uno de los esbirros de N\'Zoth se percató de nuestra presencia.\n\n¿Le hacemos una visita?', '', '', '', '', '', '', 33528),
(56580, 'esMX', 'Secretos de ámbar', 'Recoge $1oa trozos de ámbar corrupto.', 'La Cámara del Mañana alberga a un pequeño grupo de los zara\'thik, mántides que responden ante la nueva emperatriz. Puede que a algunos les hayan dado trozos de ámbar como el que has encontrado.\n\nA los Shadopan nos interesaría conseguir algunos trozos más.', '', '', '', '', '', '', 33528),
(56578, 'esMX', 'Corrupción desde las raíces', 'Detén la fuente de la corrupción dentro de la Cámara del Mañana.', 'Debajo de Kypari Kor hay una cámara grande en la que los mántides se ocupan del árbol. Ese debe ser el lugar donde está la fuente de la corrupción.\n\nDebemos adentrarnos en esa cámara y detenerlos. No podemos permitir que N\'Zoth le dé fuerzas al enjambre.', '', '', '', '', '', '', 33528),
(56577, 'esMX', 'Paralizando a la colmena', 'Mata a $1oa mántides Kor\'thik en Kor\'vess.', 'Aquí los mántides están trabajando frenéticamente para cosechar el ámbar del árbol.\n\nTal vez matar a un puñado de ellos los ralentice.', '', '', '', '', '', '', 33528),
(56576, 'esMX', 'Exterminación de aqir', 'Mata a $1oa empaladores aqir.', 'Hay demasiadas de estas cosas volando para que podamos escaparnos sin problemas. \n\n¡Nos expondremos a un ataque apenas encendamos los motores del avión!\n\nEstos insectos regresan directo al suelo… de una forma u otra. No tendría nada de malo acelerar el proceso, ¿me entiendes?', '', '', '', '', '', '', 33528),
(56575, 'esMX', 'Una vez más a Kor\'vess', 'Investiga Kor\'vess.', '¿Lo sacaste de un miembro del enjambre? Rebosa de corrupción... y de poder. Podríamos estar frente a una amenaza muy seria si el resto del ámbar de los mántides está igual de corrupto.\n\nLejos al oeste, en el Desierto del Pavor, está Kor\'vess, un árbol kypari grande que provee al enjambre la mayor parte de su ámbar. Allí podremos determinar cuánto de lo que tienen almacenado fue imbuido de la energía de los dioses antiguos.\n\nTe encontraré más cerca del árbol.', '', '', '', '', '', '', 33528),
(56574, 'esMX', 'Reflexiones en ámbar', 'Llévales el ámbar cubierto de baba a los Shadopan que están en Espinazo del Dragón.', '<Una baba viscosa y oscura cae a gotas de este gran trozo de ámbar. Es inútil intentar limpiarlo, porque parece que es el propio ámbar lo que produce la baba.\n\nCuando lo sostienes, susurros incomprensibles invaden tus pensamientos.\n\nLos Shadopan seguramente quieran examinarlo.>', '', '', '', '', '', 'Llévales el ámbar cubierto de baba a los Shadopan que están en Espinazo del Dragón.', 33528),
(56550, 'esMX', 'Limpieza de cadáveres', 'Quema $1oa cadáveres infestados con huevos.', 'Nuestros amigos no paran de caer ante esos terribles insectos que abandonan sus nidos para infestar nuestros campamentos.\n\nEs una tarea terrible, pero tenemos que ocuparnos de los cadáveres lo más rápido posible.\n\nNo podemos permitir que utilicen a nuestros caídos como fertilizante para hacer crecer sus asquerosos huevos.', '', '', '', '', '', '', 33528),
(56542, 'esMX', 'Esperanza renovada', 'Habla con Ra-den para regresar a la Cámara del Corazón.', 'Tu perseverancia me devuelve la esperanza para este mundo.\n\nVolvamos a tu \"Cámara del Corazón\". Como guardián de la Forja de los Orígenes, creo que puedo ayudarte a restaurarla.\n\nVen a hablarme cuando estés $glisto:lista; y guiaré el camino.', '', '', '', '', '', '', 33528),
(56541, 'esMX', 'El Motor de Nalak\'sha', 'Sigue el pasadizo secreto dentro de Palacio Mogu\'shan y vuelve a encender el Motor de Nalak\'sha.', 'Tu especie me ha demostrado que me equivocaba en el pasado, así que te daré la oportunidad de hacerlo otra vez.\n\nLa estructura titánica que contiene el Motor de Nalak\'sha abarca toda Pandaria. Hay más formas de llegar además de las Cámaras Mogu\'shan.\n\nHay muchas rutas, pero la más cercana sería a través del Palacio Mogu\'shan. Las bóvedas que están debajo del palacio están interconectadas con las cámaras. \n\nEncuentra tu destino allí, $gcampeón:campeona;.', '', '', '', '', '', '', 33528),
(56540, 'esMX', 'Prueba de tenacidad', 'Obtén un trofeo del conquistador del comandante de un Asalto en el Valle de la Flor Eterna.', 'Si el Alto guardián está tan convencido de que no tenemos oportunidad contra nuestros enemigos, tal vez una demostración de fuerza lo haga cambiar de opinión.\n\nNo sé cómo podrías hacerlo, pero si puedes traer pruebas de un triunfo contra quienes amenazan el Valle, puede que lo convenza de que hay que actuar al respecto.', '', '', '', '', '', '', 33528),
(56539, 'esMX', 'En busca de los Rajani', 'Consigue un informe de exploración mogu de los mogu que están en el Valle de la Flor Eterna.', 'Ahora que tenemos una idea de a quiénes estamos buscando, la próxima pregunta es: ¿dónde estarán?\n\nA raíz de las luchas internas constantes entre los mogu, es probable que todos los clanes llevaran un registro del paradero de sus competidores. Si logramos encontrar esa información, tal vez nos ayude a encontrar a los Rajani.\n\nBusca a los campeones de los mogu, que seguramente tengan informes sobre el paradero de sus enemigos.', '', '', '', '', '', '', 33528),
(56538, 'esMX', 'Clanes de los mogu', 'Ayuda al eremita Cho a descubrir el origen del sigilo misterioso de los mogu en el Trono del Saber.', '¿Dices que un mogu te pidió ayuda? Eso es muy extraño. \n\nSerá un placer ayudarte a descubrir el origen de este sigilo. Francamente, la idea de un clan mogu que no es abiertamente hostil me resulta muy interesante. ¡Piensa en las posibilidades!\n\nBueno, manos a la obra. Tendremos que consultar los volúmenes de los varios clanes mogu en el valle para empezar a descartar.', '', '', '', '', '', '', 33528),
(56537, 'esMX', 'El sigilo misterioso', 'Lleva el sigilo misterioso de los mogu al eremita Cho en el Trono del Saber, en el Valle de la Flor Eterna.', '<El mogu asesinado tiene un sigilo en la mano... un símbolo del clan misterioso al que pertenece.\n\nTal vez, si logras rastrear su clan, ellos sepan más sobre la invasión de los mántides de las Cámaras Mogu\'shan y sobre cómo vencerlos.\n\nEl eremita Cho es reconocido como una fuente de conocimiento en Pandaria. Tal vez pueda rastrear el origen del sigilo de los mogu.>', '', '', '', '', '', '', 33528),
(56536, 'esMX', 'Nada es fácil', 'Reúnete con Magni Barbabronce afuera de las Cámaras Mogu\'shan en Cima Kun-Lai.', 'A menos que algo haya cambiado, las Cámaras Mogu\'shan siguen abandonadas. \n\nNo debería resultarnos muy difícil llegar al motor, dado que ya derrotamos a los guardianes mogu que estaban allí.\n\nBueno, ¿qué estás esperando? ¡Vamos a encender ese motor!', '', '', '', '', '', '', 33528),
(56472, 'esMX', 'Acuerdo de Uldum', 'Obtén información en Ramkahen sobre las amenazas que afronta Uldum.', '¿Necesitas ayuda para defender la Forja de los Orígenes? Parece que nuestras metas son las mismas.\n\nLas Cámaras de los Orígenes son solo una parte del verdadero potencial de la forja. Cualquier amenaza contra Uldum es una potencial amenaza contra la forja, y Uldum se ha ganado muchos enemigos últimamente.\n\nEstábamos a punto de reunir al Alto Consejo cuando llegaron estos vagayermos sin aviso ni invitación. ¿Quizá puedas ayudarnos a conseguir más información sobre estas amenazas?', '', '', '', '', '', '', 33528),
(56402, 'esMX', 'Monedas de vagayermos', 'Recoge $1oa monedas de vagayermos', 'Quizá ya sea demasiado tarde para nuestros hermanos y hermanas caídos, pero no es tarde para consolar a sus familias.\n\nCada vagayermos lleva consigo una moneda única, insignia de su estatus como miembro de nuestro grupo.\n\nSi encuentras alguna de esas monedas, por favor, tráela y me encargaré de que regrese a la familia que le corresponde.', '', '', '', '', '', '', 33528),
(56377, 'esMX', 'La forja eterna', 'Vuelve a la Cámara del Corazón y reúnete con Magni Barbabronce para enterarte del destino de la Forja de los Orígenes.', 'Gracias por ayudarme en la forja. Es preocupante que N\'Zoth haya logrado infiltrarse tan rápidamente, ¡pero al menos llegamos a tiempo para impedir que la destruyera por completo!\n\nAhora deberemos hacer que vuelva a funcionar al cien por ciento. MADRE ha estado buscando la solución, y creemos que tenemos un plan.', '', '', '', '', '', '', 33528),
(56376, 'esMX', 'Amenazas incipientes', 'Completa un Asalto en Uldum.', 'Para los tol\'vir, la protección de las creaciones de los titanes aquí en Uldum es un deber sagrado. Sin embargo, cada vez somos menos y cada día afrontamos amenazas más grandes.\n\nIncluso con el poderoso apoyo de nuestros nuevos aliados, no podremos contener a estos enemigos por siempre. Si el poder de alguno de ellos aumenta de forma repentina, puede que nos sobrepasen, y la forja peligraría. Por eso necesitamos tu ayuda.\n\nHabla con el alto comandante Kamses para evaluar nuestra situación actual.', '', '', '', '', '', '', 33528),
(56375, 'esMX', 'A Ramkahen', 'Ve a ver al rey Phaoris en Ramkahen.', 'Parece que tendremos que esperar mientras MADRE decide qué hacer con la forja. Mientras tanto, debemos asegurarnos de que nadie intente hacer más daño aquí.\n\nDeberías ir a ver a los tol\'vir en Ramkahen. Sé que los has ayudado en el pasado, así que tal vez puedan ayudarnos a impedir que la forja caiga en las manos equivocadas.', '', '', '', '', '', '', 33528),
(56374, 'esMX', 'Un problema titánico', 'Encuéntrate con Magni Barbabronce en las Cámaras de los Orígenes en Uldum.', 'No hay tiempo que perder. \n\nSin la Forja de los Orígenes, Azeroth queda vulnerable ante la corrupción de N\'Zoth. ¡Por no mencionar que controla un arma capaz de aniquilar toda vida en Azeroth!\n\nDebemos dirigirnos hacia la forja de inmediato. MADRE puede cubrirnos aquí.\n\nApresúrate, te encontraré allí.', '', '', '', '', '', '', 33528),
(56308, 'esMX', 'Asalto: Aqir desenterrado', 'Repele el asalto aqir en Uldum.', 'Están arrasando nuestra posición. ¡Los aqir nos invaden en cantidades que nunca antes había visto!\n\nNo sé por cuánto tiempo más podremos resistir. ¡Necesitamos que los expulses!', 'Regresa con Arick Escorpunción en el Obelisco de la Luna.', '', '', '', '', 'Regresa con Arick Escorpunción en el Obelisco de la Luna.', 33528),
(56209, 'esMX', 'Cámaras de los Orígenes', 'Derrota a las fuerzas de los Amathet y reactiva la forja en las Cámaras de los Orígenes.', 'Parece que un grupo de tol\'vir que se hace llamar Amathet se ha apoderado de las Cámaras de los Orígenes. No sé mucho sobre ellos, más allá de que son nuevos y que no son muy amigables.\n\nDebemos entrar y volver a activar la forja, ¡o será el fin de Azeroth!', '', '', '', '', '', '', 33528),
