(56076, 'esMX', 'Ritual abisal', '', '', '', '', '', '', '', '', 33528),
(56075, 'esMX', 'Poder robado', 'Recoge $1oa pergaminos de los shirakess.', 'Estos nagas obtienen su energía del Vacío. \n\nCada pergamino que inscriben propaga el conocimiento... Ese conocimiento es poder.\n\nEs razonable que, si les quitamos su conocimiento, también les robaremos el poder.\n\nPuede que mi lógica no sea perfecta, ¡pero intentémoslo de todos modos!', '', '', '', '', '', '', 33528),
(56074, 'esMX', 'Conducto del Vacío', '', '', '', '', '', '', '', '', 33528),
(56064, 'esMX', 'Asalto: El Imperio Negro', 'Expulsa el asalto de N\'Zoth en el Valle de la Flor Eterna.', 'No puedo creer lo que veo. ¡El Imperio Negro se materializa aquí mismo en el Valle!\n\n¡Debemos actuar de inmediato!', 'Regresa con el eremita Cho en el Trono del Saber.', '', '', '', '', 'Regresa con el eremita Cho en el Trono del Saber.', 33528),
(56006, 'esMX', 'Cofre con candado rúnico', '', '', '', '', '', '', '', '', 33528),
(55670, 'esMX', 'Flota de saqueo amathet', '', '', '', '', '', '', '', '', 33528),
(55664, 'esMX', 'Un golpe a la moral', 'Interrumpe todas las actividades en el Repositorio Shirakess.', 'Este lugar es la fuente de toda nuestra corrupción. \n\nAquí destrozan a los aletinos secuestrados. \n\nDales duro para que aprendan. Acaba con su poder, mata todos los nagas que veas, ¡siembra el caos!\n\nCada golpe, por más pequeño que sea, los debilita.', '', '', '', '', '', '', 33528),
(55655, 'esMX', 'Misión de seguimiento', '', '', '', '', '', '', '', '', 33528),
(55640, 'esMX', 'Visión de Ventormenta', 'Completa la Visión de Ventormenta.', 'Debilita a N\'Zoth al adentrarte en su mente.', '', '', '', '', '', '', 33528),
(55614, 'esMX', 'Misión de seguimiento', '', '', '', '', '', '', '', '', 33528),
