(55350, 'esMX', 'Asalto: el avance de los Amathet', 'Repele el asalto amathet en Uldum.', 'Los Amathet buscan utilizar la Forja de los Orígenes para sus propios fines. ¡No debemos permitir que vuelva a caer en sus manos!\n\nNuestros hombres están defendiendo la entrada, pero no resistirán si los Amathet los atacan con todas sus fuerzas. \n\nHaz lo que puedas para repeler a sus fuerzas antes de que sea demasiado tarde.', 'Regresa con el alto comandante Kamses en Ramkahen.', '', '', '', '', 'Regresa con el alto comandante Kamses en Ramkahen.', 33528),
(54990, 'esMX', 'La nueva guardia', 'Reúnete con Tess Cringris en Castillo de Ventormenta.', 'Quiero hablar con mis padres de nuevo. Creo que mi padre y yo tenemos que discutir algunas cosas.\n\nVen a verme al Castillo de Ventormenta. Me gustaría agradecerte de una manera más formal.', '', '', '', '', '', '', 33528),
(54984, 'esMX', 'Lobo que ladra no muerde', 'Entra al portal del Sueño y guía a Tess.', 'Ahora la esencia de Tess deambula por una sección del Sueño Esmeralda que inserté en sus pensamientos. Le di mi don, pero igual le vendría bien $gun:una; guía.\n\nUsa el portal que está a mis espaldas para entrar al Sueño. Te llevará cerca de donde duerme. Fíjate si puedes hacerle ver que la ira puede cegar a un mortal.', '', '', '', '', '', '', 33528),
(54983, 'esMX', 'El despertar de un soñador', 'Defiende a Vassandra Garratormenta mientras invoca a Goldrinn.', 'Esto es todo lo que necesito para invocar al ancestral.\n\nPuede que algunos visitantes no deseados respondan al llamado primero. ¡Protégeme mientras realizo el ritual!', '', '', '', '', '', '', 33528),
(54982, 'esMX', 'El espíritu del cazador', 'Consigue los colmillos de los lobos colminiebla.', 'Puede que también necesite colmillos de lobo para completar este ritual.\n\nHay una manda que se asentó recientemente cerca de la Mansión Mantoniebla. Tráeme sus colmillos. Aguardaré tu regreso en la Arboleda del Crepúsculo.', '', '', '', '', '', 'Reúnete con Vassandra Garratormenta en la Arboleda del Crepúsculo.', 33528),
(54981, 'esMX', 'Un aullido a la luna', 'Consigue una flor de la Gracia de Elune.', 'Bosque del Ocaso tiene una conexión directa con el Sueño Esmeralda. Gracias a esta conexión, quizá pueda invocar al ancestral Goldrinn. Él podrá darle a la princesa una muestra de la maldición que tanto desea, a pesar del peligro que representa.\n\nUna flor extraña crece en la sección este del bosque. Recógela y ven a verme en la Arboleda del Crepúsculo. Me ayudará a llevar a cabo este ritual.', '', '', '', '', '', 'Reúnete con Vassandra Garratormenta en la Arboleda del Crepúsculo.', 33528),
(54980, 'esMX', 'Pena de los Penumbría', 'Subyuga a Irisangre y vuelve con ella a Cerro del Cuervo.', 'La princesa Cringris me ha informado sobre la situación y tengo una idea para ayudar.\n\nPero primero, un favor a cambio de otro. Los residentes de Bosque del Ocaso fueron asolados hace poco por una integrante particularmente feroz de la manada de los Penumbría a la que llaman \"Irisangre\". Toma el sedante del maestro Harris y tráeme a la huargen viva. Será el sujeto de prueba perfecto para encontrar la cura.', '', '', '', '', '', '', 33528),
(54977, 'esMX', 'En Bosque del Ocaso', 'Habla con Vassandra Garratormenta en Bosque del Ocaso.', 'En Teldrassil conocí a una elfa de la noche llamada Vassandra Garratormenta que quizá pueda enseñarle a Tess sin recurrir a medidas tan extremas. Ella es quien ayudó a nuestro pueblo con su aflicción al principio.\n\nAhora Vassandra está en Bosque del Ocaso, donde ayuda a los residentes del Cerro del Cuervo a tratar de curar a los huargen ferales de la zona. No hay nadie que conozca la maldición como ella.\n\nTe haré un pedido más bien personal: no dejes que mi hija haga nada impulsivo. Eso lo heredó de su padre.', '', '', '', '', '', '', 33528),
(54976, 'esMX', 'La sombra de Gilneas', 'Reúnete con Tess Cringris en el Castillo de Ventormenta.', '¡$gCampeón:Campeona; de Gilneas!\n\nTengo una carta para ti de parte de la princesa Tess Cringris. Solicita tu presencia en el Castillo de Ventormenta.', '', '', '', '', '', '', 33528),
