(54394, 'esMX', 'Donaciones de Costa Oscura: Lomos fibrosos', 'Recoge $1oa pociones de maná costero para Chelsea Hebra en el Puerto Boralus.', 'Nos robaron uno de nuestros últimos envíos de suministros alquímicos cuando lo transportábamos hacia el depósito. Estamos haciendo todo lo posible para remendar la situación, pero temo que no alcanzaremos nuestra cuota.\n\nPor casualidad, ¿sabes dónde puedo conseguir más pociones de maná?', '', '', '', '', '', '', 33528),
(54388, 'esMX', 'Donaciones de Costa Oscura: Escafandra de brilloescama', 'Consigue $1oa Encantar anillo: Sello de golpe crítico para Mae Varaoscilante en Puerto Boralus.', '', '', '', '', '', '', '', 33528),
(54386, 'esMX', 'Donaciones de Costa Oscura: Venda de las profundidades', 'Consigue $1oa F.R.I.T.O. para Norber Teclanaje en Puerto Boralus.', 'Nunca se sabe cuándo necesitarás un big bang en el campo de batalla, no sé si me entiendes. Por fortuna, ¡podemos prepararnos para lo inesperado!\n\nHemos comenzado a acumular explosivos especiales para esas situaciones en que necesitamos un poquito más para dejar claro nuestro mensaje. He agregado un artículo particular a la lista. \n\nSi tienes un poco de sobra, me aseguraré de que le den un buen uso.', '', '', '', '', '', '', 33528),
(54385, 'esMX', 'Donaciones de Costa Oscura: Venda de lino de pulverización marina', '', '', '', '', '', '', '', '', 33528),
(54383, 'esMX', 'Donaciones de Costa Oscura: Traje de buceo de brilloescama', 'Consigue $1oa municiones escarchadas para Norber Teclanaje en Puerto Boralus.', '¡Hola!\n\nHemos recibido transmisiones desde arriba: ¡necesitamos más municiones! Municiones un poco más potentes. ¡Con alguna propiedad completamente inesperada!\n\nHe oído que hay un tipo de munición de escarcha que fabrican solo los ingenieros más expertos. Si me trajeras algunas, ¡nuestros oficiales de municiones estarían eufóricos!\n\n¡Quizás hasta me dejen quedarme con una para investigarla!', '', '', '', '', '', '', 33528),
(54380, 'esMX', 'Donaciones de Costa Oscura: Oro', 'Dona $1oa de oro al pagador Vauldren en el Puerto Boralus.', 'Hemos gastado mucho tiempo y recursos preparándonos para la batalla que se avecina. \n\nAhora que comenzamos los últimos preparativos, acumularemos algunos recursos para poder entrenar a nuestras tropas cuanto antes y que no nos falten suministros en ningún momento. \n\n¿Te gustaría hacer una donación?', '', '', '', '', '', '', 33528),
(54364, 'esMX', 'Donaciones de Costa Oscura: Musgo estelar', 'Consigue $1oa linos de pulverización marina para Faella en el Puerto Boralus.', '', '', '', '', '', '', '', 33528),
(54036, 'esMX', 'Un proceso particular', 'Habla con Nomi.', 'Como habrás notado, el viticultor Iltheux es muy meticuloso con su proceso de producción de vino, pero creó su receta ancestral pensando únicamente en los Natonocturno. \n\n¡Necesitamos algo diferente para satisfacer a los diversos paladares de la Horda!\n\nHabla con Nomi y escucha qué ideas tiene para agregarle un poco de sabor a esta cuestión.', '', '', '', '', '', '', 33528),
(54027, 'esMX', 'Amenaza contenida', 'Regresa con la guardia de espadas Sonji en Fuerte Grommash, Orgrimmar.', '¡Eso debería mantener a raya a los nagas!\n\nPuedes tener el honor de decirle a la guardia de espadas Sonji que hemos contenido la amenaza en la costa de Zuldazar.', '', '', '', '', '', '', 33528),
(54026, 'esMX', 'Trabajo terminado', 'Regresa con el comandante Dresh en Fuerte Grommash, Orgrimmar.', 'Me quedaré un rato más para asegurarme de que los peones regresen al trabajo. \n\nDeberías regresar a Orgrimmar y avisarle al comandante Dresh que ya no necesita preocuparse por el puesto de avanzada.', '', '', '', '', '', '', 33528),
(53977, 'esMX', 'El Cofre de guerra', 'Recoge recursos del Cofre de guerra de Bashal\'Aran.', '¡$GBienvenido:Bienvenida; al frente de batalla, $n! Por fin veremos algo de acción. \n\nTodos los recursos que recolectemos estarán en el Cofre de guerra. Una vez que hayamos acumulado suficientes, ¡podrás recogerlos!\n\n¿Por qué no pasas por allí y ves lo que puedes conseguir?', '', '', '', '', '', '', 33528),
(53974, 'esMX', 'Druidas de Marea Penumbral', 'Captura Playa Marea Penumbral y ve a hablar con Edgard para saber lo que tiene para ofrecer.', 'La energía latente de la Playa Marea Penumbral nos da la oportunidad de controlar un gran poder. Los conocimientos de uno de nuestros aliados, Edgard, pueden ser muy útiles para saber lo que significa esto para nuestros esfuerzos.\n\nVe a buscarlo y descubre el poder de la naturaleza.', '', '', '', '', '', '', 33528),
(53961, 'esMX', 'Gujas mortales', 'Habla con Erion para saber lo que hay en el Taller de Gujas.', 'Todos hemos estado un poco perturbados desde los eventos de Teldrassil, pero parece que Erion quedó más afectado. Se ofreció de inmediato para ayudar.\n\n¿Por qué no vas a hablar con él y averiguas lo que está haciendo en el Taller de Gujas?', '', '', '', '', '', '', 33528),
(53960, 'esMX', 'El Altar de Ancianos', 'Habla con la sacerdotisa lunar Lasara para saber lo que hay en el Altar de Ancianos.', 'Ahora que contamos con los recursos necesarios, el Altar de Ancianos se ha reconstruido.\n\nVe a hablar con la sacerdotisa lunar Lasara para averiguar qué hay en el Altar.', '', '', '', '', '', '', 33528),
(53959, 'esMX', 'Armaduras para ejércitos', 'Habla con Cordressa Brezoguja para saber lo que hay en el Recinto de los Cazadores.', 'Tenemos que asegurarnos de que nuestros soldados tengan el mejor equipamiento posible en la batalla contra la Horda. \n\nCuando el Recinto de los Cazadores esté construido, habla con Cordressa Brezoguja sobre cómo mejorar las armas y armaduras de nuestras tropas.', '', '', '', '', '', '', 33528),
(53908, 'esMX', 'Esperando nuestra llegada', 'Regresa a Fuerte Grommash en Orgrimmar.', 'Regresemos a Orgrimmar.\n\nSeguramente Kiro nos esté esperando. \n\nNo deberíamos hacerlo esperar.', '', '', '', '', '', '', 33528),
(53907, 'esMX', 'Cata de cosecha', 'Entrégale una muestra del vino de Nomi al viticultor Iltheux y obtén su aprobación.', '¡Creo que estamos produciendo vino, $p!\n\nVeamos si el viticultor aprueba nuestra cosecha. \n\nLlévale una muestra a Iltheux y escucha su opinión.', '', '', '', '', '', '', 33528),
(53906, 'esMX', 'Fermentado para la Horda', 'Recoge los ingredientes necesarios para crear un vino digno de la Horda.', 'La receta del viticultor Iltheux no necesita grandes modificaciones. \n\nSolo hacen falta algunos ingredientes únicos y unas ligeras modificaciones al proceso de producción de vino. \n\nCreo que con agregar un poco de flor de fuego fermentada debería bastar. Luego, lo filtramos con un paño especial hecho de fibras de alaseda. \n\nHay alaseda de sobra en el viñedo, y no tengo dudas de que la jefa Mida puede conseguir las flores, por un precio.', '', '', '', '', '', '', 33528),
(53905, 'esMX', 'Aptitudes laborales', 'Asígnales nuevas tareas a Micah Pezuñota, la jefa Mida y Nomi.', 'Iltheux no está utilizando la ayuda que le dieron como corresponde.\n\nArreglemos eso.\n\nAsígnales nuevas tareas a los trabajadores que sean más adecuadas a las aptitudes de cada uno.\n\nSi necesitas sugerencias, te ayudaré con gusto.', '', '', '', '', '', '', 33528),
(53904, 'esMX', 'Los asistentes del viticultor', 'Habla con Micah Pezuñota, la jefa Mida y Nomi.', 'El viticultor Iltheux supervisa la producción de arcavino de la Horda. \n\nAcostumbraba hacer el vino por su cuenta, hasta que la Horda envió ayuda para agilizar el proceso. \n\nPero no ha funcionado como planeaban. \n\nTenemos que llegar al fondo del asunto. \n\n¿Qué dices si recorres los viñedos para ver cómo marcha todo? Tengo algunas preguntas más para el viticultor.', '', '', '', '', '', '', 33528),
(53903, 'esMX', 'Reúnete con Meerah', 'Reúnete con Meerah en los Viñedos del Crepúsculo en Suramar.', 'Parece que estamos avanzando.\n\n¿Podrías reunirte con Meerah?\n\nQuiero asegurarme de que haya encontrado al viticultor en Suramar.', '', '', '', '', '', '', 33528),
(53902, 'esMX', 'Elimina a la clamamareas', 'Mata a la clamamareas Nezara.', 'Puede que el escudo de Nezara ya no la proteja, pero eso no significa que no sepa defenderse. \n\nHay un bruto a su lado que puede causar problemas. Intentaré apuñalarlo para que tú puedas derribar a la clamamareas.', '', 'Líder de los naga nazeshi que invaden las costas de Zuldazar.', 'Clamamareas Nezara', '', '', '', 33528),
(53901, 'esMX', 'La respuesta siempre es una explosión', 'Coloca Explosivos volátiles sobre lanzaarpones nagas y hazlos explotar para crear una distracción.', 'El área alrededor de la clamamareas Nezara está muy protegida, por lo que necesitaré que crees una distracción. \n\nToma estos explosivos. Colócalos sobre los lanzaarpones de los nagas. Cuando detonen, ¡la explosión debería bastar para alterar a los guardias!', '', '', '', '', '', '', 33528),
(53900, 'esMX', 'Usaremos sus armas', 'Recoge $1oa armamentos nazeshi de las fuerzas en el interior de Bajíos Perlaterror.', 'Necesitaremos armas especiales para derribar a la Clamamareas Nezara. Lo bueno es que parece que los nagas tienen muchas. \n\nUsaremos sus armas en su contra. Tú y yo somos $Gexpertos:expertas; en eso. \n\nToma varias de ellas. Necesitaremos más de una.', '', '', '', '', '', '', 33528),
(53899, 'esMX', 'En las afueras', 'Encuentra a Nisha en la costa sur de Zuldazar.', 'Si todo está resuelto para el comandante, deberías ir a ver a Nisha. \n\nTu ayuda le vendría bien.', '', '', '', '', '', '', 33528),
(53898, 'esMX', 'Fuerza y honor', 'Lucha contra el capataz Magrok y enséñale una lección de fuerza y de honor.', 'Esos peones se ven muy alegres, ¿no crees? No tengo dudas de que regresaran al trabajo por la mañana. \n\nSin embargo, si el comportamiento de su líder pasa inadvertido, siempre habrá riesgo de una revuelta. \n\nTienes que enfrentarlo en una batalla. \n\nMuéstrale el verdadero poder de la Horda, pero también muéstrale piedad para que conozca el valor del honor.', '', 'Líder de la revuelta de peones en Machacolpe.', '', '', '', '', 33528),
(53897, 'esMX', 'Una fiesta en su honor', 'Infórmale al capataz Magrok que la Horda organizará una fiesta para los peones.', 'Creo que tengo todo lo necesario para hacer que esta noche sea un éxito. \n\nSolo necesitamos asegurarnos de que los peones asistan.\n\nDile a su líder que la Horda organizará una fiesta en su honor. \n\nEstoy seguro de que no rechazarán una noche de comida y bebida gratis.', '', '', '', '', '', '', 33528),
(53895, 'esMX', 'Ascenso de los peones', 'Asciende a algunos de los peones de Machacolpe en Guarida de Peones.', 'Estoy de acuerdo con el pedido de los peones. Deberían recibir una recompensa por el trabajo que hacen.\n\nEs poco probable que la Horda acceda a aumentarles la paga, pero no hay motivo por el cual no podamos darles un ascenso. \n\nCualquier otro título que no sea el de peón los ayudará a ganar confianza.', '', '', '', '', '', '', 33528),
(53894, 'esMX', 'Reparaciones valiosas', 'Recoge $1oa menas crepusculares para que Kiro pueda reparar las herramientas de los peones.', 'Los peones tienen razón. Estas herramientas no sirven. \n\n¿Cómo esperan que completen un trabajo sin las herramientas adecuadas?\n\nPuedo encargarme de las reparaciones, pero necesitaré algunas menas primero.', '', '', '', '', '', '', 33528),
(53893, 'esMX', 'Un gesto de buena voluntad', 'Recoge $1oa flancos de sable, $2oa carne de huargo y $3oa trocitos de gallina.', 'Parece que los peones no se sienten valorados. Hacen una labor importante para la Horda, pero su diligencia con frecuencia pasa inadvertida. Un gesto de buena voluntad sería muy útil. \n\nOrganicemos un festín en su honor. Necesitaremos bastante carne para saciar su enorme apetito. Por suerte, tengo un tótem que puede ayudarnos.   \n\nTú consigue los ingredientes y yo prepararé una comida que les subirá la moral.', '', '', '', '', '', '', 33528),
(53892, 'esMX', '¿Dónde están los obreros?', 'Averigua a dónde fueron los peones de Machacolpe.', 'Mira esta hacha, $p. El mango aún está sudado. Los trabajadores estuvieron aquí hace poco. \n\nVeamos si Sasha puede rastrear su olor.', '', '', '', '', '', '', 33528),
(53891, 'esMX', 'No hay problemas insignificantes', 'Reúnete con Kiro en las Tierras Altas Crepusculares.', 'Puede que estos parezcan problemas insignificantes, pero con el tiempo desgastarán a la Horda si no los resolvemos. \n\nDebemos ofrecer nuestra ayuda. \n\nLos vulperas son expertos en resolver problemas, a pesar de su tamaño.\n\nYo investigaré el puesto de avanzada. Nisha y Meerah se encargarán del resto.\n\nReúnete conmigo en Tierras Altas Crepusculares cuando estés $Glisto:lista;.', '', '', '', '', '', '', 33528),
(53890, 'esMX', 'Aliados nuevos, problemas nuevos', 'Averigua qué problemas tienen el comandante Dresh, la guardia de espadas Sonji y la Primera Arcanista Thalyssra.', 'Baine sin duda está muy ocupado. Aceptar aliados nuevos implica también aceptar sus problemas. \n\nAverigüemos qué problemas aquejan a la Horda y veamos cómo podemos ayudar. \n\nQuizás cuando Baine no esté tan atareado pueda ver nuestro verdadero valor.', '', '', '', '', '', '', 33528),
(53889, 'esMX', 'Una declaración de intención', 'Observa la declaración de Kiro para unirse a la Horda.', 'Nuestra caravana está lista para explorar el mundo más allá de las arenas, pero la espada de Nisha no puede ser nuestra única defensa contra los peligros que sabemos que nos aguardan. \n\nEs por eso que hemos venido. \n\nQueremos declarar nuestra intención de unirnos a la Horda.', '', '', '', '', '', '', 33528),
(53870, 'esMX', 'Invitados en Fuerte Grommash', 'Reúnete con tus invitados en Fuerte Grommash.', '$p, me informaron que una caravana vulpera ha llegado a Fuerte Grommash. Quieren hablar con el representante de la Horda y han solicitado tu presencia.\n\nMe temo que no es el mejor momento para recibir invitados, así que te ruego que vayas a verlos en cuanto puedas.', '', '', '', '', '', '', 33528),
