(53258, 'esMX', 'Donaciones de Arathi: Viridio transzonal', '', '', '', '', '', '', '', '', 33528),
(53248, 'esMX', 'Donaciones de Arathi: Bandera de batalla: Defensa de falange', '', '', '', '', '', '', '', '', 33528),
