(52930, 'esMX', 'Donaciones de Arathi: Oro', 'Dona $1oa de oro al pagador Dentirrisa en el Puerto de Zandalar.', 'Nuestros amigos aquí aceptan todo tipo de donaciones para el esfuerzo de guerra, pero si me preguntas a mí, ninguna batalla se ha ganado sin un financiamiento adecuado. Eso es, cabeza de chorlito. ¡Hablo de dinero! Y mucho.\n\n¡Si lo tienes, lo necesitamos!', '', '', '', '', '', '', 33528),
