(50738, 'esMX', 'Una llegada oportuna', 'Saluda a la jefa de guerra Sylvanas Brisaveloz en Astranaar.', 'Yo cumplí con mi parte del trato, $R. \n\nVoy a revisar los demás puestos de avanzada para controlar que mis hermanos y hermanas no estén en problemas. Reúnete con la jefa de guerra e infórmale que Astranaar está en nuestras manos. Si no hubo problemas con el plan, ya debería estar en camino.\n\nAh, y trata de no quedarte con toda la gloria, ¿sí? \n\n<Lorash te sonríe>.', '', '', '', '', '', '', 33528),
