(45102, 'esMX', 'Que comience el asalto', 'Comienza el asalto a la Costa Quebrada.', 'La batalla por nuestro mundo ha sido muy dura, pero con el poder de tu arma y las fuerzas combinadas de Azeroth, hemos logrado rechazar a los invasores demoníacos en cada embestida.\n\nAhora estamos otra vez en la Costa Quebrada, preparados para hacer lo que antes no logramos concretar. No nos olvidemos de aquellos que lo sacrificaron todo para brindarnos esta oportunidad.\n\nNuestro primer objetivo es tomar la colina que tenemos frente a nosotros para poder construir una fortaleza. Prepárate, $n. El asalto a la Costa Quebrada comienza ahora mismo.', '', '', '', '', '', '', 33528),
