(34063, 'esMX', 'Enemigos a la distancia', 'Habla con el explorador Ruk\'gan cerca de los Huesos de Agurak.', 'Hemos causado un golpe fatal a los Señores del Trueno con la muerte del Lobo Gélido $n, pero no debemos descansar aún.$B$BLos generales del Señor del Trueno pelearán como lobos enjaulados para mantener su lugar en la Horda de Hierro y eso son malas noticias para nosotros.$b$bEnvié al explorador Ruk\'gan para que vigile sus movimientos pero no se ha reportado aún. Si nos quieres ayudar, busca a Ruk\'gan. ¡$B$B Lok\'tar $n!', '', '', '', '', '', '', 33528),
(26398, 'esMX', 'Caminar con la Madre Tierra', 'Lleva la Marca de Pezuña de Sangre al Alto señor supremo Colmillosauro, que se encuentra en el Fuerte Grommash en Orgrimmar.$B$BPuedes hablar con Tal, el maestro de jinetes del viento, para viajar hasta allí, o esperar al zepelín.', 'Has luchado con valentía a mi lado, $n, y has ayudado mucho a mi pueblo. Si $gtodo:toda; $r fuera tan noble, el futuro de la Horda no me preocuparía tanto.$B$BTe pediré que alivies un poco más mis preocupaciones. Ve a Orgrimmar. Explícale al Alto señor supremo Colmillosauro que los Tótem Siniestro han sido expulsados. Háblale de nuestro orgullo y nuestra disciplina, de nuestro dolor y fortaleza.$B$BTal en la Torre Celestial te enviará a tu destino. Ve en paz, $Gamigo:amiga;.', '', '', '', '', '', '', 33528),
(24878, 'esMX', 'Reunión de residuos', 'Vuelve con la alquimista Adrianna cuando estés $ginfectado:infectada; con añublo naranja y verde.', 'El profesor Putricidio está encerrado en su repugnante laboratorio, haciendo experimentos y refinando cepas cada vez más letales de añublo para usarlo contra nosotros. Si pudiéramos obtener muestras puras de las toxinas, nuestros investigadores podrían elaborar un antídoto que salvaría innumerables vidas.$b$bSi encuentras especímenes vivos, vuelve aquí inmediatamente para que podamos estudiarlos.', 'Vuelve con dos cepas de añublo.', '', '', '', '', 'Vuelve con: Adrianna. Zona: Ciudadela de la Corona de Hielo.', 33528),
(24872, 'esMX', 'Un respiro para un alma atormentada', 'Usa los cristales de vida para preservar la esencia de Sindragosa.', 'Toma este cristal de vida y encárgate de que tus compañeros tengan uno también. Contiene potentes energías del Santuario de Dragones Esmeralda, en el Cementerio de Dragones, y es el secreto de mi larga resistencia ante las magias oscuras de este lugar.$b$bCuando te enfrentes a Sindragosa, lucha con ella hasta que esté debilitada, y entonces haz que tus compañeros usen estos cristales para extraer la esencia que permanece latente en su interior. Si la derrotas entonces, deberías poder recuperar la esencia y devolverla al Templo del Reposo del Dragón en el Cementerio de Dragones.', '', '', '', '', '', '', 33528),
(24840, 'esMX', 'Cambio de opinión', '', '', '', '', '', '', '', '', 33528),
(14111, 'esMX', 'Reliquia del Anillo de la Tierra', 'Llévale tus cuatro tótems al clarividente Eannu a Forjaz.', 'Has progresado mucho en tu entrenamiento, $n. Ahora que dominas los cuatro elementos básicos, tendrás que esforzarte para mantenerlos en equilibrio. Esta disciplina conlleva un beneficio práctico: con entrenamiento, podrás llevar una sola reliquia en vez de los cuatro tótems.$B$BHabla con el clarividente Eannu cerca de La Gran Fundición de Forjaz. Él te ayudará a perfeccionar tu dominio de los elementos.', '', '', '', '', '', '', 33528),
(12781, 'esMX', '¡Te damos la bienvenida!', 'Lleva el vale regalo de El Bastión de Ébano a Siouxsie el alma en pena en El Bastión de Ébano.', '¡$gBienvenido:Bienvenida; al World of Warcraft!$b$bPara agradecerte de forma especial la compra de la edición de coleccionista de World of Warcraft, dale este vale a Siouxsie el alma en pena en El Bastión de Ébano. Después te darán un regalo: un pequeño acompañante que te seguirá en tu búsqueda de aventura y gloria.$b$b¡Gracias otra vez y disfruta tu estancia en World of Warcraft!|n', '', '', '', '', '', '', 33528),
(11401, 'esMX', 'Invoca a El Jinete decapitado', 'Lleva una vela lóbrega a la tierra ligeramente revuelta.', 'Muchas velas lóbregas adornan este santuario calabaza que sonríe, mofándose...', '', '', '', '', '', '', 33528),
(9610, 'esMX', '[DEPRECATED]Charca de Lágrimas', 'Consigue 5 artefactos Atal\'ai y llévaselos a Holaaru en El Puerto del Pantano de las Penas.', 'Estoy interesado en estudiar el pasado de Azeroth y me pregunto si querrías ayudarme.$B$BAquí cerca hay un lugar de relevancia histórica en la ciénaga en el que me gustaría que te aventuraras. La Charca de Lágrimas se encuentra al sureste. Se dice que en su orilla y en las profundidades hay enterrados artefactos de la civilización trol Atal\'ai.$B$BPero cuidado, los vigila Somnus, un antiguo dragón Verde y sus dragonantes ¡además de los peces carnívoros de la propia charca!', '', '', '', '', '', '', 33528),
(9586, 'esMX', 'Ayudar a Tavara', 'Guvan de la Avanzada Azur quiere que encuentres a Tavara y cures sus heridas.', 'Tavara, una de las herboristas, se fue hace mucho a recoger hierbas y aún no ha vuelto. Temo que se haya hecho daño y necesite ayuda, pero yo no puedo ir a buscarla.$b$bBúscala y sánala si es necesario, $c. Cuando salió de Avanzada Azur se fue hacia el este, hacia unas fuentes termales.', '', '', '', '', '', '', 33528),
(9508, 'esMX', 'La llamada del agua', 'Lleva la cabeza de Tel\'athion a Acuosa en El Arrecife Oculto, en la Isla Bruma de Sangre.', 'He establecido el origen de la corrupción. Es un derivado de alguna investigación demencial ¡y vas a acabar con ella!$B$BJusto al suroeste de La Poza del Hediondo hay un pequeño campamento. Allí encontrarás la \'investigación\' de Tel\'athion el Impuro. Allí produce la inmundicia que se ha infiltrado en el agua de la isla.$B$BUsa el agua pura que conseguiste en Vallefresno para destruir su escondrijo de barriles. No tardará en aparecer.$B$B¡Vamos a ponerle fin a esto!', '', '', '', '', '', '', 33528),
(9489, 'esMX', 'Limpiar La Cicatriz', 'Lanza Palabra de poder: entereza a 6 forestales Canción Eterna en La Cicatriz Muerta.', '$n, qué bien que hayas venido. La Plaga está atacando nuestra ciudad con tan encendido odio que me temo que el ánimo de nuestros guardias se está derrumbando.$B$BApresúrate y ve a La Cicatriz Muerta, al sur de la ciudad donde Jaela y sus forestales aguardan. Llénalos con el poder de la Luz mediante tus bendiciones.', '', '', '', '', '', '', 33528),
(9476, 'esMX', 'En busca de Barbapluma', 'Ve a Shadra\'Alor y busca huellas de Barbapluma.', 'Las anotaciones más recientes del diario describen la preocupación de Barbapluma por el creciente número de ataques de los trols Secacorteza sobre los grifos de Pico Nidal y una serie de robos de huevos. Un registro de los campamentos Secacorteza más pequeños del área no parecen haber aportado más información.$B$BSegún la última anotación, Barbapluma sospechaba que un médico brujo Secacorteza llamado Mai\'jin estaba detrás de estos ataques. En la última nota, escrita de forma apresurada, se menciona la intención del enano de dirigirse a Shadra\'Alor en busca de los huevos.', '', '', '', '', '', '', 33528),
(9467, 'esMX', 'La llamada del fuego', 'Recolecta las cenizas de Prepotencia y devuélveselas junto con la antorcha ritual a Templar en El Claro de Ascuas, en la Isla Bruma Azur. Recuerda que puedas utilizar el orbe de retorno para teletransportarte junto a Templar cuando tengas las cenizas.', 'Han engañado a las lechubestias del Túmulo Lunala en la Isla Bruma de Plata, un lugar remoto hacia el suroeste, y les han hecho creer que Prepotencia es un dios al que hay que adorar. En realidad, es un elemental caído que necesita que acaben con su sufrimiento. Esa antorcha es la clave de su caída.$B$BPrepotencia exige periódicamente que estas lechubestias quemen una efigie en su honor. Así que, cuando la enciendas, se presentará. Mátalo y tráeme sus cenizas. Utiliza entonces el orbe de la cartera que te daré para regresar aquí.', '', '', '', '', '', '', 33528),
(9461, 'esMX', 'La llamada del fuego', 'Busca al profeta Velen en El Exodar en la Isla Bruma Azur.', 'Debes saber que El Profeta ha preguntado por ti ya que ha oído hablar mucho del éxito de tu reto. La creación de tu tótem de Fuego tendrá que esperar hasta que hayas hablado con él.$b$bEs un raro honor; ¡preséntate a él de inmediato en El Exodar!', '', '', '', '', '', '', 33528),
(9189, 'esMX', 'Entrega a El Sepulcro', 'Entrega las órdenes sin\'dorei selladas al consejero Sorrelon en El Sepulcro en el Bosque de Argénteos.', 'Has agitado el corazón de la dama, aunque ya no late.$B$BSin embargo, tengo instrucciones para entregarlo en El Sepulcro, en el Bosque de Argénteos. El consejero Sorrelon nos representa ante los Renegados.$B$BLa ruta más corta sin utilizar sus murciélagos voladores, es salir de Entrañas y coger el camino del sur. Sigue las señales. Encontrar el lugar no te resultará difícil. Pero prepárate. El Sepulcro es una cripta dilapidada.$B$BEsos Renegados son unas criaturas de lo más extrañas.', '', '', '', '', '', '', 33528),
(9186, 'esMX', 'Libranza del artesano: cinturón de cuero maligno', 'Entrega 9 cinturones de cuero maligno y la libranza del artesano: cinturón de cuero maligno al maestro de manada Mazadura que está en la Capilla de la Esperanza de la Luz, en las Tierras de la Peste del Este.', 'Páguese al portador de esta libranza con una insignia de su elección, una vez completada la orden de trabajo contratada.$B$BOrden de trabajo LW-736:$B$B9 cinturones de cuero maligno.$B$BTodas las órdenes completadas deben ser entregadas al maestro de manada Mazadura en la Capilla de la Esperanza de la Luz, en las Tierras de la Peste del Este.$B$BEste contrato quedará anulado en caso de alteraciones o daños.$B$B-Comandante de envíos Metz, El Alba Argenta', '', '', '', '', '', '', 33528),
(8909, 'esMX', 'Una propuesta seria', 'Lleva 15 muestras de sangre de Cuna del Invierno, 20 piezas de oro y 1 par de brazales de devoto a Deliana a Forjaz.', 'Saludos, $c. Tengo algo que puede interesarte.$b$bDispongo de una armadura muy parecida a las que se usan en tu profesión, pero de mucha mejor calidad. Te cambiaré los brazales por otros normales a cambio de un favor.$b$bLa sangre de los osos y los sables de hielo que viven en Cuna del Invierno tiene propiedades que necesito. Tráeme un frasco grande de sangre, los brazales y un poco de oro. Tus esfuerzos se verán recompensados.', '', '', '', '', '', '', 33528),
