(8779, 'esMX', 'Materiales de visión', 'Bring 2 Large Brilliant Shard and 1 Huge Emerald to Geologist Larksbane at Cenarion Hold in Silithus.  You must also bring Logistics Task Briefing V in order to complete this quest.', 'Los estudios de la Geóloga Trotuina han demostrado ser de gran valor para nuestras operaciones en Silithus. Recientemente, ha solicitado materiales de visión para utilizar en su investigación.$B$BPor favor, consigue esos materiales y llévaselos directamente a ella para que pueda continuar con su investigación.', '', '', '', '', '', '', 33528),
(8507, 'esMX', 'Servicio de campo', 'Preséntate en el puesto de la Brigada de Forjaz cerca de Colmen\'Zora. Prepara tu documentación de instrucción de campo sin firmar y consigue la documentación de instrucción de campo firmada del capitán Yunquenegro. A continuación, reúnete con Clamavientos Kaldon en el Fuerte Cenarion, en Silithus.$B$BNota: curar o lanzar hechizos benéficos a un miembro de la Brigada de Forjaz, te marcará como JcJ.', 'Hola, $n. Antes de poder asignarte tareas más complicadas en la guerra, tendrás que hacer tu parte en el campo de batalla. $B$BEncontrarás al capitán Yunquenegro de la Brigada de Forjaz fuera de Colmen\'Zora.$B$BPreséntate ante él o ante su teniente, Janela Martillotenaz y después vuelve a verme. Tendré preparada alguna tarea más avanzada para ti.$B$BOh y, por favor, no te acerques a la Legión de Orgrimmar. Nos hemos visto obligados a mantener ambas fuerzas separadas debido a la animadversión mutua.', '', '', '', '', '', '', 33528),
(8425, 'esMX', 'Plumas Vudú', 'Llévale las plumas vudú de los trols del Templo Sumergido al héroe caído de la Horda.', 'Tu honor me ha devuelto algo de paz. Es de justicia que te entregue algo a cambio.$B$BMis armas y armadura eran espléndidas en vida pero ahora ya no me sirven. Cumplirán mejor su función en tu posesión.$B$BVe al Templo Sumergido y destruye a los trols guardianes Gasher, Mijan, Zolo, Hukku, Zul\'lor y Loh\'ro. Llevan plumas mágicas que pueden recrear mi cuerpo físico lo suficiente para que te pueda dar tu premio.', '', '', '', '', '', '', 33528),
(8275, 'esMX', 'La reconquista de Silithus', 'Habla con Clamavientos Cuerno Digno en el Fuerte Cenarion, en Silithus.', '¡Atención, héroes de la Alianza! Llevamos mucho tiempo sin comprobar la amenaza de los silítidos. Libres de las restricciones de una oposición real, llevan todo este tiempo preparándose para una expansión a gran escala.$B$BLas tropas del Círculo Cenarion se están reuniendo en Silithus para enfrentarse a esas malvadas criaturas. ¡Todos los aventureros que no estén heridos deben unirse a nosotros!$B$B¡No esperéis hasta que sea demasiado tarde! ¡Ayudadnos a defender Azeroth! ¡Presentaos a Clamavientos Cuerno Digno en el Fuerte Cenarion para recibir instrucciones específicas!', '', '', '', '', '', '', 33528),
(8235, 'esMX', 'Los trozos codificados', 'Llévale 10 fragmentos codificados al archimago Xylem en Azshara.', 'Lord Ravenholdt nos ha pedido un favor. Desea que eliminemos el encantamiento de esta bolsa.$B$BPor desgracia, recientemente robaron algunos de mis libros sobre desencantamientos y fueron destruidos por unos salvajes. Lo que queda de esos libros aún tiene valor para mí.$B$BSi me traes suficientes fragmentos codificados, podría juntarlos de nuevo. Tu mejor opción es matar a las bestias de Azshara, ya que tienen tendencia a recoger casi todo.', '', '', '', '', '', '', 33528),
