(7882, 'esMX', 'Los chalecos de los feriantes', '', '', '', '', '', '', '', '', 33528),
(7872, 'esMX', '¡Expulsa al invasor!', 'Entra en la Garganta Grito de Guerra y derrota a la Horda, obtén una marca de Honor Grito de Guerra y vuelve con la centinela Cantolejano en el Claro Ala de Plata.', 'Pasado este túnel encontrarás la Tierra de Disputas y desorden, joven $c. La Horda sigue diezmando nuestro sagrado bosque, talando el perenne follaje para alimentar a sus máquinas de guerra.$B$BEntra en la Garganta Grito de Guerra y defiende el Bastión Ala de Plata. ¡Haz retroceder a las fuerzas invasoras de la Horda!$B$BHazlo y obtendrás un talismán de mérito. Tráeme uno de esos talismanes, $n, y serás $grecompensado:recompensada;.', '', '', '', '', '', '', 33528),
(7789, 'esMX', 'Acaba con los usurpadores Ala de Plata', 'Entra en la Garganta Grito de Guerra y derrota a la Alianza, obtén una marca de Honor de la Garganta Grito de Guerra y llévasela al capitán Trizacráneo en el Campamento de Mor\'shan.', 'Las tierras del Bosque de Vallefresno sucumbirán al poder de la Horda, $r. Nada de lo que haga o diga el Ala de Plata podrá detener nuestro mando soberano. Kalimdor pertenece a la Horda. ¡Con qué osadía intentan evitar que cosechemos lo que nos pertenece por derecho!$B$BDeja que el orgullo hinche tu pecho cuando reduzcas sus débiles intentos por frenar nuestro avance. Destruye a las centinelas Ala de Plata y obtén una marca de Honor Grito de Guerra. Vuelve a verme cuando tengas una de esas marcas, $n, y serás $grecompensado:recompensada;.|n', '', '', '', '', '', '', 33528),
(7626, 'esMX', 'La Campana de Dethmoora', 'Llévale 2 elixires de poder de las sombras a Gorzeeki Ojovago en Las Estepas Ardientes.', 'Una Campana de Dethmoora, llamada así por la difunta bruja Dethmoora Ojoscuros, es una de las tres herramientas necesarias para crear un Círculo de invocación superior. Cuando está perfectamente en armonía con la Rueda y la Vela, estos objetos son conductores de un enorme poder arcano.$B$BMi sirviente Gorzeeki puede construir una campana de este tipo pero para ello, necesita elixir de poder de las sombras en abundancia. Consigue los elixires de un alquimista y tráeselos a Gorzeeki.', '', '', '', '', '', '', 33528),
(7624, 'esMX', 'Ulathek el Traidor', 'Enfréntate a Ulathek y llévale el corazón del traidor a Lord Pesadilla en Jaedenar.', '¿Deseas caerme en gracia? Entonces mata por mí.$B$BEs patético ver cómo mi sirviente, Ulathek, se arrastra ante mí, mientras conspira a mis espaldas con Lord Hel\'nurath sobre Xoroth. Hel\'nurath planea usurpar mi poder aquí y Ulathek es su espía...$B$BDemuestra que es a mí a quien sirves y no a mis rivales. Enfréntate a Ulathek en su barrio, en la Guarida Sombría, hacia el oeste. Dile que conozco su secreto y fíjate cómo se encoge del miedo. Entonces, ¡tráeme el corazón de ese traidor!', '', '', '', '', '', '', 33528),
(6604, 'esMX', 'Lechúcico salvaje iracundo', 'Habla con Jaron Tallapiedras en Aldea Estrella Fugaz.', '¿Has visto el campamento abandonado al sur de aquí? ¡Es como si los lechúcicos salvajes se hubieran vuelto locos y hubieran destruido todo lo que encontraban a su paso!$B$BHe oído rumores de que uno de los supervivientes del ataque está descansando en Aldea Estrella Fugaz, al oeste de aquí. Siento curiosidad por saber qué es lo que ocurrió... ¿tú no?', '', '', '', '', '', '', 33528),
(6570, 'esMX', 'Brasaliza', 'Viaja a la Ciénaga de Fuego del Marjal Revolcafango y busca El Cubil de Brasaliza. Cuando estés dentro ponte el Amuleto de Subversión Dracónica y habla con Brasaliza.|n', 'He armonizado este medallón con la magia necesaria para crear y mantener una ilusión dentro de los límites del cubil de Brasaliza.$B$BBrasaliza es un draco antiguo; un viejo guardián de Nefarian, encargado de someter a prueba a los dragauros que debían ascender al rango de guardia de élite de Onyxia.$B$BViaja hasta la Ciénaga de Fuego del Marjal Revolcafango y entra en la guarida de Brasaliza. Cuando estés allí ponte el amuleto ¡y sigue tu destino a donde quiera que te conduzca!|n', '', '', '', '', '', '', 33528),
(6145, 'esMX', 'El mensajero carmesí', 'Vuelve a las Tierras de la Peste del Este y encuentra al mensajero carmesí. Mata al mensajero y recupera la Orden del Gran Cruzado.$B$BLleva el documento a Nathanos Clamañublo y espera sus instrucciones.', 'Igual que el cuerpo no puede sobrevivir sin cabeza, la cabeza no puede sobrevivir sin cuerpo. Las defensas de la Cruzada Escarlata que hay en el interior de Stratholme son prácticamente impenetrables. Solo podemos separar el cuerpo de la cabeza.$B$BMis mortacechadores han estado reuniendo datos sobre la actividad de la Cruzada fuera de Stratholme. Envían cada día un informe de su centro de mando a Mano de Tyr. ¡Ese informe es la clave, $r! Encuentra al mensajero carmesí y arrebátale ese informe. Llévalo a Nathanos.', '', '', '', '', '', '', 33528),
(6129, 'esMX', 'Curar la dolencia', 'Usa el bálsamo animal curativo sobre las 10 gacelas enfermas que se encuentran en la parte norte de Los Baldíos; así se curarán. Hemos recibido informes según los cuales se han avistado gacelas enfermas por la carretera que va de este a oeste en El Cruce.', 'He podido preparar suficiente bálsamo para diez dosis curativas, $n. Mientras trabajo con las autoridades locales para tratar de hacer más bálsamo, me gustaría que nos ayudaras a iniciar la tarea. En Los Baldíos del Norte hay gacelas enfermas; usa el bálsamo con ellas y cura su malestar.$B$BDendrita Rafagaestelar del Claro de la Luna querrá hablar contigo cuando acabes, estoy seguro. Por favor transmite también nuestro agradecimiento al Círculo Cenarion allí... ¡y permite que te agradezca directamente la ayuda prestada!', '', '', '', '', '', '', 33528),
(6042, 'esMX', 'Los pequeños problemas de la no-vida', 'Mata a 20 murcipestes tóxicos y 10 murcipestes monstruosos. Vuelve con Nathanos Clamañublo cuando hayas acabado.', 'No se puede uno alejar dos pasos de la granja sin encontrarse con uno de esos repugnantes murciélagos. Quiero poder sacar a los canes y acabar con la Plaga sin que me molesten esos malditos y sucios murciélagos. Obviamente, tengo cosas mejores que hacer con mi tiempo que matar murciélagos un día sí y otro también. Pero tú no.$B$B¿Qué? ¿Tu entrenamiento? ¡Esto es tu entrenamiento! Ahora fuera de mi vista y no vuelvas hasta que no hayas matado a un buen número de esos demonios alados. Procura no decepcionarme.', '', '', '', '', '', '', 33528),
(5891, 'esMX', 'Bálsamo por desencantamiento', '', '', '', '', '', '', '', '', 33528),
(5890, 'esMX', 'Bálsamo por desuello', '', '', '', '', '', '', '', '', 33528),
(5888, 'esMX', 'Bálsamo por minería', '', '', '', '', '', '', '', '', 33528),
(4986, 'esMX', 'Rama de roble con inscripciones', 'Según la magia con la que está encantada La rama de roble con inscripciones, el siguiente paso del druida tauren debía ser su entrega al Círculo Cenarion en Darnassus. Pide ayuda a uno de los druidas que encontrarás allí.', 'La mano inerte del druida tauren aferra una rama de roble que parece lleno de vida. Cuando examinas la rama descubres unos glifos de naturaleza druídica tallados en la corteza.$B$BAgarras la rama y observas que es cálida al tacto, más de lo que debería ser. A tu mente llega la imagen del árbol de Teldrassil, en Darnassus concretamente, y tienes las palabras \"Círculo Cenarion\" en la punta de la lengua. Es como si la sugestión del lugar al que llevar la rama estuviera grabada en su interior.', '', '', '', '', '', '', 33528),
(4739, 'esMX', 'Buscando a Menara Nadiz', 'Habla con Menara Nadiz en Los Baldíos.', '¡$C! ¡$gEl:La; que viste y calza!$B$BNo tienes todo el equipo pero es fácil ver que estás a punto, exudas mayor seguridad en ti $gmismo:misma;. Así es, ahora lo veo.$B$BMenara Nadiz te enseñaría unas cuantas cosas si te sientes $gpreparado:preparada;. Se pasa el tiempo formando a alumnos más jóvenes en la magia Arcana. Incluso ofrece regalos a quien supera sus pruebas.$B$BVe a Trinquete en Los Baldíos, si te interesa. Ella está en la ciudad, en la torre de Strahad que la domina.', '', '', '', '', '', '', 33528),
(4737, 'esMX', 'Buscando a Menara Nadiz', 'Habla con Menara Nadiz en Los Baldíos.', 'Mm... te sigues esforzando por hacerte más $gpoderoso:poderosa;. Mantengo que es solo una cuestión de tiempo antes de que la corrupción y la adicción se apoderen de ti y te conviertas en $gun esclavo:una esclava; de aquello que intentas dominar.$B$B¡Bah! ¡Habrase visto semejante $gnecio:necia;! El tiempo me dará la razón, nada más... basta con dejarlo pasar.$B$BPero por lo visto, no todos están de acuerdo con Zevrost. Al parecer, Menara ha creado herramientas para que adquieras aún más poder y que aproveches tu fuerza. Si te interesa, ve a Trinquete en Los Baldíos. Está allí en la torre que domina la ciudad.', '', '', '', '', '', '', 33528),
(4181, 'esMX', 'Ingeniería goblin', 'Si quieres saber más sobre ingeniería goblin, llévale el Manual de disciplinas de ingeniería a Nixx Muellepiñón de Gadgetzan.', 'La ingeniería avanzada se divide en dos disciplinas: la de los gnomos y la de los goblins. Menciono a los goblins puramente porque existen. Les gustan las cosas que explotan y les da igual quién esté en medio, aun ellos mismos.$B$BLéete este manual, $n. Si quieres hacerte saltar por los aires, ve a ver a Nixx Muellepiñón en Gadgetzan. Recuerda que si te inscribes, no podrás pasarte luego a la otra escuela, ¡así que piénsatelo bien!', '', '', '', '', '', '', 33528),
(4111, 'esMX', 'Bálsamo por desuello', '', '', '', '', '', '', '', '', 33528),
(4108, 'esMX', 'Bálsamo por caza', '', '', '', '', '', '', '', '', 33528),
(3640, 'esMX', 'La promesa del secreto', 'Si decides dedicarte a la ingeniería gnómica, haz clic con el botón derecho del ratón en el compromiso de secreto perpetuo y habla de nuevo con el maestro manitas Sobrechispa en Forjaz.', 'La ingeniería de los gnomos pone la teoría de la ingeniería al servicio de nuestras necesidades. Nuestros sistemas nos permiten fabricar instrumentos que controlan el mundo que nos rodea. El manual que has leído habla de eso.$B$BTambién explica que juramos mantener nuestros planos en secreto. Cuando te conviertas en $gun ingeniero:una ingeniera; gnomo, claro está. No podrás leer nada sobre la ingeniería goblin.$B$BSi ya te has decidido, firma este compromiso de secreto perpetuo y vuelve a hablar conmigo. Piénsatelo muy bien, $n.', '', '', '', '', '', '', 33528),
(3637, 'esMX', 'Gnome Engineering', 'If you wish to learn more about Gnome Engineering, take the Manual of Engineering Disciplines to Oglethorpe Obnoticus in Booty Bay.', 'Engineering at the expert level breaks into two disciplines: gnome and goblin.  While I think it is a waste, you should be aware of gnome specialization.  They make items and gadgets that claim to change the world, but rarely work.$B$B$n, read this manual.  If you wish to learn how to make metal paper weights, then take the manual to Oglethorpe Obnoticus in Booty Bay.   Remember - membership is permanent and prevents joining the other discipline, so make sure you are sure before finishing his task.', '', '', '', '', '', '', 33528),
(3513, 'esMX', 'El pergamino rúnico', 'Llévale el pergamino rúnico de la torre de vigilancia norte en Los Baldíos.', 'El pergamino con aspecto oficial está firmemente atado con un lazo plateado. Seguro que alguien estará interesado en verlo, ¿pero quién?$B$BHay una avanzada cerca de la frontera con Vallefresno hacia el norte y si la información de este pergamino tiene que ver con los elfos de la noche, este es el lugar al que se debe llevar.', '', '', '', '', '', '', 33528),
(3124, 'esMX', 'Muisek de hipogrifo', 'Acaba con 10 hipogrifos Plumavieja de cualquier tipo y utiliza la vasija de muisek para encogerlos y capturarlos.', 'Has demostrado merecer mi confianza y tener facultad suficiente para utilizar a las vasijas de muisek. Ahora quisiera que capturases a otra criatura.$B$BLos hipogrifos han sido compañeros leales de los elfos de la noche durante muchos años; sus espíritus son leales e inquebrantables.$B$BTu tarea consiste en acabar con 10 hipogrifos Plumavieja y, rápidamente, encogerlos y capturarlos usando la vasija, de forma que podamos conservar su muisek. Podrás encontrarlos en las Altas Tierras Salvajes, al sur de aquí.', '', '', '', '', '', '', 33528),
(2996, 'esMX', 'Buscando a Strahad', 'Habla con Strahad Farsan en Trinquete.', 'Te he enseñado mucho, pero ha llegado el momento de que cambies de instructor. Se llama Strahad y vive en Trinquete. Es humano, pero no vayas a creer por eso que es débil. Su aspecto no refleja su poder; te enseñará invocaciones más potentes. Lo encontrarás en el puerto de Trinquete, cerca de su torre.', '', '', '', '', '', '', 33528),
(2936, 'esMX', 'Diosa araña', 'Lee el nombre de la diosa araña de los Secacorteza en la tablilla de Theka y vuelve a ver al maestro Gadrin.', 'Los Secacorteza adoran a una diosa araña, de la cual extraen su veneno más potente. Así que, si quieres el veneno, ¡tienes que invocar a la diosa!$B$BPara ello debes conocer su verdadero nombre, inscrito en una tablilla enterrada en Tanaris, en la ciudad trol de Zul\'Farrak, en una tumba custodiada por el Mártir Theka.$B$BDerrótalo y lee el nombre en la tablilla. Después, vuelve.', 'Averigua el nombre de la diosa araña', '', '', '', '', 'Vuelve con: Maestro Gadrin. Zona: Poblado Sen\'jin, Durotar.', 33528),
(2934, 'esMX', 'Glándula de veneno intacta', 'Lleva una glándula de veneno intacta al boticario Lydon de Molino Tarren.', 'Necesito más veneno como el que trajiste. Creo que las arañas de las que se extrae viven en las Tierras del Interior; encuentra una con la glándula de veneno intacta y tráemela. Habrá muchas cerca de la ciudad trol de Shadra\'Alor.$B$BNo te entretengas, $n. La glándula tiene que ser fresca.', '', '', '', '', '', '', 33528),
(2762, 'esMX', 'La veraplata no es verídica', 'Lleva cuarenta barras de mitril y cinco barras de veraplata a Galvan el Antiguo en Tuercespina.', 'Dicen que la veraplata es más fuerte y duradera que el mitril. Galvan está de acuerdo con esta valoración de los minerales pero, al contrario de su nombre, ¡la veraplata no es verídica! ¡El mitril es un mineral mucho más noble! ¡JA! A pesar de todo, para esta lección necesitarás encontrar al mentiroso mineral, $n.$B$BTráeme cuarenta barras de mitril y cinco de veraplata. A cambio, aprenderás el secreto de los guantes de mitril ornamentado y, lo más importante, ¡aprenderás que la veraplata no tiene nada de verdad!', '', '', '', '', '', '', 33528),
(2360, 'esMX', 'Mathias y los Defias', 'Ve a los Páramos de Poniente y encuentra a la agente Kearnen para dar parte.', 'Justo a tiempo, $n. La división de reconocimiento del IV:7 ha informado sobre un aumento de actividad Defias en los Páramos de Poniente.$B$BParece ser que los Defias han tomado una atalaya abandonada de la Alianza al sureste de la Colina del Centinela y la están utilizando como base de operaciones para robar mercancías de la ruta de suministros de Crestagrana.$B$BVe a los Páramos de Poniente y contacta con la agente Kearnen para dar parte. La encontrarás escondida, cerca de la torre.$B$B... Y $n, si te descubrieran, el IV:7 negaría todo conocimiento de tu existencia.', '', '', '', '', '', '', 33528),
(2359, 'esMX', 'La torre de Klaven', 'Roba la Llave de la Torre Defias, entra en la Torre Defias y descubre qué contiene el Cofre del Bosque del Ocaso. Lleva toda la información que encuentres a Mathias Shaw de Ventormenta. Lee el diario de Kearnen para saber cómo acceder a la torre.|n', 'Hace semanas que vigilo esta torre, $n. Hace poco pasó un gran cargamento procedente del Bosque del Ocaso, y con él vinieron esos guardias.$B$B¿Qué son? Tu suposición es tan acertada como la mía: no son humanos.$B$BEn cualquier caso, en el cargamento había un cofre, supongo que es lo que guardaban esas abominaciones. El zombi con los pinchos tiene una llave que necesitaremos.$B$BConsigue esa llave, ve a la torre y averigua qué hay en ese cofre. Lleva a Mathias lo que descubras.', '', '', '', '', '', '', 33528),
(1428, 'esMX', '[DEPRECATED]La amenaza continua', 'Mata a 10 vomitatintas de marisma, 10 comecarnes de marisma y 10 oráculos de marisma, y después ve a ver a Katar al Pantano de las Penas.', 'Me complace comprobar que tu odio por los hombres-pez crece con el mío.$B$BBúscalos a lo largo de la playa y cuando te hayas hartado de combatir, vuelve a verme. Entonces hablaremos de una recompensa por tu diligencia.', '', '', '', '', '', '', 33528),
(1324, 'esMX', 'El diplomático desaparecido', 'Derrota al soldado Hendel en el Marjal Revolcafango.', '¡¿Qué?! ¡¿Vienes aquí acusándome de ser aliado de los Defias y crees que me voy a quedar callado mientras me insultas?! Algo me dice que llevas mucho tiempo planeando esto.', 'Somete al soldado Hendel', '', '', '', '', 'Vuelve con: Archimago Tervosh. Zona: Marjal Revolcafango.', 33528),
(1154, 'esMX', 'Prueba de conocimiento', 'Encuentra el Legado de los Aspectos y devuélveselo a Braug Espíritu Tenue que se encuentra cerca de la entrada de El Paso del Espolón en Sierra Espolón.', 'Has superado con éxito las pruebas de Dorn y sé que quieres hacer lo mismo con la siguiente. Muy bien, pero ten en cuenta que hasta el momento las pruebas han sido demasiado sencillas. Es fácil poner a prueba el cuerpo... pero la mente es un tema aparte.$B$BTe lo explicaré bien para que lo entiendas: encuentra el libro que yo te diga, estúdiatelo bien y responde la pregunta que te haga acerca de su contenido.$B$BQué libro, te estarás preguntando... El Legado de los Aspectos. Lo encontrarás en la parte baja de Dor\'danil, en el sur de Vallefresno, bajo la protección de los druidas muertos y sus asesinos.', '', '', '', '', '', '', 33528),
(1139, 'esMX', 'Las tablillas perdidas de Voluntad', 'Encuentra la tablilla de Voluntad y llévasela al consejero Belgrum en Forjaz.', 'Hemos conseguido frenar al clan Forjatiniebla al aislarlos de la Cumbre de Roca Negra pero aún no hemos completado la misión de Piemartillo. Su muerte no debe ser en vano. Soñaba con encontrar la tablilla de Voluntad: un fragmento de piedra grabado con magia de los mismísimos titanes para ayudar a imbuir de vida a sus creaciones dándoles voluntad propia, o al menos eso cuenta la leyenda.$B$BDebemos recuperar la tablilla antes de que lo haga el clan Forjatiniebla.$B$BRegresa a Uldaman, encuentra la tablilla y vuelve aquí inmediatamente.', '', '', '', '', '', '', 33528),
(1020, 'esMX', 'Cura de Orendil', 'Llévale la cura de Orendil a Pelturas Lunablanca en Astranaar, en Vallefresno.', '$n, ahora que está bañado en la luz sagrada de Elune, creo que el brebaje ayudará a la niña enferma. Por favor, llévalo a Astranaar y dáselo al padre de la niña, Pelturas Lunablanca.$B$BPara llegar a Astranaar, sigue el camino hacia el sur y luego al este. Si quieres llegar más rápido, habla con la centinela Avana.', '', '', '', '', '', '', 33528),
(727, 'esMX', 'Ir a Forjaz a buscar el \"Compendio\" de Yagyin', 'Dale el sigilo del Martillo a Gerrig Agarrahueso en La Caverna Abandonada de Forjaz.', 'La tablilla es muy reveladora. ¡Aunque no lo suficiente! ¡Ni de lejos!$B$BHay un cuaderno, un compendio que Yagyin escribió en otros tiempos. La... gente de los que huí... guardan este cuaderno en muchos lugares. Y sus más eruditos lo estudian. El conocimiento en él contenido es muy vasto. ¡Conocimiento para protegernos!$B$BVe a ver a Gerrig Agarrahueso. Se encuentra en una tienda de Forjaz, en La Caverna Abandonada. Muéstrale este sigilo y creerá que eres de los suyos. Pregúntale por el Compendio de Yagyin... ¡y tráemelo!', '', '', '', '', '', '', 33528),
(74, 'esMX', 'La leyenda de Stalvan', 'La página arrancada del diario que descubriste es tu siguiente pista.', 'Dentro de la caja encuentras varios objetos: reliquias familiares mohosas, unos trofeos de caza, un retrato de familia y algunos libros antiguos. Al fondo, debajo de un jarrón, descubres una página arrancada de un diario.', '', '', '', '', '', '', 33528);
